--Load Tables



CREATE TABLE [Campus] (
  [CampusID] [Int] IDENTITY (1,1) NOT NULL,
  [CampusName] [varchar] (100) NULL,
  PRIMARY KEY ([CampusID])
);

CREATE TABLE [CampusRooms] (
  [CampusRoomID] [Int] IDENTITY (1,1) NOT NULL,
  [CampusID] [Int] NULL,
  [Sub_Campus] [varchar] (35) NULL, 
  [Building] [varchar] (10) NULL,
  [Room] [varchar] (10) NULL,
  PRIMARY KEY ([CampusRoomID]),
  CONSTRAINT [FK_CampusRooms.CampusID]
    FOREIGN KEY ([CampusID])
      REFERENCES [Campus]([CampusID])
);

CREATE TABLE [Semester] (
  [SemesterID] [Int] IDENTITY(1,1) NOT NULL,
  [SemesterName] [varchar] (10) NULL,
  [SemesterYear] [Int] NULL,
  [StartDate] [DATE] NULL,
  [EndDate] [DATE] NULL,
  PRIMARY KEY ([SemesterID])
);

CREATE TABLE [Course] (
	[CourseID] [int] IDENTITY(1,1) NOT NULL,
	[CourseSubject] [varchar](10) NULL,
	[CourseNumber] [varchar](10) NULL,
	[CourseName] [varchar](150) NULL,
	[Level] [varchar] (10) Null,
	[Description] [varchar](1000) NULL,
	[CreditHours] [varchar] (10) NULL,
  PRIMARY KEY ([CourseID])
);

CREATE TABLE [Professors] (
  [ProfessorID] [Int] IDENTITY (1,1) NOT NULL,
  [ProfessorFName] [varchar] (50) NULL,
  [ProfessorLName] [varchar] (50) NULL,
  PRIMARY KEY ([ProfessorID])
);

CREATE TABLE [SubTerm] (
  [SubTermID] [Int] IDENTITY (1,1) NOT NULL,
  [SubNumber] [varchar] (10) NULL,
  [SubName] [varchar] (30) NULL,
  PRIMARY KEY ([SubTermID])
);

CREATE TABLE [CourseOffering] (
  [CourseOfferingID] [Int] IDENTITY (1,1),
  [CourseID] [Int] NULL,
  [SemesterID] [Int] NULL,
  [ProfessorID] [Int] NULL,
  [CampusRoomID] [Int] NULL,
  [Section] [varchar](10)  NULL,
  [SubTermID] [int] NULL,
  [Days] [varchar](10) NULL,
  [Time] [varchar](30) NULL,
  [CRN] [varchar](10) NULL,
  [CourseType] [varchar](100) NULL,
  PRIMARY KEY ([CourseOfferingID]),
  CONSTRAINT [FK_CourseOffering.ProfessorID]
    FOREIGN KEY ([ProfessorID])
      REFERENCES [Professors]([ProfessorID]),
  CONSTRAINT [FK_CourseOffering.CampusRoomID]
    FOREIGN KEY ([CampusRoomID])
      REFERENCES [CampusRooms]([CampusRoomID]),
  CONSTRAINT [FK_CourseOffering.SemesterID]
    FOREIGN KEY ([SemesterID])
      REFERENCES [Semester]([SemesterID]),
  CONSTRAINT [FK_CourseOffering.CourseID]
    FOREIGN KEY ([CourseID])
      REFERENCES [Course]([CourseID]),
  CONSTRAINT [FK_SubTerm.SubTermID]
    FOREIGN KEY ([SubTermID])
      REFERENCES [SubTerm]([SubTermID])
);

CREATE TABLE [Students] (
  [StudentID] [Int] IDENTITY (1,1),
  [StudentFName] [varchar](50) NULL,
  [StudentLName] [varchar] (50) NULL,
  PRIMARY KEY ([StudentID])
);

CREATE TABLE [GradeConverter] (
	[Letter] [varchar] (10),
	[Value] float NULL,
	PRIMARY KEY ([Letter])
);

CREATE TABLE [StudentGrades] (
  [StudentGradeID] [Int] IDENTITY(1,1) NOT NULL,
  [StudentID] [Int] NULL,
  [CourseOfferingID] [Int] NULL,
  [Grade] [varchar] (20) NULL,
  PRIMARY KEY ([StudentGradeID]),
  CONSTRAINT [FK_StudentGrades.CourseID]
    FOREIGN KEY ([CourseOfferingID])
      REFERENCES [CourseOffering]([CourseOfferingID]),
  CONSTRAINT [FK_StudentGrades.StudentID]
    FOREIGN KEY ([StudentID])
      REFERENCES [Students]([StudentID])
);

CREATE TABLE [Minors] (
  [MinorID] [Int] IDENTITY (1,1) NOT NULL,
  [MinorName] [varchar](100) NULL,
  PRIMARY KEY ([MinorID])
);

CREATE TABLE [StudentMinor] (
  [SMinorID] [Int] IDENTITY(1,1) NOT NULL,
  [StudentID] [Int] NULL,
  [MinorID] [Int] NULL,
  PRIMARY KEY ([SMinorID]),
  CONSTRAINT [FK_StudentMinor.MinorID]
    FOREIGN KEY ([MinorID])
      REFERENCES [Minors]([MinorID]),
  CONSTRAINT [FK_StudentMinor.StudentID]
    FOREIGN KEY ([StudentID])
      REFERENCES [Students]([StudentID])
);

CREATE TABLE [Major] (
  [MajorID] [Int] IDENTITY (1,1) NOT NULL,
  [MajorName] [varchar](100) NULL,
  PRIMARY KEY ([MajorID])
);


CREATE TABLE [Standing] (
  [StandingID] [int] IDENTITY(1,1) NOT NULL,
  [StudentID] [int] NULL,
  [SemesterID] [int]NULL,
  [StandingType] [varchar] (30) NULL,
  [List] [varchar](20) NULL,
  [StudentType] [varchar] (30) NULL,
  [Classification] [varchar] (15) NULL,
  PRIMARY KEY ([StandingID]),
  CONSTRAINT [FK_Standing.StudentID]
    FOREIGN KEY ([StudentID])
      REFERENCES [Students]([StudentID]),
  CONSTRAINT [FK_Standing.SemesterID]
    FOREIGN KEY ([SemesterID])
      REFERENCES [Semester]([SemesterID])
);

CREATE TABLE [StudentMajor] (
  [SMajorID] [Int] IDENTITY (1,1) NOT NULL,
  [StudentID] [Int] NULL,
  [MajorID] [Int] NULL,
  PRIMARY KEY ([SMajorID]),
  CONSTRAINT [FK_StudentMajor.MajorID]
    FOREIGN KEY ([MajorID])
      REFERENCES [Major]([MajorID]),
  CONSTRAINT [FK_StudentMajor.StudentID]
    FOREIGN KEY ([StudentID])
      REFERENCES [Students]([StudentID])
);

CREATE TABLE [StudentAdvisors] (
	[StuAdID] [Int] IDENTITY (1,1) NOT NULL,
	[StudentID] [Int] NULL,
	[SemesterID] [Int] NUll,
	[StudentType] [varchar] (50) NULL,
	[ProfessorID] [Int] NULL,
	PRIMARY KEY ([StuAdID]),
	CONSTRAINT [FK_StudentAdvisors.StudentID]
	  FOREIGN KEY ([StudentID])
	    REFERENCES [Students]([StudentID]),
	CONSTRAINT [FK_StudentAdvisors.ProfessorID]
	   FOREIGN KEY ([ProfessorID])
	    REFERENCES [Professors]([ProfessorID]),
	CONSTRAINT [FK_StudentAdvisors.SemesterID]
	   FOREIGN KEY ([SemesterID])
	    REFERENCES [Semester]([SemesterID])
);

