INSERT [dbo].[Course] ([CourseID],[CourseSubject],[CourseNumber],[CourseName],[Level],[Description],[CreditHours])
VALUES 
    (1,N'ACCT',N'B225',N'Fundamentals of Accounting I',N'UG',N'income_measurement_and_determination_of_financial_position',3),
    (2,N'ACCT',N'B226',N'Fundamentals of Accounting II',N'UG',N'Internal managerial and cost accounting, including budgeting, cost determination and analysis.',3),
    (3,N'ACCT',N'B325',N'Fraud Examination',N'UG',N'An overview of the different types of fraud, how and why they are committed, and the methodology for investigating and resolving allegations of fraud. Special emphasis is placed on detection and deterrence.',3),
    (4,N'ACCT',N'B335',N'Survey of Federal Taxation',N'UG',N'Federal tax law and preparation of individual income tax returns.',3),
    (5,N'ACCT',N'B345',N'Accounting Information Systems',N'UG',N'Accounting systems for business decision-making and effective control of the business enterprise.',3),
    (6,N'ACCT',N'B355',N'Cost Accounting',N'UG',N'(Prereq: ACCT B226) Preparation, critical analysis and use of management accounting information for purposes of strategic decision making, planning and control and performance measurement and evaluation.',3),
    (7,N'ACCT',N'B425',N'Intermediate Accounting I',N'UG',N'A detailed study of the preparation and presentation of the balance sheet, income statement, statement of retained earnings, and statement of cash flows. Includes a comprehensive analysis of financial transactions related to revenues and assets, with an emphasis on revenue recogition, and asset valuation issues.',3),
    (8,N'ACCT',N'B426',N'Intermediate Accounting II',N'UG',N'A continuation of the detailed study of the preparation and presentation of financial statements. Problem solving techniques and the ability to structure problem solutions will be stressed.',3),
    (9,N'ACCT',N'B429',N'Internship in Accounting',N'UG',N'Experiential learning in a public or private accounting setting. This course may be repeated once with the approval of the Department Chair and permission of the Instructor.',2),
    (10,N'ACCT',N'B437',N'Advanced Accounting',N'UG',N'(Prerequisite: a grade of C or better in ACCT B426) The detailed study of special advanced topics of accounting, including (1) accounting for business mergers and consolidations, subsequent activities and consolidated reporting of financial information,  (2) tax topics for business combinations, (3) relevant International Financial Reporting Standards, (4) accounting for legal reorganizations and liquidations, and (5) accounting for partnership formations, operations, and terminations.',3),
    (11,N'ACCT',N'B485',N'Auditing',N'UG',N'Principles of auditing necessary to evaluate the integrity of accounting systems and financial reporting.',3),
    (12,N'AFAM',N'B201',N'Introduction to African-American Studies I',N'UG',N'A broad introduction to the history, culture, religion, institutions, politics, economics, arts, and psychology of people of African descent as developed from experience in both the old and new worlds.',3),
    (13,N'AFAM',N'B202',N'Introduction to African-American Studies II',N'UG',N'NULL',3),
    (14,N'ANTH',N'B101',N'Primates, People and Prehistory',N'UG',N'An exploration of human origins, human evolution, human prehistory and cultural existence from its less complex forms to early civilizations. An introduction to the concepts, methods and data of physical, biological and archaeological anthropology. May be taken with, or independently of, ANTH 102.',3),
    (15,N'ANTH',N'B102',N'Understanding Other Cultures',N'UG',N'An exploration and comparison of selected contemporary cultures, including their languages. An introduction to the concepts, methods and data of socio-cultural anthropology and anthropological linguistics. May be taken with, or independently of, ANTH B101.',3),
    (16,N'ANTH',N'B301',N'NULL',N'UG',N'Comparative study of selected Latin American cultures with emphasis on their significance for a broader anthropological theory.',3),
    (17,N'ANTH',N'B302',N'NULL',N'UG',N'Application of techniques and insights of social and cultural anthropology to selected cultural settings in contemporary U.S.A.',3),
    (18,N'ANTH',N'B312',N'Contemporary Cross-Cultural Analysis',N'UG',N'An examination of conformity, conflict or stability, of human interactions across cultural boundaries both at home and abroad, the positive and negative consequences of increasing global interconnectedness and the role of culture change, ethnic identity or religious unity in creating contradictory social and political trends.',3),
    (19,N'ANTH',N'B317',N'North American Indian Cultures',N'UG',N'Comparative study of ethnographic data on American Indian cultures, with emphasis on their significance for ethnological theory.  ',3),
    (20,N'ANTH',N'B319',N'Principles of Archaeology',N'UG',N'An introducation to the principles, methods, and theory of archaelogy, including prehistroic and historic case studies.',3),
    (21,N'ANTH',N'B333',N'North American Prehistory',N'UG',N'Prehistroic anthropology in North America from the first arrival of man though the beginning of European acculturation.',3),
    (22,N'ANTH',N'B344',N'Anthropology of Tourism',N'UG',N'Drawing on tourism destinations, development agendas, and societies from around the globe, this course will critically examine the relationship between tourism and cultural identities and economies.',3),
    (23,N'ANTH',N'B351',N'The Family in Cross-Cultural Perspective',N'UG',N'Kinship, systems of descent, marriage and domestic organization in different cultures. Variations in childrearing practices, sex roles and other aspects of social relations in kin groups.',3),
    (24,N'ANTH',N'B352',N'Anthropology of Magic and Religion',N'UG',N'A comparative examination of such topics as ritual, cosmology, revitalization movements, magic, witchcraft, myth and possession.',3),
    (25,N'ANTH',N'B355',N'NULL',N'UG',N'{=BLIN 340}  Language in its social setting. The relationship between linguistic categories and culture categories. Language and cognition.',3),
    (26,N'ANTH',N'B371',N'NULL',N'UG',N'NULL',3),
    (27,N'ANTH',N'B385',N'Gender and Language Use',N'UG',N'The course will explore an approach to gender and language use that emphasizes the grounding in social practice of both.',3),
