    (36,N'ARTE',N'B350',N'Methods from Incorporting New Media in Art Education',N'UG',N'Applications of new media such as digital photography, sound and other interactive hypermedia for the art classroom. Emphasis on integrating art production with art history, art criticism and aesthetics.',3),
