    (38,N'ARTH',N'B105',N'History of Western Art I',N'UG',N'Survey of the major monuments and trends in the history of painting, sculpture and architecture from prehistory to the Middle Ages.',3),
    (39,N'ARTH',N'B106',N'History of Western Art II',N'UG',N'Survey of the major monuments and trens in the history of painting, sculpture and architecture from the Early Renaissance  to Contemporary.',3),
    (40,N'ARTH',N'B201',N'History of Animation in the US',N'UG',N'{? MART B201} A survey of popular animation in the United States, from early 20th century film to contemporary digital media, with an introduction to animation techniques using computer software.',3),
