    (76,N'ARTS',N'B345',N'Graphic Design II',N'UG',N'(Prerequisite: ARTS B102, B103, B104, B111, and B245) Digital production studio techniques for graphic design with a focus on typography and word/image relationships. Additional emphases includes: design issues, fundamental communication principles, image development, and relevant digital applications.',3),
    (77,N'ARTS',N'B362',N'Introduction to Digital Photography',N'UG',N'Focuses on creative and experimental uses of digital photography as both a visual communication tool and an art form that is related to, but separate from, traditional silver based photography. Student will be required to solve a sequenced series of visual problems as a means of exploring and mastering a variety of photographic methodologies and techniques.',3),
