    (81,N'ARTS',N'B390',N'Directed Studio Art Internship',N'UG',N'(Prereq: minimum 2.5 GPA, 24 hours of ARTS credits, and approved contract with the internship supervisor) Supervised professional experience working within an arts business. A contract approved by the instructor, advisor and department chair is required for undergraduate students. Minimum of 150 service hours required.',3),
