    (85,N'ARTS',N'B411',N'Advanced Painting II',N'UG',N'The student is given further opportunity to develop according to his/her own interests.',3),
    (86,N'ARTS',N'B412',N'Advanced Painting',N'UG',N'An advanced opportunity to develop according to one''s interests. Can be repeated for a total of 6 credit hours.',3),
    (87,N'ARTS',N'B415',N'Advanced Printmaking I',N'UG',N'The processes and materials of making fine prints.',3),
    (88,N'ARTS',N'B416',N'Advanced Printmaking II',N'UG',N'The processes and materials of making fine prints.',3),
    (89,N'ARTS',N'B417',N'Advanced Printmaking',N'UG',N'The processes and materials of making fine prints. Can be repeated for a total of 6 credit hours.',3),
    (90,N'ARTS',N'B420',N'Advanced Ceramics',N'UG',N'Further development of throwing and hand-building skills. Introduction to kiln firing and continued glaze and clay experimentation. Can be repeated for a total of 6 credit hours',3),
