    (97,N'ARTS',N'B485',N'Senior Exhibition',N'UG',N'A capstone course that focuses on a group exhibition that includes, artist: biography, resume, and statement with an online portfolio documenting the exhibition and other support materials.  All Art Majors are required to register for the Senior Exhibition in their senior year.',3),
    (98,N'ARTS',N'B490',N'Senior Seminar',N'UG',N'A capstone course including a group exhibition and the topics of: portfolios, cover letters, curriculum vitaes, artist resumes, and artist statements. Marketing strategies and preparation for graduate studies will also be discussed.  All Art Majors are required to register for the Senior Seminar in their senior year.',3),
    (99,N'ASTR',N'B111',N'Descriptive Astronomy I',N'UG',N'(Prereq: Grade of C or better in MATH B111/111L or a higher level mathematics course) The universe: physical processes and methods of study. Lectures, demonstrations, and laboratory experience. Designed primarily for the non-science major.',3),
    (100,N'ASTR',N'B111L',N'Descriptive Astronomy I Laboratory',N'UG',N'Selected topics from ASTR B111 studied in greater depth. Laboratory experience required of students who have not completed ASTR B111.',1),
    (101,N'ASTR',N'B211',N'Desciptive Astronomy II',N'UG',N'(Prereq: Grade of C or better in MATH B111/111L or  a higher level mathematics course) Study of Galactic Astronomy including stars, black holes and Galaxies.',3),
    (102,N'ASTR',N'B211L',N'Descriptive Astronomy II Laboratory',N'UG',N'Topics from ASTR B111/B211 studied in greater depth. Laboratory experience required of students who have not completed ASTR B111.',1),
    (103,N'BADM',N'B101',N'Contemporary Business',N'UG',N'The nature of American business and its goals. The course includes types of economic systems and concepts of organizing and managing businesses. Topics in management, marketing, finance and accounting will be integrated into the course. A topical survey of business issues and challenges.',3),
    (104,N'BADM',N'B150',N'Introduction to Personal Finance',N'UG',N'Financial Planning and literacy from a personal perspective. Topics include money management skills, taxes, banking, savings, credit, debt management, careers, consumer purchasing strategies, housing, insurance, investments, and retirement.',3),
    (105,N'BADM',N'B210',N'Financial Reasoning',N'UG',N'The course will provide an introduction to the financial concepts and principles that support business analyses and decision making.  The course will focus on important concepts such as:  the time value of money, stock and bond valuations, and interest rates and return.  In addition, the course will develop an understanding of financial statements and financial ratios.',3),
    (106,N'BADM',N'B290',N'NULL',N'UG',N'Use of computer applications to facilitate decision making and support record keeping in small business environments. Includes problem and requirements analysis and information design in a variety of real-world business problems utilizing word processing, spreadsheet and database software.',3),
    (107,N'BADM',N'B310',N'Health Economics',N'UG',N'(Prerequisite: ECON B221 or ECON B222 or PUBH B380) This course will help students develop the understanding of demand and supply side factors related to health care so they can apply economic principles to various aspects of health, health systems and health care.  ',3),
    (108,N'BADM',N'B324',N'Commercial Law',N'UG',N'Contracts, sales, bailments, negotiable instruments, agency, partnership and corporation. A combination of textbook and casebook methods of instruction is used.',3),
    (109,N'BADM',N'B345',N'Business Communications',N'UG',N'A study of effective methods of business communications including written, oral, electronic and organizational communication.',3),
    (110,N'BADM',N'B363',N'Business Finance',N'UG',N'The study of the procurement and management of wealth by privately owned profit-seeking enterprises.',3),
    (111,N'BADM',N'B379',N'Business Ethics',N'UG',N'A study of the values and ethics in business, business and government relations, corporate social performance and stakeholder responsibility. Social, economic, political, technological and ecological dimensions of the external environment will be integrated.',3),
    (112,N'BIOL',N'B303',N'Fundamental Genetics',N'UG',N'Basic principles of transmission and molecular genetics; quantitative inheritance; recombination; biochemical aspects of gene function and regulation; developmental genetics and population genetics. Three lecture hours per week.',3),
    (113,N'BADM',N'B380',N'Entrepreneurship',N'UG',N'This course is an overall introduction to the nature and scope of entrepreneurship. The entrepreneurial process as well as the entrepreneurial profile is examined in detail. It includes the planning, financing, launching and harvesting of a new venture. Entrepreneurial strategies are discussed for all facets of the business including franchising, growth and international aspects. Application of entrepreneurship to large corporations, i.e. entrepreneurship, is also a part of the course.',3),
    (114,N'BADM',N'B383',N'International Business',N'UG',N'Introduces the student to economic, financial, legal, political, cultural, institutional and managerial considerations associated with international business transactions.',3),
    (115,N'BADM',N'B396',N'Business Research Methods',N'UG',N'Focus is on the acquisition, use and evaluation of information from a manager?s perspective. The course will include problem diagnosis, research design, questionnaire preparation, sampling plans and the collection, analysis and interpretation of data as an aid to effective and efficient managerial decisions.',3),
    (116,N'BADM',N'B397',N'Topics in Business',N'UG',N'Study of varied business areas and issues that are not covered in existing course offerings. Course may be taken twice with different topics for a maximum of 6 credit hours.',3),
    (117,N'BADM',N'B399',N'Independent Study in Business',N'UG',N'(Prereq: Junior standing and an approved contract with instructor) Independent study courses are designed primarily for juniors and seniors who desire advanced intensive work on specific topics. Independent studies are not intended to substitute for courses listed in the USCB Bulletin. The maximum number of independent study hours a student may earn in business is limited to six. Contract approval by instructor and department chair is required.',3),
    (118,N'BADM',N'B429',N'Internship in Business',N'UG',N'(Prereq: Junior standing, 2.5 GPA, BMKT 350, BBAD 345 and an approved contract with the Internship Coordinator) This course provides students in all disciplines with the opportunity to reinforce classroom learning by working in their discipline in a supervised business environment. This course may be repeated with the approval of the Department Chair and the student?s academic advisor.',3),
    (119,N'BIOL',N'B100H',N'Biology Honors Seminar',N'UG',N'This seminar will an introduction to topics, information, reading and class field trips to reflect the honor''s experience in the first two years of the program.  Topics covered will include common readings, discussion of current research topics or current events, and professional development of the student.  Course can be taken for credit up to four semesters.',1),
    (120,N'BIOL',N'B101',N'Biological Principles I',N'UG',N'Introductory survey of cell structure and function, genetics and evolution. For biology majors, premed students and others needing a prerequisite in biological sciences. Three lecture hours and three laboratory hours per week.',4),
    (121,N'BIOL',N'B102',N'Biological Principles II',N'UG',N'Introductory survey of plant and animal systems, principles of development, physiology, reproduction and ecology. Three lecture hours and three laboratory hours per week.',4),
    (122,N'BIOL',N'B110',N'General Biology',N'UG',N'Basic biological concepts and issues for non-biology majors. Three lecture, two laboratory hours per week.',4),
    (123,N'BIOL',N'B120',N'Human Biology',N'UG',N'Fundamental principles of human biology. Three lecture hours per week. Not for major credit.',3),
    (124,N'BIOL',N'B120L',N'Human Biology Laboratory',N'UG',N'Exercises dealing with basic concepts of human biology. Not for major credit.',1),
    (125,N'BIOL',N'B200',N'Plant Science',N'UG',N'An introduction to plant science for the non-major. This course does not carry major credit and is not designed as a prerequisite for other biology courses. Plant development, physiology, genetics, evolution and ecology will be considered. Three lecture hours per week. ',3),
    (126,N'BIOL',N'B200L',N'Plant Science Laboratory',N'UG',N'Laboratory exercises, demonstrations and audiovisual supplements to BBIO 200. Two hours per week. Not for major credit. ',1),
    (127,N'BIOL',N'B230',N'Microbiology',N'UG',N'(Prerequisite: college-level biology) An introduction to bacteria and viruses, emphasizing structure, metabolism and pathogenesis. Discussion of infectious diseases, antigen-antibody relationships and anti-microbial agents in chemotherapy. Not available for biology major credit. Three lecture and three laboratory hours per week.',4),
    (128,N'BIOL',N'B232',N'Human Anatomy',N'UG',N'Functional anatomy of the human body and its relation to disease processes. Not for biology major credit. Three lecture and three laboratory hours per week',4),
    (129,N'BIOL',N'B234',N'Human Physiology',N'UG',N'Physiology of the human body, including Nervous, sensory, endocrine, muscle, circulatory, immune, respiratory, digestive, urinary and reproductive systems. Not available for biology majors? credit. 3 lecture and 2 laboratory hours.',4),
    (130,N'BIOL',N'B243',N'Human Anatomy and Physiology',N'UG',N'(Prerequisite: 1 year of high school (or higher) biology or chemistry with laboratory with a grade of B or better and BMTH 111L or placement into BMTH 111 or higher.) Functional anatomy and physiology of the human body, including the integumentary, skeletal, muscular and nervous systems. Not available for biology major credit. Three lecture hours and three laboratory hours per week.',4),
    (131,N'BIOL',N'B244',N'Human Anatomy and Physiology II',N'UG',N'Functional anatomy and physiology of the human body, including the cardiovascular, endocrine, excretory, reproductive, digestive and respiratory systems. Not available for biology major credit. Three lecture hours and three laboratory hours per week.',4),
    (132,N'BIOL',N'B270',N'Introduction to Environmental Biology',N'UG',N'Basic ecological principles and the impacts of human population growth and technology. Not for major credit.',3),
    (133,N'BIOL',N'B270L',N'Introduction to Environmental Biology Laboratory',N'UG',N'Demonstrations, data analyses, discussions and films relating to human ecology, resource use and environmental impact. Two hours per week. Not for major credit.',1),
    (134,N'BIOL',N'B271',N'Applied Enviromental Science',N'UG',N'Basic ecological principles on the functions and values of natural systems and how to apply those principles to designing the built environment in concert with nature.',3),
    (135,N'BIOL',N'B290',N'Weekly Seminar in Science',N'UG',N'(Prerequisite: Permission of instructor) Weekly seminar in science is a survey of scientific research seminars presented by both USCB researchers and visiting researchers from other institutions.  Format is that of a departmental seminar.  Grades are based on attendance and on a number of executive summaries of seminars by students taking the course for credit.  Class can be taken up to 4 times under different semesters.',1),
    (136,N'BIOL',N'B295',N'Directed Studies in Biology',N'UG',N'Study of a topic not otherwise available to student. May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor. Repeatable to a maximum of 6 credits.',1),
    (137,N'BIOL',N'B301',N'Ecology and Evolution',N'UG',N'Concepts of evolution, populations and population interactions; communities and ecosystems. Three lecture hours per week.',3),
    (138,N'BIOL',N'B301L',N'Ecology and Evolution Laboratory',N'UG',N'Experiments, exercises and demonstrations. Three hours per week.  ',1),
    (139,N'BIOL',N'B302',N'Cell and Molecular Biology',N'UG',N'Principles of eukaryotic cell structure, molecular organization and physiology. Genome organization and expression. Cell growth, division and cell-cell interactions. Three lecture hours per week.',3),
    (140,N'BIOL',N'B302L',N'Cell and Molecular Biology Laboratory',N'UG',N'Experiments, exercises and demonstrations. Three hours per week.',1),
    (141,N'BIOL',N'B395',N'Advanced Directed Studies in Biology',N'UG',N'Study of a topic not otherwise available to student. May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor. Repeatable to a maximum of 6 credit hours.',1),
    (142,N'BIOL',N'B399',N'Independent Study in Biology',N'UG',N'Contract approval by instructor, advisor, Department Chair and Vice Chancellor for academic affairs is required.',1),
    (143,N'BIOL',N'B401',N'Marine Internship',N'UG',N'(Prerequisite: Sophomore standing) Required paid or unpaid internship or field experience for gaining practical experience in marine biology. ',0),
    (144,N'BIOL',N'B405',N'Developmental Biology I',N'UG',N'An introduction to the descriptive and experimental embryology of animals. Living and preserved specimens will be used to demonstrate the basic processes of embryogenesis. Three lecture hours per week.',3),
    (145,N'BIOL',N'B405L',N'Developmental Biology I Laboratory',N'UG',N'Descriptive and experimental exercises related to embryology. One three-hour laboratory per week.',1),
    (146,N'BIOL',N'B410',N'Invertebrate Zoology',N'UG',N'Phylogenetic and comparative aspects of anatomy, physiology, reproduction and embryology of the invertebrates. Three lecture and one three-hour laboratory per week.',4),
    (147,N'BIOL',N'B411',N'Biology of Marine Organisms',N'UG',N'(Prereq: BBIO 101, BBIO 102) Biological concepts emphasizing adaptation to marine environments. Laboratory experiments emphasize principles and techniques of marine biological study. Three lecture and three laboratory hours per week. Scheduled field trips are required. ',4),
    (148,N'BIOL',N'B425',N'Marine Plants',N'UG',N'Diversity, distribution, physiology, ecology, evolution, and economic importance of marine algal, sea grass and mangrove communities. Three lecture and three laboratory hours per week. Scheduled field trips are required.',3),
    (149,N'BIOL',N'B430',N'Histology',N'UG',N'An introduction to the tissues that make up the human body. The microscopic anatomy of tissues is examined and discussed in terms of function and physiology. Three lecture hours and four laboratory hours per week. ',4),
    (150,N'BIOL',N'B431',N'Bacteriology',N'UG',N'Introduction to bacteria and viruses emphasizing ultra structure, physiology, genetics and growth. Discussion of public health, industrial and environmental microbiology.  Three lecture hours per week.',3),
    (151,N'BIOL',N'B431L',N'Bacteriology Laboratory',N'UG',N'Three laboratory hours per week.',1),
    (152,N'BIOL',N'B435',N'Neurobiology',N'UG',N'Descriptive and experimental aspects of the neural basis of behavior, emphasizing cellular and molecular mechanisms. Three lecture hours per week. ',3),
    (153,N'BIOL',N'B435L',N'Neurobiology',N'UG',N'Descriptive and experimental aspects of the neural basis of behavior, emphasizing cellular and molecular mechanisms.  One 3-hour laboratory per week.',1),
    (154,N'BIOL',N'B436',N'Ichthyology',N'UG',N'Phylogeny, morphology, behavior, and ecology of fishes. Three lecture and three laboratory hours per week. Several field trips are required.',4),
    (155,N'BIOL',N'B438',N'Marine Mammal Biology',N'UG',N'(Prerequisite: BIOL B301) Diversity, anatomy, ecology, energetics, and conservation of marine mammals. ',3),
    (156,N'BIOL',N'B438L',N'Marine Mammal Biology Lab',N'UG',N'(Prerequisite: BIOL B301; Corequisite: BIOL B438) Experimental aspects of marine mammal biology.  ',3),
    (157,N'BIOL',N'B441',N'Principles of Biochemistry',N'UG',N'{=CHEM B450}  A survey of fundamentals of biochemistry. ',3),
    (158,N'BIOL',N'B441L',N'Principles of Biochemistry Laboratory',N'UG',N'{=CHEM B450L}Three laboratory hours per week.',1),
    (159,N'BIOL',N'B448',N'Life and Death in the Salt Marsh',N'UG',N'Intensive Maymester course teaching field research methods, statistical design, and culminating in an independent research project on aspects of ecological processes of Beaufort and surrounding counties.  Students will spend more than 5 hours per day in classroom/field-laboratory context planning, developing, researching background, and carrying out their research project, approved and facilitated by course faculty.',4),
    (160,N'BIOL',N'B450',N'Biological Oceanography',N'UG',N'(Prerequisite: C or better in two of the three core courses: BIOL B301, B302, B303) Capstone course for the Marine Biology degree program that is an interdisciplinary introduction to biological oceanography. The course integrates physical, chemical, geological and biological principles into an overview of oceanic processes, with an emphasis on the influence of organisms on biogeochemical cycles. 3-50 minute lectures and 2.8-hour laboratory each week.   ',4),
    (161,N'BIOL',N'B451',N'Forensic Techniques and Data Analysis',N'UG',N'Current application of forensic data collection, analysis and interpretation in the legal process. Three lecture hours per week.',3),
    (162,N'BIOL',N'B460',N'General Physiology',N'UG',N'Functional mechanisms of vertebrate organ systems. Three lecture hours per week.',3),
    (163,N'BIOL',N'B460L',N'General Physiology Laboratory',N'UG',N'Experiments on vertebrate organ system functions using different animal models. One four-hour laboratory per week.',1),
    (164,N'BIOL',N'B461',N'Medical Parasitology',N'UG',N'The goal of this course is to introduce students to phylogenetic/taxonomic overview of the major groups of parasites with emphasis on parasites that are of medical or veterinary importance.',3),
    (165,N'BIOL',N'B461L',N'Medical Parasitology Laboratory',N'UG',N'The goal of this course is to introduce students to a phylogenetic/taxonomic overview of major groups of parasites and develop laboratory skills in parasite identification and morphology.',1),
    (166,N'BIOL',N'B470',N'Principles of Ecology',N'UG',N'Interactions of organisms and the environment; ecosystem structure and functions. Three lecture hours per week.',3),
    (167,N'BIOL',N'B470L',N'Principles of Ecology Laboratory',N'UG',N'Three lab hours per week.',3),
    (168,N'BIOL',N'B471',N'Conservation Biology',N'UG',N'Synthesis of current scientific trends in conservation biology. Emphasis will be placed on the preservation of biological diversity as well as its evolutionary potential. Laboratory/Seminar will review scientific literature and introduce modern molecular techniques in conservation biology and computer simulation modeling.',4),
    (169,N'BIOL',N'B475',N'Marine Ecology',N'UG',N'Structure, dynamics and interactions between populations and communities in marine ecosystems. Three lecture hours per week.',3),
    (170,N'BIOL',N'B475L',N'Marine Ecology Laboratory',N'UG',N'Laboratory and field exercises in coastal environments.',1),
    (171,N'BIOL',N'B476',N'Freshwater Biology',N'UG',N'(Prerequisite: BIOL B301 & B301L) This course provides an introduction to freshwater biology, with an emphasis on blackwater swamps, temperate and subtropical zone lakes, ponds and streams including species, populations, and communities that occupy these  environments.  ',3),
    (172,N'BIOL',N'B478',N'Herpetology',N'UG',N'Evolution, physiology, ecology and behavior of amphibians and reptiles. The lab portion of this course will focus on native amphibians and reptiles and their importance in local ecosystems.',4),
    (173,N'BIOL',N'B480',N'Molecular Marine Ecology',N'UG',N'Investigation of techniques and analysis of molecular data in marine organisms. Hands-on experience using molecular tools to investigate population genetic, ecological and systematic principles.',3),
    (174,N'COMM',N'B240',N'Media and Society',N'UG',N'An introduction to the history, evolution and cultural impact of traditional and digital platforms, enabling students to develop a critical perspective of media content.',3),
    (175,N'COMM',N'B250',N'Theories of Communication',N'UG',N'Investigation of theories and concepts used to explain communication. Includes oral communication.',3),
    (176,N'BIOL',N'B490',N'Marine Policy',N'UG',N'(Prerequisite: ?C? or better in two of the three core courses BIOL B301, B302, and B303) This course is an overview of strategies and current practices in marine and coastal policy and management and will examine relevant historical and current state, federal and international marine and coastal policy programs and issues.  Students will learn directly from professionals in government, academia and non-governmental organizations and stakeholders. Specific emphasis will be put on science communication to policymakers in current issues. This course will be heavily activity-based.',3),
    (177,N'BIOL',N'B498',N'Biological Research: An Introduction',N'UG',N'(Prereq: one 300-level or higher biological laboratory and consent of instructor) Methodologies of biological research with emphasis on hypothesis formation, research design and data collection and current issues in biology. Two lecture and six laboratory hours per week.',4),
    (178,N'BIOL',N'B499',N'Topics in Biology',N'UG',N'Current developments in biological sciences. Readings and research on selected topics. Course content varies and will be announced in the schedule of classes.',1),
    (179,N'CHEM',N'B101',N'Fundamental Chemistry',N'UG',N'A science elective surveying inorganic and solution chemistry. First of a terminal two-semester sequence.Three lecture, one recitation and two laboratory hours per week.',3),
    (180,N'CHEM',N'B102',N'Fundamental Chemistry II',N'UG',N'An introductory survey of organic and biochemistry. Three lecture, one recitation and two laboratory hours per week.',3),
    (181,N'CHEM',N'B105',N'Chemistry and Modern Man I',N'UG',N'A conceptual and qualitative approach to chemistry, its evolution, achievements and goals and its impact on technology, the environment and modern life and thought. (Specifically designed for non-science majors.) Three lecture hours per week.',3),
    (182,N'CHEM',N'B106',N'Chemistry and Modern Man II',N'UG',N'A continuation of Chemistry 105. Three lecture hours per week.',3),
    (183,N'CHEM',N'B106L',N'Chemistry and Modern Man Laboratory',N'UG',N'(Prereq: CHEM B105; Coreq: CHEM B106) Laboratory associated with CHEM 106. Three hours of laboratory per week.',3),
    (184,N'CHEM',N'B109',N'Chemistry of Living Things',N'UG',N'Chemical principles including the structure of and energy associated with matter; quantitative kinetic and equilibrium analysis of chemical and physical processes. Structure and function of biological macromolecules and the molecular basis of inheritance are surveyed. Specifically designed for non-science majors. Cannot receive credit for both CHEM B101 and B109. Three lecture, one recitation and two laboratory hours per week.',4),
    (185,N'CHEM',N'B111',N'General Chemistry I',N'UG',N'A survey of the principles that underlie all chemistry with applications illustrating these principles. Three lecture, one recitation and two laboratory hours per week.',4),
    (186,N'CHEM',N'B112',N'General Chemistry II',N'UG',N'A continuation of CHEM B111. Special emphasis on chemical equilibrium. Three lecture, one recitation and three laboratory hours per week.',4),
    (187,N'CHEM',N'B118',N'Computational Chemistry',N'UG',N'Introduction to the use of computers in solving chemical problems. One discussion and two laboratory hours per week.',3),
    (188,N'CHEM',N'B321',N'Quantitative Analysis',N'UG',N'Gravimetric, volumetric and introductory instrumental analysis. Three lecture and one recitation hours per week.',3),
    (189,N'CHEM',N'B321L',N'Quantitative Analysis Laboratory',N'UG',N'Lab associated with CHEM B321. Three laboratory hours per week.',1),
    (190,N'CHEM',N'B331L',N'Essentials of Organic Chemistry Laboratory I',N'UG',N'Laboratory safety, syntheses, separation and purification of carbon compounds.',1),
    (191,N'CHEM',N'B332L',N'Essential of OrganicI Chemistry Laboratory II',N'UG',N'Continuation of BCHM 331L. Spectroscopic identification of carbon compounds. For non-majors. Three laboratory hours per week.',1),
    (192,N'CHEM',N'B333',N'Organic Chemistry I',N'UG',N'Contemporary theories, nomenclature, reactions, mechanisms and syntheses of carbon compounds. Three lecture and one recitation hours per week.',3),
    (193,N'CHEM',N'B333L',N'Comprehensive Organic Chemistory I Laboratory',N'UG',N'Laboratory safety, synthesis, separation and purification of carbon compounds. Required for chemistry majors. Six laboratory hours per week.',3),
    (194,N'CHEM',N'B334',N'Organic Chemistry II',N'UG',N'Continuation of CHEM B333. Required for chemistry majors. Three lecture and one recitation hours per week.',3),
    (195,N'CHEM',N'B334L',N'Comprehensive Organic Chemistry II Laboratory',N'UG',N'Continuation of CHEM B333L. Spectroscopic identification of carbon compounds. Required for chemistry majors. Six laboratory hours per week.',3),
    (196,N'CHEM',N'B398',N'NULL',N'UG',N'Study of a topic not otherwise available to student.  May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor.  Repeatable to a maximum of 8 credit hours.',3),
    (197,N'CHEM',N'B399',N'Indpendent Study in Chemistry',N'UG',N'Contract approval by instructor, advisor, Department Chair and Vice Chancellor for academic affairs is required.',3),
    (198,N'CHEM',N'B450',N'Principles of Biochemistry',N'UG',N'A survey of fundamentals of biochemistry.',3),
    (199,N'CHEM',N'B450L',N'Principles of Biochemistry Laboratory I',N'UG',N'Three laboratory hours per week.',1),
    (200,N'CHEM',N'B496',N'Undergraduate Research in Chemistry',N'UG',N'(Prereq: consent of instructor) Introduction to the methods of chemical research. A written report on work accomplished is required at the end of each semester. Nine hours of library and laboratory per week.',3),
    (201,N'COMM',N'B140',N'Public Communication',N'UG',N'Public speaking and the principles and criticism of oral public communication, to include performance by students.',3),
    (202,N'COMM',N'B190',N'Introduction to Communication Studies',N'UG',N'An introduction to communication studies as a field of study, including the concepts, ideas, issues, research methods and theories associated with the discipline.',3),
    (203,N'COMM',N'B201',N'Interpersonal Communication',N'UG',N'Presents basic concepts for understanding communication in interpersonal relationships. It combines a theoretical approach with a skills approach to the study of interpersonal communication.',3),
    (204,N'COMM',N'B210',N'Writing Across Media Platforms',N'UG',N'Students will learn practical skills to help them succeed in writing for specifically online news environments.  Emphasis is given to clear and effective communication and professional standards as well as the need to tailor the message to the audience and the platform through which it is communicated.',3),
    (205,N'COMM',N'B215',N'Introduction to Communication Technologies',N'UG',N'Introduction to the relationships among communication, technology, and society and investigates the role of technology in the ways we communicate, interact, and think about our world.',3),
    (206,N'COMM',N'B216',N'Digital Communication Technologies',N'UG',N'(Prerequisite: COMM B140 or COMM B201) This course introduces students to digital communication technologies from both a theoretical and practical framework. Students will understand how to use communication technologies to advance communication strategies to multiple audiences. ',3),
    (207,N'COMM',N'B220',N'Communication and Popular Culture',N'UG',N'Explores the complex relationships of language, visual images, mediated communication, and cultural values.',3),
    (208,N'COMM',N'B225',N'Single Camera Production',N'UG',N'This course introduces students to the fundamentals of video production. Students will gain experience in pre-production, production, and post-production of short projects.',3),
    (209,N'COMM',N'B230',N'Organizational Communication',N'UG',N'Fundamentals of oral communication within business and professional settings. Includes performance.',3),
    (210,N'COMM',N'B255',N'Communication Studies Research',N'UG',N'An examination of the qualitative and quantitative methods employed in communication research. Includes oral presentation. ',3),
    (211,N'COMM',N'B300',N'Nonverbal Communication',N'UG',N'Examination of the dynamics of nonverbal behavior through exploration of scholarly research and the application of practical theory to foster greater understanding of nonverbal messages across social contexts.',3),
    (212,N'COMM',N'B303',N'Communication Law',N'UG',N'An overview of the key areas of First Amendment law, and the important U.S. Supreme Court cases that have addressed the Constitution''s guarantee of free speech and free press.',3),
    (213,N'COMM',N'B305',N'Television Studio Production I',N'UG',N'This course is devoted to learning the techniques of television studio production. Students will learn preproduction planning, script development, lighting design, audio design, the art of three studio-camera shooting, technical directing and studio television directing.',3),
    (214,N'COMM',N'B306',N'Media 2.0',N'UG',N'This course explores the changing environment of tradiational production and distribution of media. Students will engage in the production and distribution of their work on the internet.',3),
    (215,N'COMM',N'B307',N'Documentary Theory & Aesthetics',N'UG',N'This course is a theoretical consideration of documentary filmmaking, covering the subgenres, conventions, evolution, social impact, and contemporary issues of the genre. Students will watch and critique films that represent a variety of approaches to the genre.',3),
    (216,N'COMM',N'B308',N'Persuasion & Social Influence',N'UG',N'An in-depth exploration of the art and science of persuasion and social influence. Topics of study include definitions and models of persuasion, individual communicator characteristics important in the complex process of persuation, conformity and influence in groups, persuasive language and nonverbal cues, principles of rhetoric and rhetorical devices, compliace-gaining communication, motivational appeals, deception, and the ethical dimensions of persuasion and social influence.',3),
    (217,N'COMM',N'B310',N'Inactive Fall 2015 - Theories of Human Communication',N'UG',N'Investigation of theories and concepts used to explain human communication.  Includes oral presentation.',3),
    (218,N'COMM',N'B320',N'Inactive Fall 2015 - Communication Studies Research',N'UG',N'An examination of the qualitative and quantitative methods employed in communication research. Includes oral presentation.',3),
    (219,N'COMM',N'B325',N'Advocacy and Opposition',N'UG',N'Major focus on models of argument and how they are presented in various communication contexts.  Student debating included.',3),
    (220,N'COMM',N'B328',N'Introduction to Public Relations',N'UG',N'A cross-disciplinary approach to the practice of public relations and its role in contemporary society, including a theoretical and practical understanding of relationship management.',3),
    (221,N'COMM',N'B340',N'Oral Interpretation of Literature',N'UG',N'{=THEA B340}  A course designed to give an understanding of the principles involved in extracting meaning from the printed page and the oral presentation of that meaning in a lucid and stimulating manner.',3),
    (222,N'COMM',N'B342',N'Communication in Sports',N'UG',N'NULL',3),
    (223,N'COMM',N'B343',N'Classroom Communication',N'UG',N'This course is designed for prospective teachers/ trainers in all disciplines, at all levels. This course provides students both a cognitive and experiential understanding of the role of communication in the classroom.',3),
    (224,N'COMM',N'B345',N'Storytelling in Contexts',N'UG',N'This course analyzes the role of storytelling in everyday life. A variety of contexts will be examined and students will study storytelling techniques and use these to tell stories.',3),
    (225,N'COMM',N'B350',N'NULL',N'UG',N'NULL',3),
    (226,N'COMM',N'B385',N'Gender & Communication',N'UG',N'This course examines how the concepts of sex, gender, and sexuality affect human and mediated communication and, in turn, how cummincation affects our understanding of these concepts.',3),
    (227,N'COMM',N'B389',N'Small Group Communication',N'UG',N'The development of the attitudes, skills and knowledge of methods of effective participation in discussion in conferences, committees and other small groups.',3),
    (228,N'COMM',N'B390',N'Family Communication',N'UG',N'A basic introduction to the study of how communication is used in the family to develop, maintain, enhance or disturb marital and family relationships.',3),
    (229,N'COMM',N'B398',N'Topics in Communication Studies',N'UG',N'Reading and research on selected communication studies topics. Course content varies and will be announced in the schedule of classes by suffix and title.',3),
    (230,N'COMM',N'B399',N'Independent Studies',N'UG',N'Contract approval by instructor, advisor, Department Chair and Vice Chancellor for Academic Affairs is required.',3),
    (231,N'COMM',N'B400',N'Communication and Popular Culture',N'UG',N'(Prerequisite: Junior standing) COMM B400  Explores the complex relationships of language, visual images, mediated communication, and cultural values in popular culture.',3),
    (232,N'COMM',N'B401',N'Public Relations Campaigns',N'UG',N'An experiental-based seminar on the planning, development, and execution of a comprehensive public relations campaign for organizational or non-profit entities.',3),
    (233,N'COMM',N'B402',N'Sports Broadcasting',N'UG',N'The course provides a strong foundation into the field of sports broadcasting. Students will explore the key issues that drive the sports broadcasting industry and will participate in the production of sports braodcasting.',3),
    (234,N'COMM',N'B403',N'Documentary Production',N'UG',N'A course devoted to the study of techniques of producing documentaries on video. The work will be founded in an historical survey of the genre in film and television. The class will include single camera production projects by class production teams.',3),
    (235,N'COMM',N'B404',N'Power, Discourse & Social Identity',N'UG',N'This course examines notions of identity in public discourse. Students will be introduced to theories of discourse, identity, and power in public discourse (i.e., legal, mediated, policy, etc.) on current social issues.',3),
    (236,N'COMM',N'B405',N'Television Studio Production II',N'UG',N'This course is devoted to learning advanced techniques of television studio production. Students will extend previously learned skills of television studio production and will individually produce televsion shows to be aired on local outlets.',3),
    (237,N'COMM',N'B450',N'Intercultural Communication',N'UG',N'A study of cultural differences in human communication with focus on theoretical and experiential approaches toward gaining competence in communicating across cultures.',3),
    (238,N'COMM',N'B490',N'Communication Studies Capstone',N'UG',N'Provides students with the opportunities to integrate the knowledge and skills they have acquired as communication studies majors as well as provide experiences for students to exhibit competent communication skills learned during their program of study.',3),
    (239,N'COMM',N'B495',N'Internship in Communication Studies',N'UG',N'(Prerequisite:  Communication Studies Major only, 15 hours of communication studies, permission of instructor).  Provides students with the opportunity to applky skills and knowledge across socially and culturally diverse populations in a professional setting.  Minimum requirement of 150 service hours.',3),
    (240,N'CPLT',N'B290',N'Great Books of the West',N'UG',N'{=ENGL B290}   Selected masterpieces of Western literature, with emphasis on non-English language texts in translation which are foundational to literature in English, including works by Homer, Dante, Cervantes, Voltaire, Goethe and Flaubert.',3),
    (241,N'CPLT',N'B291',N'Introduction to Non-Western Literature',N'UG',N'{=ENGL B291} Selected masterpieces of non-western literature. Works may range from antiquity to the present.',3),
    (242,N'CPLT',N'B381',N'The Renaissance',N'UG',N'CPLT B381 - THE RENAISSANCE (3). {=ENGL B381} Literature of the Renaissance, in its cultural contexts, explored through representative works.',3),
    (243,N'CPLT',N'B382',N'The Enlightenment',N'UG',N'{=ENGL B382} Literature of the Enlightenment in its cultural contexts, explored through representative works.',3),
    (244,N'CPLT',N'B384',N'Realism',N'UG',N'{=ENGL B384} Literature of Realism in its cultural contexts, explored through representative works.',3),
    (245,N'CPLT',N'B385',N'Modernism',N'UG',N'{= ENGL B385} Literature of Modernism in its cultural contexts, explored through representative works.',3),
    (246,N'CPLT',N'B386',N'Postmodernism',N'UG',N'{=ENGL B386} Literature of Postmodernism in its cultural contexts, explored through representative works.',3),
    (247,N'CPLT',N'B395',N'Classical Drama',N'UG',N'{=ENGL B395} Representative plays by Greek and Roman dramatists.',3),
    (248,N'CPLT',N'B397',N'Modern European Drama',N'UG',N'{=ENGL B397} Continental plays from the mid-19th century to the present.',3),
    (249,N'CSCI',N'B101',N'Introduction to Computer Concepts',N'UG',N'(Prereq: two years of college preparatory mathematics or equivalent) History, application and social impact of computers; problem-solving, algorithm development, applications software and programming in a procedural language. Open to all majors.',3),
    (250,N'CSCI',N'B102',N'Introduction to HTML and CSS',N'UG',N'(Prereq: two years of college preparatory mathematics) Introduction to systematic computer problem-solving and programming for a variety of applications. Open to all majors.',3);
INSERT [dbo].[Course] ([CourseID],[CourseSubject],[CourseNumber],[CourseName],[Level],[Description],[CreditHours])
VALUES 
    (251,N'CSCI',N'B104',N'Software Design and Development',N'UG',N'(Prereq: two years of college preparatory mathematics). Develop a basic competence in scientific in scientific computing using the Matlab programming language. Previous programming experience is not required.',3),
    (252,N'CSCI',N'B145',N'Java Programming Algorithmic Design I',N'UG',N'Problem solving, algorithmic design and programming. Three lectures and two laboratory hours per week. Open to all majors.',4),
    (253,N'CSCI',N'B146',N'Algorithmic Design II',N'UG',N'Continuation of CSCI B145. Rigorous development of algorithms and computer programs; elementary data structures. Three lecture hours and two laboratory hours per week. Open to all majors.',4),
    (254,N'CSCI',N'B150',N'Introduction to Computational Science',N'UG',N'Topics include computing theories, programming languages, modeling/simulation and visualization tools, and case studies of problem solving and high performance computing in natural sciences.',3),
    (255,N'CSCI',N'B201',N'Introduction to Computer Security',N'UG',N'Introduction to the theory and practice of computer security, including security policies, authentification, digital certificates, firewalls, malicious code, legal and ethical issues, and incident handling. Not auditable.',3),
    (256,N'CSCI',N'B202',N'Introduction to Front-End Web Development',N'UG',N'(Prerequisites: CSCI B145 & CSCI B150) Application of programming techniques to the development of interactive, event-driven web applications. Brief coverage of document markup (HTML) and styling (CSS)  essentials, followed by significant coverage of scripting languages, libraries, and frameworks for manipulating the Document Object Model. ',3),
    (257,N'CSCI',N'B207',N'Computer System Administration',N'UG',N'(Prerequisite: CSCI B145 & CSCI B150) Account maintenance, backups, restoration, system configuration, resource allocation and monitoring, network management, peripheral administration, emphasis on Microsoft Windows and UNIX/Linux systems. ',3),
    (258,N'CSCI',N'B209',N'Special Topics in Computer Programming',N'UG',N'Programming and application development using selected programming languages. Course content varies and will be announced in the schedule of classes by suffix and title.',3),
    (259,N'CSCI',N'B211',N'Digital Logic Design',N'UG',N'Number systems, Boolean algebra, logic design, sequential machines.',3),
    (260,N'CSCI',N'B212',N'Introduction to Computer Architecture',N'UG',N'(Prerequisite: CSCI B211) Organization and architecture of computer systems hardware; instruction set architectures; addressing modes; register transfer notation; processor design and computer arithmetic; memory systems; hardware implementations of virtual memory, and input/output control and devices. ',3),
    (261,N'CSCI',N'B240',N'Introduction to Software Engineering',N'UG',N'Fundamentals of software design and development; software implementation strategies; object-oriented design techniques; ethics in software development.',3),
    (262,N'CSCI',N'B250',N'Mobile Application Development',N'UG',N'Introduction to Mobile application development fundamentals including development platforms, user interface design, data persistence, map Application Programming Interface.',3),
    (263,N'CSCI',N'B255',N'Introduction to Computational Biology',N'UG',N'Introduction to the Linux operating system, an introduction to computer science and programming using high-level languages, and a survey of various computational tools used in exploring and analyzing biological data',3),
    (264,N'CSCI',N'B265',N'Graphics, Multimedia and User-Interface Design',N'UG',N'Principles of windowing systems; Graphical interface design and implementation; Processing graphical data using a high level programming language.',3),
    (265,N'CSCI',N'B280',N'Computational Mathematics',N'UG',N'Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations, diagonalization, and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and engineering disciplines.',4),
    (266,N'CSCI',N'B317',N'Introduction to Digital Forensics',N'UG',N'{?ISAT B317} (Prerequisite: CSCI B201/ISAT B201 or Permission of Instructor) This course will provide students with an introduction to the field of digital forensics and e-discovery. Topics to be covered include the scientific method of digital forensics, electronic discovery, legal issues related to digital analysis, and mobile technologies. Students will learn basic procedures and requirements for conducting digital forensics on a variety of platforms, including Windows, iOS, and Android devices. ',3),
    (267,N'CSCI',N'B320',N'Database Systems Management',N'UG',N'Provides foundations of database systems for students with little prior database experience; topics include relational algebra, data models, schema design and normalization, storage management, query, transaction, concurrency control and consistency',3),
    (268,N'CSCI',N'B321',N'Database-Driven Applications Development',N'UG',N'Development of data-driven software for devices including smart phones, tablets, handheld units, and other general purpose computing platforms. Emphasis on database connectivity, design patterns, human-computer interfaces and usability.',3),
    (269,N'CSCI',N'B350',N'Techniques of Computation',N'UG',N'(Prerequisite: CSCI/MATH B280 [or MATH B230 and MATH B242], and CSCI B146 or CSCI B240 or consent) Core techniques in the scientific computing process; the focus is on numerical methods, data structures, and computing optimization.',3),
    (270,N'CSCI',N'B360',N'Operating Systems',N'UG',N'(Prereq: CSCI B145 or a high-level programming language). Introduction to operating systems. Topics include evolution of operating systems, components and performance, process management, memory management, file systems, security and advanced topics.',3),
    (271,N'CSCI',N'B365',N'Computer Graphics',N'UG',N'(Prerequisite: CSCI B240 and CSCI/MATH B280 [or MATH B230] or consent.) Graphics pipeline; 2D and 3D geometric objects and transformations; 2D and 3D viewing, clipping, lighting, and rendering processes; Perspective projections; Lighting and reflectance models; Shading models; Hidden surface elimination; 3D curves and surfaces; Color perception and color models.',3),
    (272,N'CSCI',N'B399',N'Independent Study',N'UG',N'Contract approval by instructor, advisor, Department Chair and Vice Chancellor for academic affairs is required.',3),
    (273,N'CSCI',N'B401',N'Information Security Principles',N'UG',N'(Prerequisite: CSCI B201) This course extends fundamental computer security concepts, practices, and issues, introducing students in the broader field of information security. Topics include: common attack/threat vectors; information security planning; information security prevention, detection, and response tools and approaches; risk and risk assessment; human factors in information security; legal, ethical, and professional issues. ',3),
    (274,N'CSCI',N'B409',N'Selected Topics in Computing',N'UG',N'(Prerequisite: Permission of Instructor) Intensive study of a particular topic or topics in computing. Course content varies and will be announced in the schedule of classes by topic title. May be repeated for credit under a different topic title.',3),
    (275,N'CSCI',N'B416',N'Introduction to Computer Networks',N'UG',N'Fundamental concepts in computer networks, protocols, and applications. Topics include: network architectures, transmission media, protocols, wireless networks, routing, security and latest topics.',3),
    (276,N'CSCI',N'B419',N'Mathematical Modeling',N'UG',N'CSCI B419- MATHEMATICAL MODELING (4).  {? MATH B419} (Prerequisite: C or better in MATH B142 and CSCI B104 or consent) Utilizes numerical and mathematical analysis to investigate experimental data and complex systems in science and/or engineering. Emphasis is on the mathematical modeling techniques and computer programming to explore applied problems.',3),
    (277,N'CSCI',N'B420',N'Database Management Systems II',N'UG',N'(Prerequisite: CSCI B320) This course explores advanced data manipulation and server-side programming techniques for use in enterprise Relational Database Management Systems (RDBMS). Topics include: platform specific programmatic extensions to Structured Query Language (SQL); stored procedure, function, and package implementation; trigger creation and usage; query optimization techniques; security considerations. ',3),
    (278,N'CSCI',N'B422',N'Introduction to Data Mining',N'UG',N'Introduction to information processing techniques and mathematical tools to assemble, access, and analyze data for decision support and knowledge discovery.',3),
    (279,N'CSCI',N'B426',N'Special Topics in Computer Networks and Distributed Computing',N'UG',N'(Prereq: BCSE 416.) Advanced topics in Computer Networks, course content varies and will be announced in the schedule of classes by suffix and title.',3),
    (280,N'CSCI',N'B437',N'Information Technology Project Management',N'UG',N'(Prerequisite: CSCI/ISAT B207 and MGMT B371, or consent of instructor) This course introduces students to project management concepts, techniques, and tools used by project managers to plan, initiate, manage and close information technology projects. Topics include: the systems approach to project management; application of a project management framework to the planning and management of scope, cost, people, expectations, risk, communications, and procurement; agile methodologies; project management software.  ',3),
    (281,N'CSCI',N'B450',N'Modeling and Simulation',N'UG',N'An introduction to modeling and simulation. Topics include fundamental techniques in designing, coding, and use of simulation software to represent actual or theoretical systems in order to observe their behavior and evaluate design correctness.',3),
    (282,N'CSCI',N'B452',N'Computer Game Development',N'UG',N'Game concept development; User interface design; Graphics (2D, 3D, animation, and advanced techniques); Game physics; Real-time interaction; Intelligent characters; Software engineering considerations.',3),
    (283,N'CSCI',N'B463',N'Introduction to Digital Image Processing',N'UG',N'Overview of digital image processing techniques and their applications; transforms, enhancement, analysis, segmentation, compression, color image processing; computer projects.',3),
    (284,N'CSCI',N'B466',N'Data Visualization',N'UG',N'Concepts of visualization and human vision system; hardware and software basics of computer graphics; visualization pipeline; data representation and processing in computer graphics; algorithms in rendering 2D and 3D geometry; image processing; applications of visualization in science and technology.',3),
    (285,N'CSCI',N'B469',N'NULL',N'UG',N'(Prereq:  BCSE 104 or BCSE 145, BMTH 230 or BCSE/BMTH 280, and BCSE 150) Architecture and interconnection of parallel computers; parallel programming models and applications; issues in high performance computing; programming of parallel computers; general purpose GPU programming and applications.',3),
    (286,N'CSCI',N'B470',N'Software Testing and Verification',N'UG',N'Testing theory and techniques for software systems; software development process, specification, black-box and white-box testing, configuration and compatibility testing, usability testing, quality assurance, testing planning, and documentation.',3),
    (287,N'CSCI',N'B499',N'Computational Science Co-op/Internship',N'UG',N'Practical full-time work experience in an area of Computational Science, selected by the student and approved by the Department Chair or Computational Science Program Coordinator. For 1 credit, 45 minimum internship work hours required; for 2 credits, 90 work hours, and for 3 credits, 135 work hours.',3),
    (288,N'CSCI',N'B500',N'Practical Computing for Computational Scientists',N'UG',N'Provides practical, hands-on experience in the use of computational tools commonly needed for research and data analysis. This course is taught using the Linux operating system and the Python programming language, including scientific computing libraries.',3),
    (289,N'CSCI',N'B501',N'Advanced Statistical Methods',N'UG',N'(Prereq: STAT B340 or consent of instructor) Advanced statistical methods. Topics include Bayes? Theorem, likelihood function and maximum likelihood estimates, frequentist statistical methods, Bayesian statistics and nonparametric methods.',3),
    (290,N'CSCI',N'B502',N'Numerical Analysis and Computing',N'UG',N'(Prereq: CSCI B280 and MATH B240, or consent of instructor) Numerical analysis and computing. Topics include nonlinear equations, differentiation and integration, linear systems, matrix factorizations, ODE and PDE, and spline functions.',3),
    (291,N'CSCI',N'B515',N'Topics in Computational Science',N'UG',N'(Prereq: undergraduate programming experience or consent) Introduction to topics in computational science. Course content varies and will be determined by the instructor.',3),
    (292,N'CSCI',N'B516',N'Data Communications and Networks',N'UG',N'(Prereq: undergraduate programming experience or consent of instructor) Structure, design and analysis of computer networks, protocols, and applications. Topics include network architectures, transmission media, protocols, security, latest topics, and network programming.',3),
    (293,N'CSCI',N'B520',N'Advanced Topics in Database Systems',N'UG',N'(Prerequisite: CSCI B320, or consent of instructor) Advanced topics in database systems and their implementation using SQL and its programmatic extensions. Topics include: advanced querying, optimization, stored logic development, and database security.',3),
    (294,N'CSCI',N'B522',N'Data Mining',N'UG',N'(Prereq: CSCI B501 or CSCI B502) Concepts and techniques of data mining. Topics include linear classification/regression, logistic regression, model regularization, decision trees, mixture models, and hidden Markov models.',3),
    (295,N'CSCI',N'B550',N'Systems Modeling and Simulation',N'UG',N'(Prerequisite: CSCI B500, B501, and B502, or consent of instructor) Introduction of computational tools, models, system dynamics, input and output analysis, and performance analysis. ',3),
    (296,N'CSCI',N'B563',N'Digital Image Processing',N'UG',N'(Prereq: CSCI B104, MATH B230 or B380, STAT B340 or consent of instructor) Digital image processing techniques and their applications; transforms, enhancement, analysis, segmentation, compression, color image processing; computer projects.',3),
    (297,N'CSCI',N'B566',N'Data Visualization',N'UG',N'(Prereq: CSCI B350 and CSCI B365, or consent of instructor) Scientific data visualization. Topics include visualization pipeline, data representation, visualization algorithms, image processing, applications in science and technology.',3),
    (298,N'CSCI',N'B569',N'High Performance Computing',N'UG',N'(prereq: CSCI B150, CSCI B104 or B145, MATH B230 or CSCI B380, or consent of instructor) Architecture and interconnection of parallel computers; parallel programming models and applications; issues in high performance computing; programming of parallel computers; general purpose GPU programming and applications.',3),
    (299,N'CSCI',N'B570',N'Software System Design and Implementation',N'UG',N'(Prereq: CSCI 500 or consent of instructor) Current practice and research in software design and implementation. Topics include project planning and management, requirement specification, design process, implementation, testing and reliability, documentation, and maintenance.',3),
    (300,N'CSCI',N'B599',N'Independent Study',N'UG',N'Research under the supervision of a faculty. The course may include directed readings, applied work, research on an existing or new project, or other activities deemed appropriate.',3),
    (301,N'CSCI',N'B601',N'Principles of Computer Security',N'UG',N'(Prerequisite: CSCI B201 or consent of instructor) Computer security principles and practice. Topics include: cryptographic tools, access control, database security, software security, network security, common attack vectors, intrusion detection, and security ethics.',3),
    (302,N'CSCI',N'B622',N'Data Management and Analytics',N'UG',N'(Prerequisite: CSCI B320 or consent of instructor) The management and systematic computational analysis of data. Topics include: structured and unstructured data management, data wrangling, computational analytics methodologies, and data visualization.',3),
    (303,N'CSCI',N'B699',N'Industrial or Research Internship',N'UG',N'Practical full-time work experience in an area of Computational Science, selected by the student and approved by the Department Chair or Computational Science Program Coordinator.',1),
    (304,N'CSCI',N'B797',N'Research Project',N'UG',N'Research under the supervision of a faculty member. A formal research report and professional presentation are required.',3),
    (305,N'CSCI',N'B799',N'Master''s Thesis',N'UG',N'Research under the supervision of a committee of three appropriate faculty members. The thesis must also be presented at an appropriate forum.',3),
    (306,N'CSXE',N'B200',N'Statics',N'UG',N'Overview of digital image processing techniques and their applications; transforms, enhancement, analysis, segmentation, compression, color image processing; computer projects',3),
    (307,N'CSXE',N'B211',N'Engineering Graphics and Visualization',N'UG',N'Principles and practice of visualization and graphical representation using modern computer-aided design tools.',3),
    (308,N'CSXE',N'B260',N'Solid Mechanics',N'UG',N'Basic concepts of stress and strain. Behavior of structures under applied loads including forces, torques, moments and combinations thereof. Deformations of elastic relationships between stress and strain.',3),
    (309,N'CSXE',N'B290',N'Thermodynamics',N'UG',N'Definitions, work, heat, energy. First law analysis of systems and control volumes. Second law analysis.',3),
    (310,N'CSXE',N'B310',N'Dynamics',N'UG',N'Kinematics of particles and rigid bodies. Kinetics of particles, emphasis on Newton?s second law: energy and momentum methods for the solution of problems. Applications of plane motion of rigid bodies.',3),
    (311,N'CSXE',N'B327',N'Design of Mechanical Elements',N'UG',N'Design against static failure and fatigue failure of structural members and machine parts; design and selection of components including fasteners, welds, shafts, springs, gears, bearings, and chain drives.',3),
    (312,N'ECON',N'B101',N'Consumer Economics',N'UG',N'The nature of American business and its goals. The course includes types of economic systems and concepts of organizing and managing businesses. Topics in management, marketing, finance and accounting will be integrated into the course. A topical survey of business issues and challenges.',3),
    (313,N'ECON',N'B221',N'Microeconomics',N'UG',N'Microeconomic analysis theory of the firm, market structure, cost and output determination; market pricing; income distribution and international economics. Students cannot receive credit for both ECON B221 and B224.',3),
    (314,N'ECON',N'B222',N'Macroeconomics',N'UG',N'Macroeconomic analysis: basic definitions and concepts: mechanics of pricing and the fundamentals of American capitalism; national income economics, income and employment theory and monetary and fiscal policy.',3),
    (315,N'ECON',N'B224',N'NULL',N'UG',N'Micro- and macroeconomic principles of markets, government policy and household or firm decision making. Open to all students. Credit not granted for both ECON B224 and ECON B221 or B222.',3),
    (316,N'ECON',N'B301',N'Money and Banking',N'UG',N'The role of money in the market economy. Commercial banks, the Federal Reserve System and monetary policy.',3),
    (317,N'ECON',N'B303',N'The International Economy',N'UG',N'Survey of international economic issues and institutions, from a historical point of view including the interconnections of economies around the world.',3),
    (318,N'ECON',N'B311',N'Issues in Economics',N'UG',N'The nature and causes of major economic problems facing the nation and its communities and policy alternatives designed to solve them. The philosophy and methodology of economics in social problem solving.',3),
    (319,N'ECON',N'B330',N'Beaufort Economy: Past, Present, Future',N'UG',N'(Offered only in Maymester)  We will explore the history of Beaufort County using economic models to understand how and why the Beaufort economy has changed and how the local economy will likely evolve over time. The goal of this course is to get students to understand market forces, the importance of capital, government, leadership and the dynamics of economic change.',3),
    (320,N'ECON',N'B364',N'Financial Institutions',N'UG',N'A study of the functions and operations of financial institutions and their relationships to the commercial banking system and the general economy. Attention is devoted to savings institutions, insurance companies, rural and urban real estate credit, consumer credit and associated topics.',3),
    (321,N'ECON',N'B406',N'Labor Economics',N'UG',N'A study of labor market institutions, trends in labor market activity and the effects of government policy on the labor market.',3),
    (322,N'EDCI',N'B100',N'Clinical Observation & Analysis',N'UG',N'Clinical experience in an early childhood setting. Observation and analysis in classroom setting includes focus on the following topics: learning climate, classroom management, lesson clarity instructional variety, task orientation, leaning process, student success, and performance outcomes and higher thought processes. ',3),
    (323,N'EDCI',N'B201',N'Teacher Cadet II',N'UG',N'(Prerequisite: EDCI B100) This course focuses on the dynamics of human learning and the psychological principles that serve as the foundation for educational practice. The general goal is to provide a basic introduction to research findings from the discipline of psychology that can be used to inform the planning and implementation of effective instructional practices in the classroom. ',3),
    (324,N'EDCI',N'B210',N'Clinical Observation and Analysis',N'UG',N'Clinical experience in an early childhood setting. Observation and analysis in classroom setting includes focus on the following topics: learning climate, classroom management, lesson clarity instructional variety, task orientation, leaning process, student success, and performance outcomes and higher thought processes.',3),
    (325,N'EDCI',N'B243',N'Resources in Teaching',N'UG',N'Introduction to technological resources relevant to the teaching profession including computer technology, educational software, and telecommunications.   This course focuses on examining how applying technology in the classroom can be used to support teaching and learning and addresses the methods and materials used for technology integration.',3),
    (326,N'EDCI',N'B320',N'Curriculum Planning, Technology, and Assessment in Secondary Education',N'UG',N'(Prerequisite or Corequisite: EDCI B100) Explores issues of development and education of adolescents including curriculum, instruction, activities, materials, and authentic assessment. Prospective teachers will understand the importance of differentiation and technology integration at all levels of instruction and assessment. Parental involvement, community resources, and collaborative relationships with specialists are included components of this course. ',3),
    (327,N'EDCI',N'B322',N'Cultural Diversity in Education',N'UG',N'This course prepares students to demonstrate an understanding of the depth and breadth of cultural diversity within the United States, as well as the ways that the intersections of cultures within the classroom shape teaching and learning outcomes.',3),
    (328,N'EDCI',N'B399',N'Independent Study in Education',N'UG',N'Contract approval by instructor, advisor, Department Chair and Vice Chancellor for academic affairs is required.',3),
    (329,N'EDCI',N'B400',N'Selected Topics in Education',N'UG',N'Intensive study of selected topics, themes, and/or interdisciplinary concerns in education. Course and content varies and will be announced in the schedule of classes by suffix and title.  Topics may include: Gifted Education; Teaching English Language Learners; Play, Music and Movement in Early Childhood Education; Classroom Management, Assessment & Approaches in Differentiating Instruction, etc.',3),
    (330,N'EDCI',N'B441',N'Organization and Management in the Diverse Classroom',N'UG',N'Structuring of the physical, social, and instructional environment to maximize learning in a supportive, diverse classroom. Development of a comprehensive understanding of practice, proactive, and reactive approaches to management with attention to motivation and culturally diverse settings will be addressed. Behaviorists and constructivist approaches, inclusive education, ESOL learner needs, conflict resolution, and the promotion of learning communities are components of this course.',3),
    (331,N'EDCI',N'B442',N'Organization & Management in the Secondary Classroom',N'UG',N'(Prerequisite: Admission into the Professional Program) Structuring of the physical, social, and instructional environment to maximize learning in a supportive, diverse secondary classroom. Development of a comprehensive understanding of practice, proactive, and reactive approaches to management with attention to motivation and culturally diverse settings will be addressed. Behaviorist and constructivist approaches, inclusive education, ESOL learner needs, conflict resolution, ABC Analysis, and the promotion of learning communities are components of this course. ',3),
    (332,N'EDCI',N'B599',N'Selected Topics in Education',N'UG',N'(Prerequisite: Permission of Instructor) Introduction to topics in education. Course content varies and will be determined by instructor. ',3),
    (333,N'EDEC',N'B340',N'Education of the Young Child',N'UG',N'A study of the physical, emotional, intellectual and social components of development, birth through age eight and their relationship to the education of the young child birth - age eight. Diagnosis and assessment of development are addressed. Programs serving young children and their families will be discussed. The administration of these programs as well as advocacy efforts are included. Observation and participation in early childhood settings is required.',3),
    (334,N'EDEC',N'B342',N'Curriculum Planning and Development in Early Childhood Education',N'UG',N'(Prerequisite or Co-requisites: EDCI B210; EDEC B340; EDPY B335). This curriculum course is designed for prospective teachers in the nursery, kindergarten and primary schools. The course explores various issues involved in the development and education of children from the ages of four to eight. Attention is given to learning activities, materials and equipment suitable for teaching at this level. Emphasis is given to appropriate methods for assessment of children ages four through eight and to the relationship of various subject areas to the physical, social, emotional and cognitive development of the child. Philosophy, history of early childhood education, classroom management, societal influences, parental involvement and community resources are included.',3),
    (335,N'EDEC',N'B345',N'Family in Early Life Childhood',N'UG',N'(Preq: Admission to Professional Program in Education) Principles, practices and content of family life and family-school relations as related to young children?s learning and development in various settings during the early childhood years, birth through eight. This course will provide a foundation for using family life knowledge in relating to young children and families in effective ways.',3),
    (336,N'EDEC',N'B435',N'Math Experiences in Early Childhood Education',N'UG',N'(Prerequisite: EDCI B210; Admission to the Professional Program in Education or permission of the Department Chair; Co-requisites: EDEC B436, EDEC B444, EDEC B440P). This methods course includes the basic content of the academic area of mathematics to be presented to PreK-3rd grade children. Developmentally appropriate experiences, learning activities, materials and equipment to aid in the development of math concepts in young children are presented. Diversity-related influences and needs of exceptional learners are also addressed.',3),
    (337,N'EDEC',N'B435P',N'ABEYANCE: Practicum in Teaching Mathematics in Early Childhood Education',N'UG',N'(admission to the Professional Program in Education or permission of Dept Chair). Supervised clinical experience in an early childhood setting. Observation and participation in a classroom setting is required with a focus on math learning experiences, materials and equipment. Seminar and group discussions are included.',1),
    (338,N'EDEC',N'B436',N'Science and Social Studies Experiences in Early Childhood Education',N'UG',N'(Prerequisite: EDCI B210; Admission to Professional Program in Education or permission of the Department Chair; Co-requisites: EDEC B435, EDEC B444, EDEC B440P). This methods course includes the basic content in the inquiry areas of science and social studies to be presented to PreK - 3rd grade children. Developmentally appropriate inquiry experiences, learning activities, materials and equipment are presented. Diversity-related influences and needs of exceptional learners are also addressed.',3),
    (339,N'EDEC',N'B436P',N'ABEYANCE: Practicum in Teaching Science and Social Studies in Early Childhood Education',N'UG',N'(admission to the Professional Program in Education or permission of Department Chair)  Supervised clinical experience in an early childhood setting.  Observation and participation in a classroom setting is required with a focus on science and social studies inquiry learning experiences, materials and equipment.  Seminar and group discussions are included.',1),
    (340,N'EDEC',N'B440P',N'Practicum: Teaching Integrated Lessons in Early Childhood Education',N'UG',N'Prerequisite: Admission to the Professional Program or permission of the Department Chair; Co-requisite EDEC B435, EDEC B436, and EDEC B444). Supervised clinical experience in an early childhood setting. Teacher candidates will apply principles of planning, instruction, assessment, management, and professionalism in diverse field-based settings serving students in grades P-3. Offered in Fall.',2),
    (341,N'EDEC',N'B444',N'Language Development and Communicative Skills',N'UG',N'(admission to the Education Professional Program or special permission by the Department Chair)  This course deals with the relationship of language development and thinking to teaching communicative skills to young children.  Specific areas covered include activities across the language arts curriculum strands: reading, writing, listening, speaking, viewing and visually representing.',3),
    (342,N'EDEC',N'B444P',N'Practicum in Teaching, Language, Communication and Critical Thinking in Early Childhood Education',N'UG',N'(Prereq: BEDC 210, Admission to Professional Program in Education or permission of Department Chair; Coreq: BEDE 444.) Supervised clinical experience in an early childhood setting.  Observation and participation in classroom setting is required with a focus on language, communication and critical thinking skills learning experiences, materials and equipment.  Seminars and group discussions included.',3),
    (343,N'EDEC',N'B469',N'Internship in Early Childhood Education',N'UG',N'(admission to Professional Program in Education and Internship) A program of observation and teachng in the public schools under the supervision of university and public school  personnel.',12),
    (344,N'EDEC',N'B476',N'Senior Seminar in Early Childhood Education',N'UG',N'The synthesis and critical evaluation of professional studies in early childhood education.',3),
    (345,N'EDEL',N'B320',N'Cirriculum Planning, Development and Assessment in the Elementary School',N'UG',N'This course explores issues involved in the development and education of children including curriculum, instruction, activities, materials, grouping, grading and appropriate methods of authentic assessment, as well as analysis of standardized test results in relation to the physical, social, emotional, and cognitive development of grade 2-6 learners for optimal learning. Parental involvement, community resources and collaborative relationships with specialists are included components of this course.',3),
    (346,N'EDEL',N'B330',N'Intergrating the Arts in Elementary Education: Art, Music and Movement',N'UG',N'Provides opportunities to develop competence in selecting and using a variety of high quality instructional methods, resources, and assessment strategies for teaching art, music, and movement to elementary children.',3),
    (347,N'EDEL',N'B431',N'Teaching Mathematics in the Elementary School',N'UG',N'Materials, resources, programs, and methods for teaching mathematics to diverse learners in grades 2-6. Problem solving, mathematical content and process connections, as well as assessment, diagnosis, and remediation will be addressed. Included are supervised practicum experiences that promote reflective teaching in elementary school settings.    Admission to the Department of Education''s Professional Program for Elementary Education.',3),
    (348,N'EDEL',N'B432',N'Teaching Science in the Elementary School',N'UG',N'Materials, resources, programs, and methods for teaching science in an inquiry format to diverse learners in grades 2-6. Included are supervised practicum experiences that promote reflective teaching in elementary school settings. Prerequisite:   Prereq: Admission to the Department of Education''s Professional Program for Elementary Education.',3),
    (349,N'EDEL',N'B434',N'Language Arts in the Elementary School',N'UG',N'This course focuses on methods of teaching language arts and writing in grades 2-6. Course content includes strategies for teaching the conventions of language, the writing process, writing traits, assessment methods, and incorporating content area reading and writing.   Prereq: EDCI 210, EDRD 218 and to the admission to the Department of Education''s Teacher Education Professional Program for Elementary Education.',3),
    (350,N'EDEL',N'B440P',N'Math/Science Practicum',N'UG',N'Supervised clinical experience in an elementary education setting. Teacher candidates will apply principles of planning, instruction, assessment, management, and professionalism in diverse field-based settings serving students in grades 2-6. Offered in Fall.',3),
    (351,N'EDEL',N'B441',N'Organization and Management in a Diverse Classroom',N'UG',N'Structuring of the physical, social, and instructional environment to maximize learning in a supportive, diverse classroom. Development of a comprehensive understanding of practice, proactive, and reactive approaches to management with attention to motivation and culturally diverse settings will be addressed. Behaviorists and constructivist approaches, inclusive education, ESOL learner needs, conflict resolution, and the promotion of learning communities are components of this course.  Admission to the Department of Education''s Teacher Education Professional Program for Elementary Education.',3),
    (352,N'EDEL',N'B443',N'Teaching Social Studies in the Elementary School',N'UG',N'Materials, resources, programs, and methods for teaching social studies to grades 2-6 for learners to become well-informed citizens in a culturally diverse and democratic society. Included are supervised practicum experiences that promote reflective teaching in the elementary school setting.  Prereq: Admission to the Department of Education''s Professional Program for Elementary Education.',3),
    (353,N'EDEL',N'B470',N'Internship in Elementary School',N'UG',N'A program of observation and teaching in the public schools under the supervision of university and public school personnel.',12),
    (354,N'EDEL',N'B476',N'Senior Seminar',N'UG',N'The synthesis and critical evaluation of professional studies in elementary education.',3),
    (355,N'EDEX',N'B300',N'Introduction to Exceptional Learner',N'UG',N'(Admission to the Professional Program or permission of Department Chair). A survey of the development of special education, the current legal guidelines with emphasis on public school mandates, the various clusters of exceptionalities: their definition, classification, identification, prevalence, causes, characteristics and educational needs, including mainstreaming in the regular classroom.',3),
    (356,N'EDEX',N'B301',N'Introduction to Exceptional Populations at the Secondary Level',N'UG',N'(Prerequisite: EDRD B319 & EDCI B320) Introductory course designed to survey the development of special education in high school settings; the current legal guidelines with emphasis on public school mandates; the various clusters of exceptionalities, their definitions, classification, identification, prevalence, causes, characteristics, education needs; and the inclusion of students with exceptionalities within the general education classroom at the secondary level. ',3),
    (357,N'EDFO',N'B321',N'Foundations of American Education',N'UG',N'Extensive treatment of social, political, economic and philosophical influences that have shaped public education. Study of the financial, organizational and legal aspects of education. Library assignments provide a working knowledge of professional standard references and journals.',3),
    (358,N'EDFO',N'B357',N'Sociology of Education',N'UG',N'{=SOCY B357} Analysis of educational institutions, organizations, processes and their effects in contemporary society.',3),
    (359,N'EDME',N'B430',N'Teaching Mathematics in the Secondary School',N'UG',N'(Prereq: Admission to professional program in education; Coreq: EDME B430P) This course includes teaching methods for secondary mathematics education.',3),
    (360,N'EDME',N'B430P',N'Practicum in Teaching Mathematics in the Secondary School',N'UG',N'(Prereq: Admission to professional program in education; Coreq: EDME B430) Supervised clinical experience in a secondary mathematics setting. Observation and participation in a classroom setting is required.',3),
    (361,N'EDME',N'B469',N'Internship in Secondary Mathematics Education',N'UG',N'A program of observation and teaching secondary mathematics in the public schools under the supervision of university and public school personnel.',12),
    (362,N'EDME',N'B476',N'Senior Seminar in Secondary Mathematics Education',N'UG',N'The synthesis and critical evaluation of professional studies in secondary mathematics education.',3),
    (363,N'EDPH',N'B231',N'Personal and Community Health',N'UG',N'A study of the principles and practices of personal and community health and their application to the health education of the young child.',3),
    (364,N'EDPY',N'B333',N'Introduction to Child Growth and Development',N'UG',N'Basic course designed to familiarize the prospective teacher with the patterns of social, emotional, physical and intellectual growth of the individual. Development of these growth patterns from the prenatal stage to the onset of adolescence.',3),
    (365,N'EDPY',N'B334',N'Adolescent Growth and Development',N'UG',N'The study of adolescent physical, intellectual and emotional development. Particular emphasis is placed on the social interactions of adolescents with each other and society at large.',3),
    (366,N'EDPY',N'B335',N'Introduction to Educational Psychology',N'UG',N'(Prereq or Coreq: BEDC 210)  This course will introduce pre-service teachers and education majors to psychological principles, theory and data upon which effective classroom practices are based, including general methods and techniques.  A variety of teaching methods for classroom management will be considered with the focus on the teacher as a decision maker in planning, evaluation and control.  Emphasis will be placed on student motivation, learning problems, individual differences ad measurement.',3),
    (367,N'EDPY',N'B355',N'Introductional to Educational Psychology',N'UG',N'This course will introduce pre-service teachers and education majors to psychological principles, theory and data upon which effective classroom practices are based, including general methods and techniques.  A variety of teaching methods for classroom management will be considered with the focus on the teacher as a decision maker in planning, evaluation and control.  Emphasis will be placed on student motivation, learning problems, individual differences and measurement.',3),
    (368,N'EDPY',N'B635',N'Advanced Educational Psychology',N'UG',N'(Prerequisite: Permission of Department) This course will introduce and illustrate the proper use of learning theories in providing insights into defining and solving problems that may be encountered in educational settings. The emphasis will be on the use of these theories to solve realistic and relevant problems drawn from the classroom teacher?s own personal experience or from cases in the readings. ',3),
    (369,N'EDRD',N'B218',N'Children''s Literature',N'UG',N'Reading interests of children and their curricular and developmental needs for literature are explored. The course presents basic information in the field of children?s literature including authors, illustrators and appropriate reference materials.',3),
    (370,N'EDRD',N'B318',N'Foundations of Reading',N'UG',N'This course focuses on the foundations of reading, including language development, phonemic awareness, phonics, vocabulary, fluency, and comprehension. Offered in Fall.',3),
    (371,N'EDRD',N'B319',N'Foundations of Reading for Secondary Teachers',N'UG',N'This course provides the basics of teaching reading and writing in secondary content classes. Candidates will be prepared to support students in grades 9-12 who are struggling to read, write, and comprehend information through assessment and differentiation.',3),
    (372,N'EDRD',N'B418',N'Children''s Literature',N'UG',N'Reading interests of children and their curricular and developmental needs for literature are explored. The course presents basic information in the field of children?s literature including authors, illustrators and appropriate reference materials.',3),
    (373,N'EDRD',N'B419',N'Content Literacy for Secondary Teachers',N'UG',N'This course provides 7-12 grade teachers with the strategies for teaching literacy within the framework of content area classes. The course teaches a sound theoretical knowledge of academic vocabulary, nonfiction texts structures and strategies for analyzing texts to improve the knowledge base.',3),
    (374,N'EDRD',N'B420',N'Emergent Reading Methods and Assessment',N'UG',N'(admission to the Professional Program or special permission of the Department Chair)  This course focuses on literacy development, acquisition of phonemic awareness and phonics, evidence-based methods of reading instruction and the use of effective assessments for emergent readers.',3),
    (375,N'EDRD',N'B420P',N'Abeyance - Practicum in Emergent Reading',N'UG',N'(admission to the Education Professional Program or special permission of the Department Chair).  This practicum provides supervised clinical experience in an emergent literacy setting.  Demonstration teaching in a classroom setting is required, with a focus on assessment and remediation of struggling readers.',1),
    (376,N'EDRD',N'B421',N'Teaching Reading: Diagnosis and Remediation',N'UG',N'(Prereq: BEDR 420 and 420P and Admission to Educational Professional Program or special permission of Department Chair) Clinical and classroom aspects of teaching students with reading difficulties are explored with emphasis on testing procedures, instructional materials, and teaching techniques. Issues of diagnosing and teaching based upon the state mandated testing.',3),
    (377,N'EDRD',N'B425',N'Assessment of Literacy for Early Childhood and Elementary Teachers',N'UG',N'This course instructs teacher candidates to administer and analyze a variety of formal and informal assessments for screening and diagnosis of reading problems at the early childhood and elementary level. The course utilizes both standardized and portfolio assessments.  Offered in Spring.  Pre-requisite: Admission to the Professional Program or special permission of the Department Chair and EDCI B210, EDCI B243, and EDRD B318.  Co-requisite: EDRD B430/EDRD 450P.',3),
    (378,N'EDRD',N'B428',N'Content Area Literacy for Early Childhood and Elementary Teachers',N'UG',N'This course is designed to instruct teacher candidates, grades pre-K through 6, in developing methods and materials that will improve their students? literacy skills in content area reading and writing. Offered in Fall.  Admission to the Professional Program or special permission of the Department Chair and EDCI B210, EDCI B243, and EDRD B318.',3),
    (379,N'EDRD',N'B429',N'Content Literacy for Secondary Teachers',N'UG',N'This course provides 7-12 teachers with the strategies for teaching literacy within the framework of content area classes. The course teaches a sound theoretical knowledge of academic vocabulary, nonfiction texts structures and strategies for analyzing texts to improve the knowledge base.',3),
    (380,N'EDRD',N'B430',N'Instructional Strategies in Literacy for Early Childhood Teachers',N'UG',N'(Prerequisite: EDCI B100, EDCI B243, EDRD B318; Admission to the Professional Program or special permission of the Department Chair. Corequisite: EDRD B425 & EDRD B450P) This course focuses on research-based instructional strategies for literacy in early childhood classeooms. Course content includes cooperative learning, critical literacy, Reader''s and Writer''s Worksop. Specific instruction in the five elements of teaching reading: phonics, phonemic awareness, fluency, vocabulary and comprehension and the 6+1 traits of writing. ',3),
    (381,N'EDRD',N'B430P',N'Abeyance - Practicum in Intermedite Reading',N'UG',N'(admission to the Education Professional Program or special permission of the Department Chair).  This practicum provides supervised clinical experience in an elementary grade setting.  Demonstration teaching in a classroom setting is required, with a focus on assessment and remediation of struggling readers.',1),
    (382,N'EDRD',N'B433',N'Instructional Strategies for Elementary Teachers',N'UG',N'(Prerequisite: Acceptance into the Department of Education''s Professional Program) This course focuses on research-based instructional strategies for literacy in elementary classrooms. Course content includes cooperative learning, critical literacy, Reader''s and Writer''s Workshop. Specific instruction in the five elements of teaching reading: phonics, phonemic awareness, fluency, vocabulary and comprehension. Reading comprehension and writing processes across the content areas are also included.  ',3),
    (383,N'EDRD',N'B450P',N'Literacy/Social Studies Practicum',N'UG',N'Supervised clinical experience in an early childhood or elementary setting. Teacher candidates will demonstrate proficiency in planning, assessing and teaching various methods of reading and providing individualized differentiated instruction for struggling/ELL students.',3),
    (384,N'EDRD',N'B619',N'Foundations of Reading',N'UG',N'(Prerequisite: Permission of Department) This course provides candidates with comprehensive knowledge of the social, cultural, and linguistic factors that influence reading development. Emphasis is placed on practical application of theory, oral language development, phonemic awareness and phonics.',3),
    (385,N'EDRD',N'B623',N'Differentiation in Reading Instruction',N'UG',N'This course requires that students conduct in-depth study of effective literacy methods, materials, and formative assessment for K-12 classrooms. Emphasis is on serving the instructional needs of diverse students, including the gifted and talented, culturally and linguistically diverse learners, and children and young people with disabilities. ',3),
    (386,N'EDRD',N'B624',N'Assessment & Instructional Strategies for Reading for ELLs',N'UG',N'(Prerequisite: Department Permission) This course focuses on determining reading and language needs of English learners through the use of screening and diagnostic assessments and using that information to inform teaching of English learners within the classroom setting. Candidates learn to administer quick assessments and design instruction and how instruction varies and students acquire language. Candidates choose one student''s data to present in a case study format.  ',3),
    (387,N'EDRD',N'B625',N'Assessment Strategies for Reading Assessment Strategies for Reading',N'UG',N'Teachers will examine various types of assessments that will determine students? strengths and areas for further instruction. Teachers will analyze existing data from multiple levels: individual students, groups of students (class level), grade levels, school, district, state, and national level data. They will explain assessment results and demonstrate the ability to advocate for appropriate literacy practices to relevant stakeholders. Teachers will also be able to locate and administer non-biased assessments to culturally and linguistically diverse student. This course aligns with Read to Succeed Legislation requirements for in-service teachers. ',3),
    (388,N'EDRD',N'B629',N'Content Area Reading and Writing',N'UG',N'After gaining a sound theoretical knowledge of the reading and writing processes in nonfiction text, teachers will apply what they have learned to their own disciplines, creating strategies that will support students in reading and writing within the context of content area instruction. ',3),
    (389,N'EDRD',N'B632',N'Action Research for Literacy Education',N'UG',N'Candidates will gain skills necessary for conducting action research in literacy education and coaching.  This includes assessing the needs of teacher/students, identifying research-based interventions, designing and implementing a coaching plan including identification of assessment to document effectiveness of plan, and assessing effectiveness of coaching plan. ',3),
    (390,N'EDRD',N'B640P',N'Practicum in Assessing & Teaching English Language Learners',N'UG',N'(Prerequisite: Department Permission) Supervised clinical experience in literacy that is implemented within the classroom. Candidates will practice proficiency in planning, assessing, and teaching using various methods of reading and writing that serve the needs of English Language Learners. The main assessment for this course is a diagnostic reading case study. ',3),
    (391,N'EDRM',N'B620',N'Educational Research, Design, and Analysis',N'UG',N'This course provides an overview of the principles, models, and techniques of educational research. A substantial portion of this course focuses on the acquisition of critical reading skills and on the analysis and interpretation of data produced by educational investigation and inquiry. ',3),
    (392,N'ENGL',N'B101',N'Composition and Rhetoric',N'UG',N'An introduction to university-level writing, emphasizing the rhetorical approaches necessary to understand other writers'' purposes and stances, create effective writing, and develop processed for composing texts for academic, civic, professional, and personal purposes.  ',3),
    (393,N'ENGL',N'B101L',N'Intensive English Composition Laboratory',N'UG',N'Intensive practice in English composition. Special attention devoted to thesis formation, essay structure, paragraph structure, style and mechanics.  (Students may place out of BENG 101L with a sufficiently high score on USCB?s English Placement Test.)',1),
    (394,N'ENGL',N'B102',N'Composition and Literature',N'UG',N'An extension of composition skills developed in ENGL B101 and an introduction to literature, emphasizing the interpretive skills and processes necessary to read complex and imaginative texts creatively, critically, and rhetorically so students can write responses to - and interventions in - the world around them. ',3),
    (395,N'ENGL',N'B105',N'Enhanced Composition',N'UG',N'For English majors, humanities majors, and all word-lovers: an enhanced version of ENGL B101. An introduction to genres of writing, including (but not limited to) researched arguments.',3),
    (396,N'ENGL',N'B106',N'Enhanced Composition and Literature',N'UG',N'For English majors, humanities majors, and all word-lovers: an enhanced version of ENGL B102. An introduction to literary interpretation and the writing of researched arguments about literature.',3),
    (397,N'ENGL',N'B180',N'Introduction to Film',N'UG',N'Introduction to critical analysis of film (for all majors).',3),
    (398,N'ENGL',N'B190',N'Introduction to Journalism and Media Studies',N'UG',N'Introduction to practical skills of contributing to and running a print publication supported by analysis of various media and communication paradigms.',3),
    (399,N'ENGL',N'B191',N'Journalism Laboratory',N'UG',N'Supervised participation in the production of the Tidal Tribune. May be repeated for up to 8 credits.',1),
    (400,N'ENGL',N'B200',N'Introduction to English Studies',N'UG',N'An introduction to the history, present state, and potential futures of English Studies with an emphasis on the distinctive fields, methods, and terminology employed in the discipline of English.',3),
    (401,N'ENGL',N'B211',N'Editing and Publishing Practicum',N'UG',N'Provides students with practical experience in editing and publishing through their work on the critical journal or literary magazine; may be taken up to 6 times for credit.',1),
    (402,N'ENGL',N'B215',N'Writing Center Practicum',N'UG',N'Provides students with ongoing practice and training in teaching and tutoring writing. May be taken up to 6 times for credit.',1),
    (403,N'ENGL',N'B222',N'Creative Writing Across the Curriculum',N'UG',N'Introductory level workshop designed to foster a student?s appreciation for, and ability to create brief works of adult level fiction, poetry, nonfiction, and drama. Appropriate for students from any discipline.',3),
    (404,N'ENGL',N'B244',N'Introduction to Rhetorical Theory',N'UG',N'This course acquaints students with historic and current rhetorical theory.',3),
    (405,N'ENGL',N'B250',N'Copyediting and Document Design',N'UG',N'(Prerequisite: ENGL B102 with a grade of ''C'' or better) This course gives students an overview of the skills necessary to prepare texts (in a range of media) for publication: copyediting and document design. Students will learn to design texts for greater readability, and to complete document reviews including grammar/style, copyediting notations, and fact-checking.',3),
    (406,N'ENGL',N'B262',N'Introduction to Technical Writing',N'UG',N'(Prerequisite: ENGL B102 with a grade of ''C'' or better) An introduction to the basic concepts, processes, and genres of technical writing. Students practice using technical writing skills to communicate specialized or technical information to non-specialist audiences. Recommended for engineers, scientists, and computer scientists.',3),
    (407,N'ENGL',N'B263',N'Introduction to Workplace Writing',N'UG',N'(Prerequisite: a grade of C or better in ENGL B102) An introduction to rhetorically-effective writing for workplace audiences, including common workplace genres (e.g. professional emails, reports, and resumes) and practice in collaborative writing, document design, and revision.',3),
    (408,N'ENGL',N'B266',N'Professional Writing Practicum',N'UG',N'A practicum in professional writing, allowing students to complete projects that employ skills in visual rhetoric, writing, editing, proofreading, and/or research in an on-campus workplace setting. (repeatable twice for credit)',3),
    (409,N'ENGL',N'B270',N'World Literature',N'UG',N'Survey of world literature, spanning ancient to postmodern texts.',3),
    (410,N'ENGL',N'B287',N'American Literature',N'UG',N'Survey of American literature: major authors, genres and periods. Designed for English majors.',3),
    (411,N'ENGL',N'B288',N'English Literature I',N'UG',N'British poetry, drama and prose from Beowulf to the 18th century. Designed for English majors.',3),
    (412,N'ENGL',N'B289',N'English Literature II',N'UG',N'British poetry, drama and prose from the 18th century to the present. Designed for English majors.',3),
    (413,N'ENGL',N'B290',N'Great Books of the West',N'UG',N'Selected masterpieces of Western literature, with emphasis on non-English language texts in translation which are foundational to literature in English, including works by Homer, Dante, Cervantes, Voltaire, Goethe and Flaubert.',3),
    (414,N'ENGL',N'B291',N'Introduction to Non-Western Literature',N'UG',N'{=BCMP 291} Selected masterpieces of non-Western literature. Works may range from antiquity to the present.',3),
    (415,N'ENGL',N'B301',N'Theatre History I',N'UG',N'A study of the development of Western theatrical texts and practices including playwriting, acting, and design from ancient Greece to 1800.',3),
    (416,N'ENGL',N'B302',N'Theatre History II',N'UG',N'A study of the development of Western theatrical texts and practices including playwriting, acting, directing, and design from 1800 to the present.',3),
    (417,N'ENGL',N'B310',N'Reading and Performing Shakespeare',N'UG',N'(Prereq: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) A course about how people read and perform Shakespeare in which students read and perform Shakespeare.',3),
    (418,N'ENGL',N'B322',N'Playwriting',N'UG',N'A workshop approach to playwriting that culminates in each student creating a production-ready one-act play.',3),
    (419,N'ENGL',N'B380',N'Epic to Romance',N'UG',N'{=BCMP 380}  Comprehensive exploration of medieval and other pre-Renaissance literature using texts representative of the evolution of dominant literary forms. ',3),
    (420,N'ENGL',N'B381',N'The Renaissance',N'UG',N'{=BCMP 381}  Literature of the Renaissance, in its cultural contexts, explored through representative works.',3),
    (421,N'ENGL',N'B382',N'The Enlightenment',N'UG',N'{=BCMP 382}  Literature of the Enlightenment in its cultural contexts, explored through representative works.',3),
    (422,N'ENGL',N'B385',N'Modernism',N'UG',N'{=BCMP 385}  Literature of Modernism in its cultural contexts, explored through representative works.',3),
    (423,N'ENGL',N'B386',N'NULL',N'UG',N'{=BCMP 386}  Literature of Postmodernism in its cultural contexts, explored through representative works.',3),
    (424,N'ENGL',N'B388',N'NULL',N'UG',N'Representative theories of literature from Plato through the 20th century.',3),
    (425,N'ENGL',N'B395',N'NULL',N'UG',N'{=BCMP 395} Representative plays by Greek and Roman dramatists.',3),
