    (461,N'ENGL',N'B460',N'Professional Writing Workshop',N'UG',N'Upper-division writing workshop course, focusing on the study and practice of professional writing. Course may be taken twice for credit.',3),
    (462,N'ENGL',N'B461',N'Writing in the Health Professions',N'UG',N'(Prereq: ENGL B101 or B105, and ENGL B102 or B106, each with a grade of ''C'' of higher.) Preparation for and practice in types of writing important to those working within the health care and health promotion industry, from brief letters to formal articles and reports.',3),
    (463,N'ENGL',N'B462',N'Technical Writing',N'UG',N'Preparation for and practice in types of writing important to scientists, engineers and computer scientists, from brief technical letters to formal articles and reports.',3),
