    (467,N'ENGL',N'B466',N'Writing Internship',N'UG',N'(Prereq: Departmental permission.)  Internship in writing, editing, proofreading, and/or research with a community organization or publication, with training in writing effectively for diverse audiences in a workplace setting.  (Can be repeated for a maximum of 6 credit hours.)',3),
    (468,N'ENGL',N'B469',N'Teaching of Reading',N'UG',N'(Prerequisite: ENGL B101, ENGL B102, and EDCI B100 or special permission from Program Coordinator for Secondary English Education) This course provides grade 7-12 ELA teachers with strategies for teaching literacy within the framework of ELA classes. The course teaches a sound theoretical knowledge of academic vocabulary, nonfiction and fiction texts structures, and strategies for analyzing and teaching texts ',3),
    (469,N'ENGL',N'B470',N'The Teaching of Writing',N'UG',N'(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a grade of C or higher)Theory and methods of teaching composition and extensive practice in various kinds of writing. Recommended for prospective writing teachers.',3),
    (470,N'ENGL',N'B472',N'Cinema',N'UG',N'An investigation into the aesthetics of cinema. The course will also focus on the major genres.',3),
    (471,N'ENGL',N'B472L',N'Cinema Laboratory',N'UG',N'{=BTHE 472L} Required viewing for BENG 472.',3),
    (472,N'ENGL',N'B480',N'Secondary ELA Methods',N'UG',N'(Prerequisite: Admission to professional program in education; Corequisite: ENGL B481) This course will provide an introduction to and examination of practices for ELA instruction and will encompass issues of pedagogy, lesson planning, development of instructional materials, classroom management, diversity, access, and equity. ',3),
    (473,N'ENGL',N'B481',N'Secondary ELA Practicum',N'UG',N'(Prerequisite: Admission to professional program in education or approval by department chair; Corequisite: ENGL B480) Supervised clinical experience in a secondary ELA setting. Observation and participation in a classroom setting is required.   ',4),
    (474,N'ENGL',N'B482',N'Secondary ELA Seminar',N'UG',N'(Prerequisite: Admission to professional program in education or approval by department chair; Corequisite: ENGL B483) This course will provide both theoretical discussions of ELA pedagogy and support to students as they complete their internship. ',3),
    (475,N'ENGL',N'B483',N'Secondary ELA Internship',N'UG',N'(Prerequisite: Admission to professional program in education, or approval by department chair; 100 hours of previous field experience; Corequisite: ENGL B482) Supervised clinical experience in a secondary ELA setting. Observation and participation in a classroom setting is required. ',12),
    (476,N'ENGL',N'B490',N'Professionalization in English Studies',N'UG',N'(Prerequisite: Senior standing in English or department approval) A professional development course connecting the knowledge, skills, and experiences of the English major to advanced exploration of and active preparation for opportunities after graduation.  ',3),
    (477,N'ENGL',N'B491',N'English Capstone',N'UG',N'(Prerequisite: English or English Education major; Department Consent; Must be taken during final semester) Students? analytical reflection and writing about their program through the creation of a digital portfolio',1),
    (478,N'ENGL',N'B497',N'Reading for Senior Thesis',N'UG',N'Directed reading in preparation for senior thesis in literature.  (Prereq: Junior standing, and approval of the instructor.)',3),
    (479,N'ENGL',N'B498',N'Senior Thesis',N'UG',N'This seminar provides a capstone experience for English majors. Students will work both independently and within a classroom setting to complete a substantial writing project.  (Prereqs: Senior standing with GPA of 3.0 within English major and departmental approval. Students pursuing a concentration who have completed at least 6 hours of writing courses within their concentration with grades of B or better may register for Seminar in Creative/Professional Writing.)',3),
    (480,N'ENGL',N'B499',N'Senior Thesis',N'UG',N'The senior thesis provides a capstone experience for English majors. Students will work independently and with the professor to complete a substantial writing project (Prereqs: Senior standing with GPA of 3.0 within English major and departmental approval. Students pursuing a concentration who have completed at least 6 hours of writing courses within their concentration with grades of B or better may register for Thesis in Creative/Professional Writing.)',3),
    (481,N'ENGR',N'B101',N'Introduction to Engineering',N'UG',N'Engineering problem solving using computers and other engineering tools.',3),
    (482,N'ENTR',N'B300',N'Introduction to Entrepreneurial Thinking & Innovation',N'UG',N'(Prerequisite: Sophomore standing) This introductory course focuses on exploring the concepts of innovation and entrepreneurship in the context of today''s world, and exploring one''s own entrepreneurial spirit. Through self-assessment, the student will learn to capitalize on personal strengths and develop skills that lead to innovative thinking.  ',3),
    (483,N'ENTR',N'B400',N'Leading Diverse Teams',N'UG',N'(Prerequisite: Junior Standing) This course explores contemporary leadership practices with an emphasis on leading diverse teams. Students explore best practices that support diversity, equity, and inclusion to create dynamic, forward-thinking teams. ',3),
    (484,N'ENTR',N'B450',N'Innovation & Entrepreneurial Studies Practicum',N'UG',N'(Prerequisite: BADM B380 or consent of instructor) This course focuses on the application of problem-solving skills to reinvent and/or pioneer innovative practices through project development in a field experience. ',3),
    (485,N'ENTR',N'B499',N'Special Topics in Innovation & Entrepreneurship',N'UG',N'(Prerequisite: ENTR B300 or Junior standing) This course examines advanced concepts, emerging trends and best practices related to entrepreneurial thinking and innovation in the workplace. Topics may include interdisciplinary approaches to teamwork and collaboration, workplace practices and policies, ethics and values with entrepreneurial approaches to affect change.   ',3),
    (486,N'FREN',N'B101',N'Beginning French I',N'UG',N'(Admission is restricted to those who have never studied French, or who have not studied French in the previous five years, or who test into this course in the USCB placement exam.) Introduction to grammar and practical vocabulary necessary for fundamental communication skills.',3),
    (487,N'FREN',N'B102',N'Beginning French II',N'UG',N'Introduction to grammar and practical vocabulary necessary for fundamental communication skills.',3),
    (488,N'FREN',N'B109',N'Beginning French I',N'UG',N'Introduction to grammar and practical vocabulary necessary for fundamental communication skills. Admission to 109 restricted to those who have never studied French, who have not studied French in the previous five years, or who have a score of F-1 on the placement test.',3),
    (489,N'FREN',N'B110',N'Beginning French II',N'UG',N'(Prereq: BFRE 109 or by placement) Introduction to grammar and practical vocabulary necessary for fundamental communication skills.',3),
    (490,N'FREN',N'B122',N'Basic Proficiency in French',N'UG',N'(Prereq: FREN B110 or by placement) Practice and further development of essential listening, reading, speaking and writing skills.',3),
    (491,N'FREN',N'B201',N'Reading and Written Expression',N'UG',N'Readings in French; grammar, writing, speaking, listening, and composition at the intermediate level.',3),
