    (493,N'FREN',N'B209',N'Reading and Written Expression',N'UG',N'(Prereq: FREN B122 or score of F-5 on placement exam) Readings in French; grammar, basic writing and composition.',3),
    (494,N'FREN',N'B210',N'Oral Communication',N'UG',N'(Prereq: FREN B122 or score of F-5 on placement exam) Practice in conversation involving authentic listening materials; vocabulary building.',3),
