    (496,N'FREN',N'B295',N'Topics in French Culture',N'UG',N'(Prereq: FREN B110 or equivalent) Intensive one-term study of a particular topic identified by suffix and title.  Course taught in English.',3),
    (497,N'FREN',N'B301',N'Advanced Conversation and Grammar',N'UG',N'(Prereq: BFRE B202 or equivalent or consent of instructor; BFRE 201 strongly recommended) Current issues and events presented in French-language media. Discussion and presentations in French provide practice with advanced structures and idiomatic speech.',3),
