VALUES 
    (501,N'FREN',N'B316',N'Introduction to Business French',N'UG',N'(Prereq: BFRE 301 or consent of instructor) Practical oral and written communication in a commercial context; introduction to business terminology and correspondence. ',3),
    (502,N'FREN',N'B399',N'Independent Study in French',N'UG',N'(Prereq: BFRE 209 or equivalent or consent of instructor; BFRE 210 strongly recommended) Contract approval by instructor, advisor, Department Chair and Vice Chancellor for academic affairs is required.',3),
    (503,N'GEOG',N'B121',N'World Regional Geography',N'UG',N'Introduction to the physical and human geography of the world with a focus on selected regions.',3),
    (504,N'GEOG',N'B200',N'Introduction to Physical Geography',N'UG',N'Basic concepts of landform geography, climatology and meteorology and biogeography.',3),
    (505,N'GEOG',N'B363',N'Geographic Information Systems',N'UG',N'IIntroduction to principles and methods of geographic information systems including discussion of computers, spatial data, analysis and display. Includes discussion of applications and hands-on experience.',3),
    (506,N'GERM',N'B101',N'Beginning German',N'UG',N'Introduction to grammar and practical vocabulary necessary for fundamental communication skills.',3),
    (507,N'GERM',N'B102',N'Beginning German II',N'UG',N'Introduction to grammar and practical vocabulary necessary for fundamental communication skills.',3),
    (508,N'GLST',N'B301',N'Global Contemporary Perspectives',N'UG',N'Intensive study of selected global issues and problems. May be repeated as topics vary. (A) Europe and Latin America.',3),
    (509,N'GLST',N'B398',N'Global Studies',N'UG',N'Intensive study of selected global contemporary situations and problems of a region that lead to conflict with regards to trade, religion, human rights, modernization. May be repeated or taken simultaneously as topics vary. Variations will be announced in the schedule of classes by suffix and title.(A) European Perspective; (B) Latin American Perspective; (C) Asian and African Perspective.',3),
    (510,N'GLST',N'B399',N'Independent Study in Global Studies',N'UG',N'(Prereq: consent of instructor)  Contract approval by instructor, advisor, Department Chair and Executive Vice Chancellor for Academic Affairs is required.',3),
    (511,N'HIST',N'B101',N'European Civilization from Ancient Times to the Mid-17th Century',N'UG',N'The rise and development of European civilization from its Mediterranean origins through the Renaissance and Reformation.',3),
    (512,N'HIST',N'B102',N'European Civiization from the Mid-17th Century',N'UG',N'European development and expansion from the mid- 17th century to the present.',3),
    (513,N'HIST',N'B109',N'Introduction to Latin American Civilization',N'UG',N'A discussion of the political, cultural and economic forces which have conditioned the development of institutions and ideas in Spanish and Portuguese America.',3),
    (514,N'HIST',N'B111',N'History of America from Discovery to 1865',N'UG',N'A general survey of the United States from the era of discovery to the present, emphasizing major political, economic, social and intellectual developments.',3),
    (515,N'HIST',N'B112',N'History of the United States from 1865 to the Present Day',N'UG',N'A general survey of the United States from the era of discovery to the present, emphasizing major political, economic, social and intellectual developments.',3),
    (516,N'HIST',N'B442',N'The Old South',N'UG',N'Development of Southern society and of the forces that made the South a distinctive section of the United States.',3),
    (517,N'HIST',N'B443',N'The New South',N'UG',N'Reconstruction, the Bourbon era, agrarian revolt, industrial revolution, racial problems and the changes resulting from the impact of two world wars and the New Deal (1865-1946).',3),
    (518,N'HIST',N'B115',N'World History to 1500',N'UG',N'HIST B115 is the first of a two-semester survey of World History from the origin of human civilizations to the advent of the modern period (1500 C.E.).  The course necessarily adopts a cross-cultural approach to the study and interpretation of the past, including political, intellectual, economic and social inquiry.  BHIS 115 addresses issues of religion, gender, trade, migration, conflict and interaction between and within societies.',3),
    (519,N'HIST',N'B116',N'World History from 1500 to Present',N'UG',N'HIST B116 is the second of a two-semester survey of World History from the advent of the modern period (1500 C.E.) to the present.  The course necessarily adopts a cross-cultural approach to the study and interpretation of the past, including political, intellectual, economic and social inquiry.  HIST B116 addresses issues of religion, gender, trade, migration, conflict and interaction between and within societies.',3),
    (520,N'HIST',N'B300',N'The Historian''s Craft',N'UG',N'Explores the nature of historical evidence, the formulation of historical questions and the construction of historical arguments using primary and secondary materials.',3),
    (521,N'HIST',N'B301',N'Women''s History',N'UG',N'An introduction to the concepts of Patriarchy and gender and their operation over time.',3),
    (522,N'HIST',N'B302',N'World of the Ancient Greeks',N'UG',N'An examination of the political, cultural, and social history of ancient Greece, from the emergence of the Polis in the eighth century to the death of Alexander in 323 BCE.',3),
    (523,N'HIST',N'B303',N'World of the Ancient Romans',N'UG',N'An examination of the political, cultural, and social history of ancient Rome, from the founding of the city c. 750 BCE to the barbarian conquest in the fifth century.',3),
    (524,N'HIST',N'B306',N'The Birth of Europe',N'UG',N'A survey of the formation and development of Europe from the fourth to the 14th centuries.  Emphasis upon the emergence of European culture and upon aspects of European prosperity after A.D. 1000.',3),
    (525,N'HIST',N'B307',N'The Crusades',N'UG',N'Holy War and Realpolitik in Mediterranean East-West relations from the 10th to the 15th centuries with emphasis on the role of the Crusades in the cultural formation, development and international relations of East and West.',3),
    (526,N'HIST',N'B309',N'Age of Renaissance',N'UG',N'Social, cultural, and artistic movements in Italy and northern Europe from the Black Death (c. 1350) to religious reforms and revolutions (c. 1520).',3),
    (527,N'HIST',N'B310',N'Age of the Reformation',N'UG',N'Ecclesiastical institutions, religious experience and efforts at reform before Luther; career and theology of Luther; diffusion of Reformation throughout Europe; career and theology of Calvin; Catholic renewal and response.',3),
    (528,N'HIST',N'B312',N'French Revolution and Napoleonic Era',N'UG',N'The changes in France and Europe during the revolutionary period, the Napoleonic reaction and the diffusion of revolutionary ideals.',3),
    (529,N'HIST',N'B315',N'Introduction to Environmental History',N'UG',N'A survey of the western past with the environment introduced as a significant actor and object of inquiry. Emphases include the impact of changing environments on several societies as well as changing human attitudes toward the environment.',3),
    (530,N'HIST',N'B317',N'Contemporary Europe From World War I to World War II',N'UG',N'The Great War, revolution and reconstruction; the rise of authoritarian and totalitarian regimes and the coming of World War II.',3),
    (531,N'HIST',N'B318',N'Europe from World War II to the Present',N'UG',N'The Second World War and its origins; the Cold War; European recovery; a divided continent and Europe in the Global Era.',3),
    (532,N'HIST',N'B320',N'The History of Great Britain to 1660',N'UG',N'A survey of the political, social, economic and cultural development of the British Isles from Anglo-Saxon times to the Restoration of 1660.',3),
    (533,N'HIST',N'B321',N'The History of Great Britain since 1660',N'UG',N'A survey of the political, social, economic and cultural development of the British Isles since 1660.',3),
    (534,N'HIST',N'B330',N'Introduction to Scottish History',N'UG',N'A survey of Scottish history with an emphasis on national identity and identity formation.',3),
    (535,N'HIST',N'B351',N'African Diaspora',N'UG',N'History of African in the America''s from 16th century to the present. Special emphasis on the experiences of Africans in South Carolina and the Sea Islands.',3),
    (536,N'HIST',N'B352',N'Africa from 1880',N'UG',N'A history of modern Africa from the time of the Imperialist ?scramble? of the 1880s to nationalism and decolonization in the present.',3),
    (537,N'HIST',N'B353',N'Decolonization: Colonialism and Revolution in Africa and Asia',N'UG',N'A study of the demise of European colonial empires in the nineteenth and twentieth centuries. Emphasis will be placed on th rise of nationalism among subject peoples in Africa and Asia.',3),
    (538,N'HIST',N'B395',N'History of Human Rights',N'UG',N'Do Human Rights have a history? This course focuses on the historical origins of our international human rights regime and its contemporary crisis.',3),
    (539,N'HIST',N'B399',N'Independent Study in History',N'UG',N'Contract approval by instructor, advisor, Department Chair and Vice Chancellor for academic affairs is required.',3),
    (540,N'HIST',N'B401',N'The Development of The American People to 1789',N'UG',N'The founding of the English colonies, their developing maturity, the events leading to the Revolution and the creation of a new nation.',3),
    (541,N'HIST',N'B402',N'The New Nation, 1789-1828',N'UG',N'The founding of the English colonies, their developing maturity, the events leading to the Revolution and the creation of a new nation.',3),
    (542,N'HIST',N'B403',N'The Sections and The Nation, 1818-1860',N'UG',N'The three cultures of East, South and West; their interactions and the events leading to the Civil War.',3),
    (543,N'HIST',N'B404',N'Civil War and Reconstruction, 1860-1877',N'UG',N'The political, military and social history of the War and the reorganization which followed.',3),
    (544,N'HIST',N'B407',N'United States History since 1945',N'UG',N'A survey of the political, economic, social and cultural developments in the period after World War II.',3),
    (545,N'HIST',N'B409',N'The History of South Carolina, 1670-1865',N'UG',N'A study of South Carolina origins and developments.',3),
    (546,N'HIST',N'B410',N'History of South Carolina since 1865',N'UG',N'A survey of recent South Carolina history with emphasis on social and institutional development.',3),
    (547,N'HIST',N'B415',N'Black Americans',N'UG',N'A survey of the historical development of black people in the Western Hemisphere.',3),
    (548,N'HIST',N'B420',N'Latin America: The Founding of New Societies',N'UG',N'The establishment of consolidation of the Spanish and Portuguese empires in the Western hemisphere; interaction of Indians, Africans and Iberians and the formation of social, economic and political traditions in Latin America; political independence.',3),
    (549,N'HIST',N'B421',N'Modern Latin America',N'UG',N'Traditional society in the area and problems arising from social, economic and political changes since independence; comparative studies of national responses to these problems.',3),
    (550,N'HIST',N'B423',N'History of Mexico',N'UG',N'Mexico from the pre-conquest period to the present, with an emphasis on modern Mexico.',3),
    (551,N'HIST',N'B430',N'U.S. Constitutional History',N'UG',N'(Prereq: completion of one of the following: HIST 101, 102, B111, B112, B115, B116. Of the six, HIST B111, or B112 which cover U.S. history are preferred, though not required.)United States Constitutional history including constitutional origins in English and colonial legal practices, writing and ratifying the Constitution, Supreme Court decisions, and changes in constitutional interpretation into the twentieth century. ',3),
    (552,N'HIST',N'B468',N'American Military Experience',N'UG',N'Transformation of war and of the institutions for waging war from the American Revolution to the present.',3),
    (553,N'HIST',N'B469',N'American Legal History',N'UG',N'(Prereq: One of the following: BHIS  101, 102, 111, 112, 115, 116. 111 or 112 is preferred) A survey in American legal history, themes will include but are not confined to constitutional law, the impact of industrialism and the internationalization of law in the 20th century.',3),
    (554,N'HIST',N'B492',N'Topics in History',N'UG',N'Reading and research on selected historical subjects. Open only to juniors and seniors with permission of the instructor.',3),
    (555,N'HMSV',N'B180',N'Personal an Professional Development in Human Services',N'UG',N'(Prereq: BPSY 101 or BSOC 101 or permission of Instructor) This course provided students with the opportunity to explore their personal and professional development and understand how values, beliefs and norms impact both personal and professional lives.',3),
    (556,N'HMSV',N'B190',N'Human Services: An Introduction',N'UG',N'(Prereq: BPSY 101 or BSOC 101 or permission of Instructor). The intention of this course is to acquaint students with an overview of the interdisciplinary field of human services by providing a historical and contemporary survey of human service program literatures. Students will be able to identify the domain of human services as an interdisciplinary area of theory and practice. Specifically, they will be able to master concepts generic to this field of study and apply them in human service situations.',3),
    (557,N'HMSV',N'B280',N'Micro Level Human Service Interventions',N'UG',N'(Prerequisite or corequisite: HMSV B190 or consent of instructor) Exploration of the theories, skills and practices of working one-on one in human services settings. Includes active listening, communication skills, and interviewing techniques, the development of service plans, crisis intervention, short and long term care, case management and information and referral services. Multicultural and ethical/legal issues related to this level of intervention will be examined.',3),
    (558,N'HMSV',N'B282',N'Mezzo Level Human Services Interventions',N'UG',N'(Prerequisites: HMSV B280 or consent of instructor) Exploration of the theories, skills and practice of working with small groups in human services settings. Includes understanding group dynamics, managing and facilitating educational and prevention groups, self-help and support groups, and families. Multicultural and ethical/legal issues related to this level of intervention will be examined.',3),
    (559,N'HMSV',N'B290',N'Human Services Internship I',N'UG',N'(Prerequisite: HMSV 280 or permission of Instructor) The application of theoretical foundations and human service principles in a supervised human service setting. Requires at least 120 hours of service; attendance at three on-campus seminars, or three interviews with instructor or a combination of these; on-line reflections; and a final paper that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice.',3),
    (560,N'HMSV',N'B298',N'Human Services Internship II',N'UG',N'BHSV 298 - HUMAN SERVICES INTERNSHIP II (3). (Prereq:  BHSV 290 or permission of Instructor) The application of theoretical foundations and human service principle in a supervised human service setting. Requires at least 120 hours of service, attendance at an orientation session and a closing session, on-line reflections and a final paper that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice at a higher level than in the previous internship. (N.B. no more than two internships can be at the same site.)',3),
    (561,N'HMSV',N'B300',N'Macro Level Human Services Interventions',N'UG',N'(Prerequisite BHSV 280 or permission of Instructor.) Exploration of the theories, skills and practices of working with larger groups in human service settings such as grassroots or formal organizations, neighborhoods, communities, geographic regions, political jurisdictions, and societies. Includes community organizing and development, agency collaborations, social change, social marketing and public awareness, advocacy and social policy work. Multicultural and ethical/legal issues related to this level of intervention will be examined.',3),
    (562,N'HMSV',N'B302',N'Human Service Evaluation',N'UG',N'(Prereq: HMSV B280, or permission of Instructor) Research methods for determining the effectiveness of social programs/interventions (i.e., experimental, quasi-experimental and qualitative designs).',3),
    (563,N'HMSV',N'B303',N'Principles of Gerontology',N'UG',N'(?SOCY B303 & PSYC B303) An exploration of the interdisciplinary field of gerontology, including the fundamental concepts, theories, and issues involved in the study of aging from diverse perspectives.',3),
    (564,N'HMSV',N'B400',N'Leadership and Professional Ethics in Human Services',N'UG',N'(Prereq: BHSV 302 or permission of Instructor) An exploration of leadership in human service settings and the essentials involved in managing information, human resources and fiscal resources in human service agencies with an emphasis on non-profit organizations. In addition, the course will explore professional ethics and legal issues involved in facing challenges such as privacy, confidentiality, informed consent, freedom of information and information security.',3),
    (565,N'HMSV',N'B402',N'Nonprofit Management and Funding',N'UG',N'(Prerequisite: HMSV B400 or consent of instructor) Principles, theories, skills and practices of effective nonprofit management, including the following topics: governance, legal structures and standards, strategic planning, fundraising and proposal development, volunteer management, marketing and communication.',3),
    (566,N'HMSV',N'B490',N'Human Services Internship III and Capstone Seminar',N'UG',N'(Prereq: BHSV 298 or permission of Instructor) The application of theoretical foundations and human service principle in a supervised human service setting. Requires at least 120 hours of service, attendance at and participation in four on campus seminars and a Capstone Project that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice at a higher level than in the previous internship. Students will also submit their Human Services Portfolio for final review and approval. (N.B. no more than two internships can be at the same site.)',3),
    (567,N'HMSV',N'B492',N'NULL',N'UG',N'NULL',3),
    (568,N'HMSV',N'B498',N'Selected Topics in Human Services',N'UG',N'(Prereq: Permission of Instructor) Advanced readings and research on selected topics in human services. Course and content varies and will be announced in the schedule of classes by suffix and title. Topics may include: grant writing and fund development, community development, new clinical developments, grassroots community organizing, working in faith-based communities, emergency management and disaster relief, working with special populations, etc.',2),
    (569,N'HPRO',N'B101',N'Basic Health',N'UG',N'This course is a basic personal health course in which students will learn about strategies to improve health. Nutrition, fitness, drugs, and sexuality are some of the topics discussed. Career opportunities within the health field explored.',3),
    (570,N'HPRO',N'B300',N'Transcultural Health',N'UG',N'This course surveys the cultural and social dimensions of health and illness with emphasis on the development of cultural competence. Different populations are examined for the development of a personal understanding of the traditions and customs of their societies, providing a unique perspective on the implications for patient care. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3),
    (571,N'HPRO',N'B310',N'Introduction to Health Promotion',N'UG',N'A broad-based overview of those processes that enable people to assume responsibility for health and wellness and the role of the health promotion professional.',3),
    (572,N'HPRO',N'B315',N'Health Promotion Across the Lifespan',N'UG',N'The study of age as a determinant of health and disease outcomes across the lifespan with strategies to promote wellness.',3),
    (573,N'HPRO',N'B320',N'Chronic Disease and Risk Reduction',N'UG',N'The study of those diseases of long duration and slow progression and the means by which their societal burden can be reduced.',3),
    (574,N'HPRO',N'B321',N'Fundamentals of Occupational Health and Safety',N'UG',N'An?introductory?course?covering?major?issues?in?occupational?health?and?safety,?with?an?emphasis?on?the?identification,?evaluation?and?control?of?physical,?chemical,?biological?and?behavioral?factors?often?present?in?the?workplace?and?pose?a?risk?for?illness,?injury?and?death.?As?people?typically?work?at?least?40?hours?per?week?for?most?of?their?adult?lives,?the?workplace?has?the?potential?to?significantly?impact?human?health?and?wellbeing.',3),
    (575,N'HPRO',N'B323',N'Introduction to Exercise and Sports Science',N'UG',N'(Prereq: BIO243 Anatomy and Physiology I and BIO244 Anatomy and Physiology II) This course is designed to examine the disciplines in the broad field of exercise science. An overview of the knowledge and skills needed to become a certified personal trainer (CPT) will be provided.',3),
    (576,N'HPRO',N'B330',N'Principles of Epidemiology',N'UG',N'The study of the patterns, causes and effects of health and disease.',3),
    (577,N'HPRO',N'B340',N'Introduction of Environmental Health',N'UG',N'The study of environmental factors, be they physical, chemical, biological or behavioral, that have the potential to adversely impact human and/or ecological health.',3),
    (578,N'HPRO',N'B360',N'Health Behavior and Education',N'UG',N'The study of the behavioral and social factors that influence health and disease. Models of health behavior theory will be presented. Methods for preparation of health education curricula will be discussed.',3),
    (579,N'HPRO',N'B370',N'Wellness in Health Promotion',N'UG',N'The study of the roles of nutrition, exercise, hygiene and rest in the prevention of disease and the achievement of optimal health.',3),
    (580,N'HPRO',N'B380',N'Research Methods in Health Promotion',N'UG',N'A course designed to impart knowledge and skills regarding the design, implementation, analysis and interpretation of research in the field of health promotion.',3),
    (581,N'HPRO',N'B390',N'Field Experience in Health Promotion',N'UG',N'(Prerequisite: HPRO B310 and Junior Status) A period of introductory work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where health promotion principles are applied.',3),
    (582,N'HPRO',N'B395',N'Global Healthcare Study Abroad',N'UG',N'Provides students the opportunity to engage in global health fieldwork in an international service learning setting. Faculty collaborate with international partners to develop customized global healthcare immersion experiences.',3),
    (583,N'HPRO',N'B400',N'Global Health Promotion',N'UG',N'The study of health and disease among geographically diverse populations and the role of cultural variation in determining health prevention strategies.',3),
    (584,N'HPRO',N'B401',N'Health Care Delivery Systems',N'UG',N'{? NURS B401} Systems theory, health care delivery systems conceptualize transitions from one level of care to another, with emphasis on ethical and legal issues; technology; historical, political, economic aspects to meet the health care needs of the population.',3),
    (585,N'HPRO',N'B410',N'Examining Health Inequalities',N'UG',N'This course is designed to examine health disparities and associated social determinants of health in the U.S. Also included is an exploration of multi-level intervention strategies for reducing health disparities.',3),
    (586,N'HPRO',N'B420',N'Leadership and Management in Health',N'UG',N'This course is designed to enhance leadership and management skills needed to design, implement and evaluate health promotion programs.',3),
    (587,N'HPRO',N'B450',N'Health Promotion Program Development',N'UG',N' A study of methods used to develop effective health promotion and education programs which help enable individuals prevent, delay and treat disease.',3),
    (588,N'HPRO',N'B460',N'Health Promotion Program Evaluation',N'UG',N'A study of evaluation methods used to assess the potential impacts of health promotion programs.',3),
    (589,N'HPRO',N'B461',N'Writing Professions in the Health Professions',N'UG',N'Preparation for and practice in types of writing important to those working within the health care and health promotion industry, from brief letters to formal articles and reports.',3),
    (590,N'HPRO',N'B480',N'Internship in Health Promotion',N'UG',N'A period of work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where health promotion principles are applied.',3),
    (591,N'HPRO',N'B490',N'Senior Seminar in Health Promotion',N'UG',N'A capstone course that summarizes the experiences of the health promotion major and prepares students for employment and/or graduate study.',2),
    (592,N'HRTM',N'B110',N'Introduction to Hospitality Industry',N'UG',N'History, growth, developments and future opportunities in the hospitality industry.',3),
    (593,N'HRTM',N'B201',N'Introduction to Sport and Event Management',N'UG',N'This course introduces the student to the sport management profession. Industry employment opportunities along with requisite professional skills are reviewed.',3),
    (594,N'HRTM',N'B210',N'Introduction to Event Management',N'UG',N'This course provides an overview of producing community oriented special events.',3),
    (595,N'HRTM',N'B215',N'Introduction to Spa Management',N'UG',N'This course explores the world of spas including spa history, spa types, current trends and growth, and issues affecting spas, spa managers and spa clients.',3),
    (596,N'HRTM',N'B221',N'Hospitality Accounting I',N'UG',N'Accounting for the hospitality organizations accentuating an understanding of financial accounting and financial management for hospitality organizations.',3),
    (597,N'HRTM',N'B222',N'Hospitality Accounting II',N'UG',N'The use of managerial accounting principles in decision-making processes with a focus on controlling costs and optimizing profitability for hospitality businesses. ',3),
    (598,N'HRTM',N'B228',N'Purchasing and Controls',N'UG',N'A study of the major foods, beverages and supplies that are purchased in hotels, motels and food-service establishments as well as techniques on how to control their distribution within the operation.',3),
    (599,N'HRTM',N'B230',N'Hospitality Management',N'UG',N'Tools available to management and their utilization in the hospitality industry.',3),
    (600,N'HRTM',N'B235',N'Destination Marketing',N'UG',N'The application of marketing management and best practices to Hospitality destination development.  Also examined will be the structures of destination marketing organizations, funding sources, and  operations.',3),
    (601,N'HRTM',N'B240',N'Event Promotion',N'UG',N'This course provides an overview of marketing, promotion, and sponsorship strategies for events both large and small and teaches students the techniques to accomplish the strategies.',3),
    (602,N'HRTM',N'B242',N'Nutrition',N'UG',N'Introductory course on human nutrition. Includes principles of normal nutrition, basics of life cycle nutrition, relationship of nutrients to health and disease, and discussion of current issues.',3),
