    (606,N'HRTM',N'B270',N'Quantity Food Production',N'UG',N'(Co-requisite HRTM B311 and B312 - all three must be taken together) The basics of food production from storeroom to consumer. Various techniques of storage, preparation, merchandising and menu-planning, as well as the many aspects of service. Lectures and laboratory hours.',4),
