    (610,N'HRTM',N'B290',N'Practicum',N'UG',N'Supervised full-time work experience in an area of the hospitality industry, selected by the student and approved by the practicum coordinator.',3),
    (611,N'HRTM',N'B295',N'History and Influence of French Gastronomy',N'UG',N'A culinary and gastronomical study of France from its medieval age to the present (this course will count toward the French Minor, However, only one course taught in English can be applied to the French Minor).',3),
    (612,N'HRTM',N'B301',N'Cruise Line Management',N'UG',N'An overviewof the cruise line industry, its organization, impacts upon ports of call and destinations, and the skills needed to begin a productive career in this specialized travel segment.',3),
    (613,N'HRTM',N'B311',N'Principles of Food Service Sanitation',N'UG',N'Business and regulatory practices relevant to a sanitary food service environment.',1),
    (614,N'HRTM',N'B312',N'Management by Menu',N'UG',N'Analysis, pricing constraints and mechanics of the menu.',1),
    (615,N'HRTM',N'B313',N'Internal Training and Development',N'UG',N'Principles of effective in-house training programs in the hospitality/travel industry.',3),
    (616,N'HRTM',N'B315',N'Wellness Trends in Hospitality',N'UG',N'This course explores the concept of wellness and identifies key trends affecting the hospitality industry. Topics include the six dimensions of wellness.',3),
    (617,N'HRTM',N'B320',N'Sports Nutrition',N'UG',N'(Prerequisite: HRTM B242) The study of the association between nutrition and exercise performance. Metabolism of carbohydrates, fats, proteins, vitamins, minerals and water and its effect on athletic training is emphasized. Nutrition assessment of athletes, how to measure body composition, and the use of and controversy over ergogenic aids are explored.',3),
    (618,N'HRTM',N'B328',N'HRTM Accounting',N'UG',N'Accounting trends and controls for the hospitality industry from a managerial point of view.',3),
    (619,N'HRTM',N'B330',N'Quality Evaluation and Management for Hospitality',N'UG',N'Course focuses on introducing students to advanced service management concepts including the development of service standards, service quality evaluation and quality management in a hospitality setting.',3),
    (620,N'HRTM',N'B335',N'Hospitality Delivery Systems for the Indigent',N'UG',N'The management of food and lodging delivery systems for the indigent.',3),
    (621,N'HRTM',N'B345',N'Festival and Community Event Planning',N'UG',N'This course provides an overview of planning, producing, and managing community oriented special events.',3),
    (622,N'HRTM',N'B350',N'Wedding and Special Event Management',N'UG',N'This course provides an overview of producing weddings and other special events.',3),
    (623,N'HRTM',N'B352',N'Software Applications for the Hospitality Industry',N'UG',N'Using microcomputer software in various areas of the hospitality industry.',3),
    (624,N'HRTM',N'B355',N'Physical Plant Design',N'UG',N'Design, equipment and maintenance of hospitality facilities.',3),
    (625,N'HRTM',N'B357',N'Hotel, Restaurant and Travel Law',N'UG',N'A comprehensive overview of laws and regulatory agencies governing the lodging, food service and travel industries.',3),
    (626,N'HRTM',N'B360',N'Food, Hospitality and Culture',N'UG',N'Cultural factors affecting food habits and hospitality needs of populations throughout the world.',3),
    (627,N'HRTM',N'B364',N'Conference and Meeting Planning',N'UG',N'(Prereq: HRTM B260) Planning and managing conferences and meetings in the tourism industry.',3),
    (628,N'HRTM',N'B370',N'Restaurant Food Production Management',N'UG',N'Management techniques and operating problems in food service operations.',3),
