    (630,N'HRTM',N'B376',N'Contract Foodservice Management',N'UG',N'Issues related to the management of contract foodservice accounts.',3),
    (631,N'HRTM',N'B385',N'Club Management',N'UG',N'Unique problems and issues associated with private club management.',3),
    (632,N'HRTM',N'B390',N'Careers in Hospitality/Tourism',N'UG',N'Career options concurrent with the placement process.',1),
