    (640,N'HRTM',N'B447',N'Food Science',N'UG',N'(Prereq: HRTM B340) The effects of cooking, processing and storage of food on nutrient content, sensory perception and functionality. Two lecture and two laboratory hours per week.',3),
    (641,N'HRTM',N'B450',N'Hospitality Marketing Sales',N'UG',N'(Prereq: BHRM 235) Application of marketing principles and promotional techniques to the hospitality and travel industry.',3),
    (642,N'HRTM',N'B451',N'Human Resources in Hospitality Management',N'UG',N'(Prerequisites: HRTM B110 and HRTM B230) A specialized approach to human resources management in the hospitality industry. Students will analyze contemporary issues and practices, as well as the trends that transform the way people are managed specifically within the hospitality industry.  ',3),
    (643,N'HRTM',N'B473',N'Club Cuisine and Service',N'UG',N'(Prereq: HRTM B370 or B372) Advanced topics in the management of production and service techniques for private clubs.',3),
