    (648,N'HRTM',N'B495',N'Hospitality Management Internship',N'UG',N'Structured industry practical experience in a hospitality management company at the supervisory level. A contract approved by the instructor, advisor and department chair is required for undergraduate students. Minimum of 400 hours.',3),
    (649,N'HRTM',N'B498',N'Special Topics in Hospitality',N'UG',N'Advanced concepts, issues and trends in the hospitality and tourism industry. Variable hours between 1-3 credits. May be repeated for up to 6 credit hours.',1),
    (650,N'IDST',N'B250',N'Interdisciplinary Studies Internship',N'UG',N'(Prerequisite: IDST Major or Minor only, IDST B297, or consent of instructor) Provides students with the opportunity to apply interdisciplinary research skills across culturally diverse populations in a professional setting. Minimum requirement of 150 service hours. Can be repeated once.  ',3),
    (651,N'IDST',N'B260',N'Introduction to Medical and Health Humanities',N'UG',N'(Prerequisite: ENGL B101 or B105 & B102 or B106, each with a grade of C or higher) An interdisciplinary course designed for students to focus on the broadly encompassing field of health and medicine from the perspective of the humanities.',3),
    (652,N'IDST',N'B297',N'Interdisciplinary Resarch Methods',N'UG',N'(Prerequisite: 45 hours of General Studies and acceptance in the Interdisciplinary Major or Minor Program) Introduction to individualized study including initial development of course study proposal, review of courses, and bibliography.',3),
    (653,N'IDST',N'B305',N'Integrated Interdisciplinary Studies I',N'UG',N'(Prerequisite: IDST B297; permission of instructor) Students identify two courses in two different disciplines that have a correlative relationship beneficial to the student''s course of study. Student proposal of integrative study due pre-enrollment. Can be repeated up to four credit hours.',1),
    (654,N'IDST',N'B320',N'Yoga Disciplines & Practice',N'UG',N'(Prerequisite: Sophomore Standing) A broad introduction to the physical and philosophical practice of yoga. Examination of historical yogic texts and application of ideas in modern society via community outreach component. ',3),
    (655,N'IDST',N'B325',N'Sports & The Humanities',N'UG',N'Analyzation of the role of sports in the humanities. Emphasis on social and cultural importance of sports in humanistic study. ',3),
    (656,N'IDST',N'B330',N'Cultural Historiography',N'UG',N'(Prerequisite: Students must be classified as a junior or senior) Intensive interdisciplinary study of selected topics regarding cultural history with empirical research component. Open to all majors. Can be repeated up to two times (6 credit hours). Topic reflected in section number. Maymester only.',3),
    (657,N'IDST',N'B331',N'Topics in Cultural Historiography',N'UG',N'(Prerequisite: ENGL B101 or B105, and B102 or B106, each with a grade of ''C'' or higher) Intensive interdisciplinary study of selected topics regarding cultural history. Open to all majors. Can be repeated up to two times (6 credit hours). Topic reflected in section number.',3),
    (658,N'IDST',N'B351',N'Beyond the Classroom: Community Project I',N'UG',N'Prerequisite: Interdisciplinary Studies major or approval of instructor, junior standing) Explores foundations of service learning. Theoretical approach to design and implementation of service learning project in and around the university, with emphasis on community outreach.',3),
    (659,N'IDST',N'B352',N'Beyond the Classroom: Community Project II',N'UG',N'The application of theoretical foundations and service learning in a community project designed in IDST B351, implemented as individual or group project.',3),
    (660,N'IDST',N'B363',N'Philosophy of Film',N'UG',N'{?PHIL B363} (Prerequisite: ENGL B101 or B105, and B102 or B106) Interdisciplinary course with emphasis on topical study of film theory, the aesthetics of film as an art form, the social impact and relevance of film.',3),
    (661,N'IDST',N'B397',N'Readings in Philosophy',N'UG',N'{?PHIL B397} (Prerequisite: Junior standing and completion of General Education English and Humanities requirements) A systematic study of a primary source in philosophy having relevance to other disciplines. Can be conducted as a small course or as a tutorial. May be taken twice for credit.',3),
    (662,N'IDST',N'B399',N'Sports Management: Administration, Operations, and Marketing at Collegiate Level',N'UG',N'(Prerequisite: Contract approval is required)',3),
