    (664,N'IDST',N'B439',N'Selected Topics',N'UG',N'(Prerequisite: ENGL B102 or B106 with a grade of ''C'' or higher) Intensive interdisciplinary study of selected themes or topics as defined by the title. May be repeated for credit under a different topic title.',3),
    (665,N'IDST',N'B497',N'Seminar in Interdisciplinary Studies Among the Disciplines',N'UG',N'(Prerequisite: Senior standing in Interdisciplinary Studies or consent of the instructor)',3),
