    (668,N'ISAT',N'B104',N'Software Design and Development',N'UG',N'Develop a basic competence in scientific computing using the Matlab programming language. Previous programming experience is not required.',3),
    (669,N'ISAT',N'B145',N'Object-Oriented Programming I',N'UG',N'{?CSCI B145} (Prerequisite: Placement in MATH B141 or grade of C or better in MATH B115) Problem solving, algorithmic design and programming. Three lectures and two laboratory hours per week. Open to all majors.',4),
    (670,N'ISAT',N'B146',N'Algorithmic Design II',N'UG',N'Continuation of ISAT B145. Rigorous development of algorithms and computer programs; elementary data structures. Three lecture hours and two laboratory hours per week. Open to all majors.',4),
    (671,N'ISAT',N'B150',N'Introduction to Computer Science',N'UG',N'{?CSCI B150} (Prerequisite: two years of college preparatory mathematics or equivalent) Topics include computing theories, programming languages, modeling/simulation and visualization tools, and case studies of problem solving and high performance computing in natural sciences.',3),
    (672,N'ISAT',N'B201',N'Introduction to Computer Security',N'UG',N'{?CSCI B201} (Prerequisite or Co-requisite: CSCI B101 or consent of instructor) Introduction to the theory and practice of computer security, including security policies, authentication, digital certificates, firewalls, malicious code, legal and ethical issues, and incident handling.',3),
    (673,N'ISAT',N'B202',N'Introduction to Front-End Web Development',N'UG',N'(Prerequisites: CSCI B145 & CSCI B150) Application of programming techniques to the development of interactive, event-driven web applications. Brief coverage of document markup (HTML) and styling (CSS)  essentials, followed by significant coverage of scripting languages, libraries, and frameworks for manipulating the Document Object Model. ',3),
    (674,N'ISAT',N'B207',N'Computer System Administration',N'UG',N'(Prerequisite: CSCI B145 & CSCI B150) Account maintenance, backups, restoration, system configuration, resource allocation and monitoring, network management, peripheral administration, emphasis on Microsoft Windows and UNIX/Linux systems. ',3),
    (675,N'ISAT',N'B211',N'Digital Logic Design',N'UG',N'{?CSCI B211} (Prerequisite: MATH B141 or B174) Number systems, Boolean algebra, logic design, sequential machines.',3),
    (676,N'ISAT',N'B212',N'Introduction to Computer Architecture',N'UG',N'(Prerequisite: CSCI B211) Organization and architecture of computer systems hardware; instruction set architectures; addressing modes; register transfer notation; processor design and computer arithmetic; memory systems; hardware implementations of virtual memory, and input/output control and devices. ',3),
    (677,N'ISAT',N'B240',N'Introduction to Software Engineering',N'UG',N'{?CSCI B240} (Prerequisite: ISAT B145 or consent of instructor) Fundamentals of software design and development; software implementation strategies; object-oriented design techniques; ethics in software development.',3),
    (678,N'ISAT',N'B250',N'Mobile Application Development',N'UG',N'{?CSCI B250} (Prerequisite: CSCI B145 with grade of C or better, or consent.) Introduction to Mobile application development fundamentals including development platforms, user interface design, data persistence, map Application Programming Interface.',3),
    (679,N'ISAT',N'B255',N'Introduction to Computational Biology',N'UG',N'{?CSCI B255} (Prerequisite: CSCI B104 or BIOL B101 or consent) Introduction to the Linux operating system, an introduction to computational tools used in exploring and analyzing biological data.',3),
    (680,N'ISAT',N'B265',N'Graphics, Multimedia and User-Interface Design',N'UG',N'{?CSCI B265} (Prerequisite: CSCI/MATH B280 or MATH B230, and CSCI B145 or consent.) Principles of windowing systems; Graphical interface design and implementation; Processing graphical data using a high level programming language.',3),
    (681,N'ISAT',N'B280',N'Computational Mathematics',N'UG',N'{?CSCI B280, MATH B280} (Prerequisite: MATH B142 and CSCI B104 or consent of instructor) Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations, diagonalization, and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and engineering disciplines.',3),
    (682,N'ISAT',N'B317',N'Introduction to Digital Forensics',N'UG',N'{?CSCI B317} (Prerequisite: CSCI B201/ISAT B201 or Permission of Instructor) This course will provide students with an introduction to the field of digital forensics and e-discovery. Topics to be covered include the scientific method of digital forensics, electronic discovery, legal issues related to digital analysis, and mobile technologies. Students will learn basic procedures and requirements for conducting digital forensics on a variety of platforms, including Windows, iOS, and Android devices. ',3),
    (683,N'ISAT',N'B318',N'Ethical Hacking',N'UG',N'(Prerequisite: ISAT B201) Introduction to the principles and techniques associated with the cybersecurity practice known as penetration testing or ethical hacking. The course covers planning, reconnaissance, scanning, exploitation, post-exploitation, and result reporting. The student discovers how system vulnerabilities can be exploited and learns to avoid such problems. ',3),
    (684,N'ISAT',N'B320',N'Database Management Systems I',N'UG',N'{?CSCI B320} (Prerequisite: CSCI B145 or consent) Provides foundations of database systems for students with little prior database experience; topics include relational algebra, data models, schema design and normalization, storage management, query, transaction, concurrency control and consistency.',3),
    (685,N'ISAT',N'B321',N'Database-Driven Applications Development',N'UG',N'{?CSCI B321} (Prerequisite: CSCI B145 and CSCI B320) Development of data-driven software for devices including smart phones, tablets, handheld units, and other general purpose computing platforms. Emphasis on database connectivity, design patterns, human-computer interfaces and usability.',3),
    (686,N'ISAT',N'B350',N'Introduction to Data Structures and Algorithms',N'UG',N'{?CSCI B350} (Prerequisite: CSCI/MATH B280 [or MATH B230 and MATH B242], and CSCI B146 or consent) Core techniques in the scientific computing process; the focus is on numerical methods, data structures, and computing optimization.',3),
    (687,N'ISAT',N'B365',N'Computer Graphics',N'UG',N'{?CSCI B365} (Prerequisite: CSCI B240 and CSCI/MATH B280 [or MATH B230] or consent.) Graphics pipeline; 2D and 3D geometric objects and transformations; 2D and 3D viewing, clipping, lighting, and rendering processes; Perspective projections; Lighting and reflectance models; Shading models; Hidden surface elimination; 3D curves and surfaces; Color perception and color models.',3),
    (688,N'ISAT',N'B399',N'Independent Study',N'UG',N'{?CSCI B399} (Prerequisite: Contract approval is required).',3),
    (689,N'ISAT',N'B401',N'Information Security Principles',N'UG',N'(Prerequisite: CSCI B201) This course extends fundamental computer security concepts, practices, and issues, introducing students in the broader field of information security. Topics include: common attack/threat vectors; information security planning; information security prevention, detection, and response tools and approaches; risk and risk assessment; human factors in information security; legal, ethical, and professional issues. ',3),
    (690,N'ISAT',N'B409',N'Special Topics in Security',N'UG',N'(Prerequisite: Consent of instructor) Intensive study of a particular topic in computing security, information security, or other aspects of cybersecurity. Course content varies and will be announced in the schedule of classes by topic title. May be repeated for credit under a different topic title. ',3),
    (691,N'ISAT',N'B416',N'Introduction to Computer Networks',N'UG',N'{?CSCI B416} (Prerequisite: CSCI B145 or consent) Fundamental concepts in computer networks, protocols, and applications. Topics include: network architectures, transmission media, protocols, wireless networks, routing, security and latest topics.',3),
    (692,N'ISAT',N'B420',N'Database Management Systems II',N'UG',N'(Prerequisite: CSCI B320) This course explores advanced data manipulation and server-side programming techniques for use in enterprise Relational Database Management Systems (RDBMS). Topics include: platform specific programmatic extensions to Structured Query Language (SQL); stored procedure, function, and package implementation; trigger creation and usage; query optimization techniques; security considerations. ',3),
    (693,N'ISAT',N'B422',N'Introduction to Data Mining',N'UG',N'{?CSCI B422} (Prerequisite: MATH B230 or CSCI/MATH B280, STAT B340 and CSCI B320) Introduction to information processing techniques and mathematical tools to assemble, access, and analyze data for decision support and knowledge discovery.',3),
    (694,N'ISAT',N'B426',N'Special Topics in Computer Networks & Distributed Computing',N'UG',N'{?CSCI B426} (Prerequisite: CSCI B416) Advanced topics in Computer Networks, course content varies and will be announced in the schedule of classes by suffix and title. May be repeated under different topics.',3),
    (695,N'ISAT',N'B437',N'Information Technology Project Management',N'UG',N'(Prerequisite: CSCI/ISAT B207 and MGMT B371, or consent of instructor) This course introduces students to project management concepts, techniques, and tools used by project managers to plan, initiate, manage and close information technology projects. Topics include: the systems approach to project management; application of a project management framework to the planning and management of scope, cost, people, expectations, risk, communications, and procurement; agile methodologies; project management software.  ',3),
    (696,N'ISAT',N'B450',N'Modeling and Simulation',N'UG',N'{?CSCI B450} (Prerequisite: CSCI B350 or consent, and STAT B340) An introduction to modeling and simulation. Topics include fundamental techniques in designing, coding, and use of simulation software to represent actual or theoretical systems in order to observe their behavior and evaluate design correctness.',3),
    (697,N'ISAT',N'B469',N'High Performance Computing',N'UG',N'{?CSCI B469} (Prerequisite: CSCI B104 or CSCI B145, MATH B230 or CSCI/MATH B280, and CSCI B150) Architecture and interconnection of parallel computers; parallel programming models and applications; issues in high performance computing; programming of parallel computers; general purpose GPU programming and applications.',3),
    (698,N'ISAT',N'B470',N'Software System Process & Management',N'UG',N'{?CSCI B470} (Prerequisite: CSCI B350 or consent) Testing theory and techniques for software systems; software development process, specification, black-box and white-box testing, configuration and compatibility testing, usability testing, quality assurance, testing planning, and documentation.',3),
    (699,N'ISAT',N'B499',N'Computer Science Co-Op/Internship',N'UG',N'{?CSCI B499} (Prerequisite: Computational Science major or consent of instructor) Practical full-time work experience in an area of Computational Science, selected by the student and approved by the Department Chair or Computational Science Program Coordinator. For 1 credit, 45 minimum internship work hours required; for 2 credits, 90 work hours, and for 3 credits, 135 work hours.',1),
    (700,N'LANG',N'B101',N'Integrated Linguistic Skills for Native Speakers I Integrated Linguistic Skills Native Speakers I',N'UG',N'Introduction to foreign language linguistic skills (beginning level 1) with stress on effective communication in both written and spoken language as well as reading comprehension and an understanding of cultural practices for academic purposes. ',3),
    (701,N'LANG',N'B102',N'Integrated Linguistics Skills Native Speakers II',N'UG',N'Continuation (beginning level 2) of foreign language linguistic skills with stress on effective communication in both written and spoken language as well as reading comprehension and an understanding of cultural practices for academic purposes. ',3),
    (702,N'LANG',N'B201',N'Integrated Linguistic Skills Native Speakers III',N'UG',N'Continuation (intermediate level 1) of foreign language linguistic skills with stress on effective communication in both written and spoken language as well as reading comprehension and an understanding of cultural practices for academic purposes. ',3),
    (703,N'LBST',N'B250',N'Liberal Studies Internship',N'UG',N'Provides students with the opportunity to apply interdisciplinary research skills across culturally diverse populations in a professional setting. Minimum requirement of 150 service hours.',3),
    (704,N'LBST',N'B260',N'Introduction to Medical and Health Humanities',N'UG',N'An interdisciplinary course designed for students to focus on the broadly encompassing field of health and medicine from the perspective of the humanities.',3),
    (705,N'LBST',N'B297',N'Interdisciplinary Research Methods',N'UG',N'(Prerequisite: 45 hours of General Studies and acceptance into Interdisciplinary Major and Minor Programs). Introduction to individualized study including initial development or course of study proposal, review of courses, and bibliography.',3),
    (706,N'LBST',N'B305',N'Integrated Liberal Studies I',N'UG',N'Students identify two courses in two different disciplines that have a correlative relationship beneficial to student?s course of study. Student proposal of integrative study due pre-enrollment. Can be repeated up to four credit hours. (pre-requisite: LBST 297; permission of instructor)',1),
    (707,N'LBST',N'B330',N'Cultural Historiography',N'UG',N'Intensive interdisciplinary study of selected topics regarding cultural history with empirical research component. Open to all majors. Can be repeated up to two time (6 credit hours). Topic reflected in section number. Maymester only.',3),
    (708,N'LBST',N'B331',N'Topics in Cultural Historiography',N'UG',N'(Prerequisite: ENGL B101 or B105, and B102 or B106, each with a grade of ?C? or higher)  Intensive interdisciplinary study of selected topics regarding cultural history. Open to all majors. Can be repeated up to two times (6 credit hours). Topic reflected in section number.',3),
    (709,N'LBST',N'B351',N'Beyond the Classroom: Community Project I',N'UG',N'Explores foundations of service learning. Theoretical approach to design and implementation of service learning project in and around the university, with emphasis on community outreach.  Pre-requisite:  LBST major or approval of instructor. Junior standing.',3),
    (710,N'LBST',N'B352',N'Beyond the Classroom: Community Project II',N'UG',N'The application of theoretical foundations and service learning in an a community project designed in LBST 351, implemented as individual or group project.',3),
    (711,N'LBST',N'B363',N'Philosophy of Film',N'UG',N'{?PHIL B363}  (Prerequisite: ENGL B101/B105 and ENGL B102/B106)  Interdisciplinary course with emphasis on topical study of film theory, the aesthetics of film as an art form, the social impact and relevance of film.',3),
    (712,N'LBST',N'B397',N'Readings in Philosophy',N'UG',N'(=PHIL B397) (PREREQ: junior standing and completion of  General Education English and Humanities requirements) A systematic study of a primary source in philosophy having relevance to other disciplines.  Can be conducted as a small course or as a tutorial.  May be taken twice for credit.',3),
    (713,N'LBST',N'B399',N'Independent Study',N'UG',N'(Prerequisite: Contract approval is required.)',3),
    (714,N'LBST',N'B405',N'Integrated Liberal Studies II',N'UG',N'Students identify two courses in two different disciplines that have a correlative relationship beneficial to student?s course of study. Student proposal of integrative study due pre-enrollment. Can be repeated up to four credit hours.  Pre-requisite: LBST 297; permission of instructor.',1),
    (715,N'LBST',N'B439',N'Selected Topics',N'UG',N'(Prerequisite: ENGL B102 or B106 with a grade of "C" or higher) Intensive interdisciplinary study of selected themes or topics as defined by title. May be repeated for credit under a different topic title.',3),
    (716,N'LBST',N'B497',N'Seminar in Liberal Studies among the Disciplines',N'UG',N'Prereq: Senior standing in Liberal Studies or consent of the instructor.',2),
    (717,N'LING',N'B385',N'Gender and Language Use',N'UG',N'{=ANTH 385}  The course will explore an approach to gender and language use that emphasizes the grounding in social practice of both.',3),
    (718,N'LING',N'B431',N'Development of the English Language',N'UG',N'{=ENGL 453}  English from Indo-European through Germanic and into Old English, Middle English and Modern English. No previous knowledge of Old English or Middle English is required.',3),
    (719,N'MART',N'B102',N'Media Design',N'UG',N'Fundamental conceptual and technical aspects of designing popular media, including an introduction to digital compositing, time-based media, and interactive media.',3),
    (720,N'MART',N'B145',N'Digital Imaging',N'UG',N'Foundations class on the aesthetic and communicative elements of digital image production, including 2D computer graphics, 3D motion graphics, and coding for media designers. ',3),
    (721,N'MART',N'B201',N'History of Animation in the US',N'UG',N'{? ARTH B201} A survey of popular animation in the United States, from early 20th century film to contemporary digital media, with an introduction to animation techniques using computer software.',3),
    (722,N'MART',N'B210',N'Digital Animation 1',N'UG',N'Introduction to the theory and practice of using computer software to create animated digital media, including 3D character animation.',3),
    (723,N'MART',N'B250',N'Broadcast Design 1',N'UG',N'Introduction to the design and production of media for documentary style broadcasting, including storyboarding, virtual sets, digital cinematography, video editing, and motion graphics.',3),
    (724,N'MART',N'B281',N'Video Game Design 1',N'UG',N'Introduction to the theory and practice of using computer software to design interactive digital media, including a first-person 3D video game.',3),
    (725,N'MART',N'B310',N'Digital Animation 2',N'UG',N'(Prerequisite: MART B210) Intermediate project-based course on a specialized aspect of digital animation production, including 3D modeling, character animation, or special effects.',3),
    (726,N'MART',N'B350',N'Broadcast Design 2',N'UG',N'Intermediate course on a specialized aspect of designing digital media for a documentary style television broadcast, such as virtual sets, digital cinematography, 3D motion graphics, or special effects.',3),
    (727,N'MART',N'B375',N'Digital Fabrication',N'UG',N'An introduction to emerging technologies relating to rapid prototyping processes, this course focuses on three-dimensional printing and other computer controlled technologies pertaining to the design and fabrication of a sculptural object and/or design.',3),
    (728,N'MART',N'B380',N'New Media Art',N'UG',N'Introduction to the design and development of new media art, including internet-based art, media performance, installation, and interactivity.',3),
    (729,N'MART',N'B381',N'Video Game Design 2',N'UG',N'(Prerequisite: MART B281) Intermediate project-based course on a specialized aspect of 3D video game production, including art assets, level design, or coding events.',3),
    (730,N'MART',N'B385',N'Emerging Technologies',N'UG',N'This course focuses on the use of hardware and software to create artwork that has elements of interactivity, time-based functionality and code manipulation.  Other topics include: DIY movements, microprocessors, and installation art.',3),
    (731,N'MART',N'B410',N'Narrative Media',N'UG',N'MART B410 - NARRATIVE MEDIA (3). Advanced project-based course on telling a story through moving pictures, including taking a script through the 3D production process to a festival quality short animation.  Pre-requisite: MART B310 or permission of instructor.',3),
    (732,N'MART',N'B481',N'Performative Media',N'UG',N'Advanced project-based course on the design and practice of media performance, including the development of interactive virtual characters and environments for a live stage production.  Pre-requisite: MART B381 or permission of instructor.',3),
    (733,N'MART',N'B499',N'Internship in Media Arts',N'UG',N'Supervised experience in media production facilities. Can be taken for 1-3 credits based on 50 contact hours per credit, and contract must be approved by instructor, advisor, and department head.  Pre-requisite: Signed contract and, MART B310 or B381 or permission of instructor.',3),
    (734,N'MATH',N'B101',N'Experiential Mathematics and Computation',N'UG',N'(Prereq. Mathematics Placement Exam and two years of high school algebra or equivalent) Mathematics application and appreciation in algebra, geometry, probability and statistics. Modeling and computation in practical applications. Foundational topics are chosen from: Number and Measurement Systems, Symbolic Relationships, Data Description or Analysis, Geometry, Uncertainty, Reasoning, and the Mathematics of Finance. This course serves as a prerequisite for no other BMTH courses.',3),
    (735,N'MATH',N'B111',N'College Algebra',N'UG',N'(Prereq: qualification through placement) Basic college algebra; linear and quadratic equations, inequalities, functions and graphs of functions, exponential and logarithmic functions, systems of equations. Credit may not be received for both MATH B111 and B111L.',3),
    (736,N'MATH',N'B111E',N'College Algebra Extension',N'UG',N'Basic college algebra; linear and quadratic equations, inequalities, functions and graphs of functions, exponential and logarithmic functions, systems of equations. This extension lab provides supervised practice of skills necessary for proficiency in college-level algebra. Required for enrollment in MATH B111 without an appropriate score on the Mathematics Placement Exam.',1),
    (737,N'MATH',N'B111L',N'Intensive College Algebra',N'UG',N'(Prereq: qualification through placement) Basic college algebra; linear and quadratic equations, inequalities, functions and graphs of functions, exponential and logarithmic functions, systems of equations. Course taught in intensive 3 hours and 45 minute per week format. Credit may not be received for both MATH B111L and B111.',4),
    (738,N'MATH',N'B115',N'Precalculus Mathematics',N'UG',N'(Prereq: qualification through placement or a grade of C or better in 111 or 111L) Topics in algebra and trigonometry specifically needed for BMTH 141, 142, 240. Polynomial, rational, inverse, logarithmic, exponential functions;  circular functions; analytic trigonometry.',4),
    (739,N'MATH',N'B122',N'Calculus for Business Administration and Social Sciences',N'UG',N'(Prereq: qualification through placement or a grade of C or better in BMTH 111/111L or consent) Derivatives and integrals of elementary algebraic, exponential and logarithmic functions. Maxima, minima, rate of change, and area under a curve. Applications include marginality and elasticity of demand.',3),
    (740,N'MATH',N'B131',N'Introductory Mathematics for Comutational Science',N'UG',N'(Prereq: Qualification through placement or a grade of C or better in BMTH 111/111L or consent) Sets, functions, analytic geometry, matrices and Euclidean spaces, infinites series, approximation, precision and error, counting and probability, graphs and trees; fundamental notions of differential and integral calculus.',3),
    (741,N'MATH',N'B141',N'Calculus I',N'UG',N'(Prereq: qualification through placement or a grade of C or better in BMTH 115) Introduction to fundamental concepts and theorems of limits, continuity, and derivatives; rates of change; differentiation rules for algebraic and transcendental functions, including the chain rule; applications of derivatives; introduction to integration, including the Fundamental Theorem of Calculus and u-substitution; areas between curves.',4),
    (742,N'MATH',N'B142',N'Calculus II',N'UG',N'(Prereq: qualification through placement or a grade of C or better in MATH B141) Techniques of integration, applications of the integral, L?Hospital?s Rule, improper integrals; sequences and series of real numbers, power and Taylor series, introduction to polar coordinates.  ',4),
    (743,N'MATH',N'B170',N'Finite Mathematics',N'UG',N'(Prereq: qualification through placement or a grade of C or better in BMTH 111, 111L, or 115) Elementary matrix theory; systems of linear equations; permutations and combinations; probability and Markov chains; linear programming and game theory.',3),
    (744,N'MATH',N'B172',N'Mathematical Modeling for the Life Sciences',N'UG',N'Modeling with difference equations; vectors, trigonometry, polar coordinates, matrices, eigenvalues and eigenvectors; addition and multiplication in combinatorics, permutations, combinations, introduction to probability theory (discrete, continuous); techniques of integration, symmetry. Credit may not be received for both BMTH 172 and either BMTH 170 or 174.',3),
    (745,N'MATH',N'B174',N'Discrete Mathematics for Computer Science',N'UG',N'(Prereq: qualification through placement or a grade of C or better in BMTH 115) Induction, complexity, elementary counting, combinations and permutations, recursion and recurrence relations, graphs and trees; discussion of the design and analysis of algorithms? with emphasis on sorting and searching.',3),
    (746,N'MATH',N'B221',N'Basic Concepts of Elementary Mathematics',N'UG',N'(Prerequisite: Qualification through placement or a grade of C or better in MATH B111, B111L, or B115) The meaning of number, fudametal opertions of arithmetic, the structure of the real number system and its subsyems, elementary number theory. Open only to students in elementary or early childhood teacher certification.',3),
    (747,N'MATH',N'B222',N'Basic Concepts of Elementary Mathematics II',N'UG',N'(Prereq: MATH B221) Informal geometry and basic concepts of algebra. Open only to students in elementary or early childhood teacher certification.',3),
    (748,N'MATH',N'B230',N'Linear Algebra',N'UG',N'(Prereq: MATH B141 or consent of instructor) Linear systems and matrices, vector spaces, linear independence, rank of a matrix, linear transformations, determinants, introduction to eigenvalues and eigenvectors, diagonalization and applications.',3),
    (749,N'MATH',N'B240',N'Calculus III',N'UG',N'(Prereq: qualification through placement or a grade of C or better in MATH B142) Parametric equations, polar coordinates, three dimensional analytic geometry, cylindrical and spherical coordinates, vector functions, functions of several variables, partial differentiation, max-min, Lagrange multipliers, multiple integrals and applications, integral vector calculus.',4),
    (750,N'MATH',N'B242',N'Elementary Differential Equations',N'UG',N'(Prereq: qualification through placement or a grade of C or better in BMTH 142) Ordinary differential equations of first order, higher order linear equations, Laplace transform methods, series methods; numerical solution of differential equations. Applications to physical sciences and engineering.',3);
INSERT [dbo].[Course] ([CourseID],[CourseSubject],[CourseNumber],[CourseName],[Level],[Description],[CreditHours])
VALUES 
    (751,N'MATH',N'B280',N'Computational Mathematics',N'UG',N'{=BCSE 280} (Prereq: BMTH 142 and BCSE 104 or consent of instructor) Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations, diagonalization, and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and engineering disciplines.',3),
    (752,N'MATH',N'B300',N'Introduction to Proof',N'UG',N'(Prerequisite: Grade of ''C'' or better in MATH B142) Introduction to the language and nature of reasoning, structure, and technique as they apply to advanced mathematics and proofs. Topics include logic, set theory, cardinality, and methods of proof (including induction).',3),
    (753,N'MATH',N'B331',N'Foundations of Geometry',N'UG',N'(Prerequisite: Grade of ''C'' or better in MATH B300) The study of geometry as a logical system based upon postulates and undefined terms. The fundamental concepts and relations of Euclidean geometry developed rigorously on the basis of a set of postulates. Some topics from non-Euclidean geometry.',3),
    (754,N'MATH',N'B399',N'Independent Study in Mathematics',N'UG',N'Contract approval by instructor, advisor, Department Chair and Vice Chancellor for Academic Affairs is required.',3),
    (755,N'MATH',N'B401',N'History of Mathematics',N'UG',N'(Prerequisite: C or better in MATH B122 or MATH B141) A study of the historical development of mathematics focusing on conceptual milestones.',3),
    (756,N'MATH',N'B410',N'Abstract Algebra I',N'UG',N'(Prerequisite: A grade of C or better in both MATH B230 and MATH B300 or consent of the department) An introduction to algebraic structures. Introduction to group theory including subgroups, quotient groups, homomorphisms; introduction to rings including ideals, quotient rings, polynomial rings and fields of fractions.',3),
    (757,N'MATH',N'B411',N'Abstract Algebra II',N'UG',N'(Prerequisite: A grade of C or better in MATH B410)  A continuation of studies in Algebra. An introduction to modules and field theory including  vector spaces, algebras  and  free abelian  groups;  introduction to field theory  including  algebraic  extension,  Galois theory and finite fields.',3),
    (758,N'MATH',N'B419',N'Mathematical Modeling',N'UG',N'MATH B419- MATHEMATICAL MODELING (4).  {? CSCI B419} (Prerequisite: C or better in MATH B142 and CSCI B104 or consent) Utilizes numerical and mathematical analysis to investigate experimental data and complex systems in science and/or engineering. Emphasis is on the mathematical modeling techniques and computer programming to explore applied problems.',4),
    (759,N'MATH',N'B421',N'Mathematics for Secondary Teachers',N'UG',N'(Prereq: Admission to professional program in education) Survey of properties and algebra of real numbers and complex numbers; properties and representations of various functions; concepts of calculus; Euclidean and non-Euclidean geometries; applications of probability, data analysis, and discrete mathematics.',3),
    (760,N'MATH',N'B427',N'Numerical Analysis',N'UG',N'Interpolation and approximation of functions; solution of algebraic equations; numerical differentiation and integration; numerical solutions of ordinary differential equations and boundary value problems; computer implementation of algorithms.',3),
    (761,N'MATH',N'B450',N'Analysis I',N'UG',N'(Prerequisite: C or better in MATH B300 or permission of the instructor) A rigorous treatment of topics introduced in elementary calculus and more advanced topics basic to the study of real analysis.',3),
    (762,N'MATH',N'B451',N'Analysis II',N'UG',N'(Prerequisite: A grade of C or better in MATH B450 or consent of the department) An introduction to the theory of several variables calculus: convergence in Euclidean spaces, functions on Euclidean spaces, differentiation in several variables, integration in several variables.',3),
    (763,N'MATH',N'B452',N'Complex Analysis',N'UG',N'(Prerequisite: Grade of C or better in MATH B240) Complex integration, calculus of residues, conformal mapping, Taylor and Laurent series expansions, applications. ',3),
    (764,N'MATH',N'B460',N'Topology',N'UG',N'(Prerequisite: C or better in MATH B300 or permission of the instructor) Topological spaces and homeomorphisms; separability; compactness; connectedness; completeness; metrizability; introduction to homotopy theory.',3),
    (765,N'MATH',N'B480',N'Senior Seminar',N'UG',N'A review of current literature in specified subject areas involving student presentations. Content varies and will be announced in the schedule of classes by suffix and title.',3),
    (766,N'MATH',N'B497',N'Reading for Senior Thesis',N'UG',N'(Prerequisite: Junior Standing with a GPA of 3.0 or higher within Mathematics major and Departmental Approval) Directed reading in preparation for senior thesis in literature.',3),
    (767,N'MATH',N'B499',N'Senior Thesis',N'UG',N'(Prerequisite: MATH B97) The senior thesis provides a capstone experience for Mathematics majors. Students will work independently and with the professor to complete a substantial expository or research project.',3),
    (768,N'MGMT',N'B300',N'Careers in Business',N'UG',N'An introduction to career opportunities and the career placement process in business.',3),
    (769,N'MGMT',N'B355',N'Introduction to Health Care Management',N'UG',N'(Prerequisite: Junior Standing) This course will provide students with the opportunity to develop a general understanding of the health care industry and managerial and organizational aspects of health care organizations. Students will learn to apply management concepts, processes, and theoretical ideas in addressing management problems in health care organizations and in the operation of health care systems. Course activities will enable students to learn the importance of identifying and managing finite resources, complying with ethical and legal standards, and recognizing tradeoffs between patient care and financial accountability.  ',3),
    (770,N'MGMT',N'B371',N'Principles of Management and Leadership',N'UG',N'A comprehensive survey of the basic principles of management and leadership applicable to all forms of business. The course provides the student with a basis for thinking about complex business situations in the framework of analysis of the management and leadership process.',3),
    (771,N'MGMT',N'B374',N'Human Resource Management',N'UG',N'A development of an understanding of personnel administration as a staff function through a study of modern-day concepts and practices. Topics include: research and standards, employment, training and education, safety and health, employee services and industrial relations.',3),
    (772,N'MGMT',N'B376',N'Organization Behavior',N'UG',N'A study of the process of integrating people into a work situation that motivates them to work together productively, cooperatively and with economic, psychological and social satisfaction.',3),
    (773,N'MGMT',N'B378',N'Labor Relations',N'UG',N'(Prereq: Junior standing) A study of the development and methods of labor unions and employee associations in organization. Labor disputes, collective bargaining techniques, contents of contracts and public policies are analyzed from the standpoints of economics and law. Topics covered in detail include employee representation, company unions, strikes, boycotts, lockouts and trade agreements.',3),
    (774,N'MGMT',N'B380',N'Employment Law',N'UG',N'This course surveys the laws that govern the employment relationship between employers and employees including employment-at-will, contractual arrangements, discrimination, compensation, employee safety and health and privacy protections. Labor law is covered briefly so that it can be understood in the context of other employment law.',3),
    (775,N'MGMT',N'B390',N'Management Information Systems',N'UG',N'(Prereq: BMGS B290 or satisfactory completion of Computer Applications Proficiency Exam) A study of the concepts, interactions and functions of major business systems with particular emphasis on the problems and issues related to computer based systems. Included are concepts of designing information systems, collecting and processing data, reporting results of operations and controlling the business organization.',3),
    (776,N'MGMT',N'B401',N'Topics in  Entrepreneurship',N'UG',N'Relevant selected issues and topics of interest in management. Issues and concepts of the business world are explored with film profiles, case histories and readings.',3),
    (777,N'MGMT',N'B403',N'Leadership in Organizations',N'UG',N'Reviews research and practice in organizational leadership; provides students with self-assessment, developmental exercises and case studies to prepare for leadership roles.',3),
    (778,N'MGMT',N'B404',N'Pay, Rewards, and Compensation Management',N'UG',N'An examination of how organizations use pay and other types of rewards (both intrinsic and extrinsic) to affect employee motivation and behavior.',3),
    (779,N'MGMT',N'B405',N'Staffing, Training and Development',N'UG',N'An examination of how organizations can improve workforce quality by making effective use of recruiting and selection processes. Attention is also given to the training and development of new hires and to legal issues that surround the staffing process.',3),
    (780,N'MGMT',N'B411',N'International Management',N'UG',N'(Prereq: Junior standing) This course will apply the basic principles of management and leadership to the firm operating internationally. Emphasis is placed on the management functions of leading, planning, organizing and controlling, as well as the conduct of labor relations, within the framework of a multicultural environment.',3),
    (781,N'MGMT',N'B473',N'Management and Operations of Small Business',N'UG',N'Analysis of the management and operations of a small business. The course includes the study of an existing small business. The areas of management, finance, marketing and credit as they apply to a small business are studied.',3),
    (782,N'MGMT',N'B474',N'Advanced Management of Human Resources',N'UG',N'This course covers in detail topics from BMGT 374.  Involves students in problem-solving activities and in-depth analysis of cases, using concepts from BMGT 374 and 376.',3),
    (783,N'MGMT',N'B475',N'Operations and Supply Chain Management',N'UG',N'A study of the strategic, operating and control decisions involved in manufacturing and service organizations. Topics include forecasting, process development, production technology, resource allocation, facility planning, facility layout, planning systems, inventory systems, resource requirements planning systems, shop floor planning, scheduling operations, just-in-time manufacturing, materials management, productivity control, quality management, quality control, project management and lean Six Sigma.',3),
    (784,N'MGMT',N'B476',N'Supply Chain Management: A Logistics Perspective',N'UG',N'A strategic managerial emphasis that combines strategy.',3),
    (785,N'MGMT',N'B477',N'Organization Theory',N'UG',N'A conceptual framework for the orderly analysis of management functions through studies in organization planning and control theories.',3),
    (786,N'MGMT',N'B478',N'Strategic Management',N'UG',N'A study of the strategic management process and of the formulation and application of functionally integrated business policy by top management. Emphasis is on decision-making in the face of changing conditions.',3),
    (787,N'MGMT',N'B488',N'Business SImulation',N'UG',N'This course is designed to integrate multiple areas of specialization within a ?simulated? business environment. Students will have the opportunity to formulate, develop, and implement strategic issues and concepts for a "simulated" company.  Students will also apply strategic knowledge to financial markets as a means to understand the interaction of various market variables.',3),
    (788,N'MGMT',N'B498',N'Strategic Human Resource Management',N'UG',N'A comprehensive analysis of strategic Human Resource Management?s participation in the strategic planning process.',3),
    (789,N'MGSC',N'B290',N'Computer Information Systems in Business',N'UG',N'Concepts and techniques of business problem solving using microcomputers. Introduction to the PC operating environment, basic information system concepts and spreadsheet, presentation, database and word processing software.',3),
    (790,N'MGSC',N'B390',N'Management Information Systems',N'UG',N'A study of the concepts, interactions and functions of major business systems with particular emphasis on the problems and issues related to computer based systems. Included are concepts of designing information systems, collecting and processing data, reporting results of operations and controlling the business organization.  (Prerequisite: MGSC B290 or satisfactory completion of Computer Applications Proficiency Exam)',3),
    (791,N'MKTG',N'B350',N'Principles of Marketing',N'UG',N'Principles and concepts underlying marketing functions, including the conception, pricing, promotion and distribution of products and services and the role of marketing in society.',3),
    (792,N'MKTG',N'B352',N'Introduction to Marketing Research',N'UG',N'Investigates the theory and practice of marketing research with emphasis on the problem-oriented nature of marketing research and how research activities are implemented by marketing researchers and used by managers.',3),
    (793,N'MKTG',N'B453',N'NULL',N'UG',N'This course is intended to provide the student with an understanding of the fundamentals of sales management including the recruitment, training, motivation, compensation and evaluation of a sales force.',3),
    (794,N'MKTG',N'B454',N'Marketing Communications and Strategy',N'UG',N'Integration of advertising, sales promotion, and point-of-purchase communications toward the goal of enhancing brand equity.',3),
    (795,N'MKTG',N'B455',N'Consumer Behavior',N'UG',N'The principal objective of study is the consumer decision process as examined in a marketing context.  Selected concepts from psychology, sociology, anthropology and behavioral disciplines are analyzed to develop the student''s ability to understand and predict reactions of consumers to marketing decisions.',3),
    (796,N'MKTG',N'B457',N'Personal Selling and Sales',N'UG',N'This course is a comprehensive survey of the basic process of personal selling and sales management applicable to all forms of business.  The course is intended to provide the student with a basis for developing personal selling skills as well as understanding the fundamentals of sales management.',3),
    (797,N'MKTG',N'B465',N'Marketing Strategy and Planning',N'UG',N'Management of marketing organizations and integration of functions, with emphasis on planning and designing strategies and applying tools and techniques for problem solving and decision making.',3),
    (798,N'MKTG',N'B474',N'Sports Marketing',N'UG',N'(Prerequisite: MKTG B350) A study of promotion, sales, and sponsorship strategies utilized in both the marketing of sports (events and properties) and marketing through sports (building brands via alignment with a sports property). ',3),
    (799,N'MSCI',N'B101',N'Introductory Oceanography I',N'UG',N'(Prereq: science, engineering, or education major or consent of instructor) Origin and evolution of the oceans, plate tectonics, ocean circulation, waves and tides, chemical composition and primary productivity. Three lecture and three laboratory hours per week. Scheduled field trips required.',3),
    (800,N'MSCI',N'B102',N'Oceanography II',N'UG',N'(Prereq: science, engineering, or education major or consent of instructor) Origin, evolution and diversity of marine life, biological production, trophic dynamics, nutrient cycles, marine resources and environmental concerns. Three lecture and three laboratory hours per week. Scheduled field trips required.',3),
    (801,N'MSCI',N'B111',N'Evolution of the Marine Environment',N'UG',N'Origin/evolution of the earth, seas and life over geologic time; fundamental processes of plate tectonics, evolution and genetics. Three lecture and two laboratory hours per week. Scheduled field trips are required.',3),
    (802,N'MSCI',N'B112',N'Processes in the Marine Environment',N'UG',N'Study and analysis of interacting abiotic and biotic processes determining the nature and functioning of the marine environment. Three lecture and two laboratory hours per week. Scheduled field trips are required.',3),
    (803,N'MSCI',N'B210',N'Oceans and Society',N'UG',N'A non-technical introduction to the oceans: organisms, systems and the physical and chemical characteristics.  Laboratories illustrate the structure and function of marine environments.  Two laboratory hours per week.  Attendance on field trips may be required.',4),
    (804,N'MSCI',N'B215',N'Coastal Environments of the Southeastern',N'UG',N'Coastal zones of South Carolina and neighboring states, including geologic history, geomorphology, stratigraphy, hydrogeology, shoreline processes, environmental issues and effect of man. Three lecture hours each week plus optional field trips. Not available for marine science major credit.',3),
    (805,N'MSCI',N'B215L',N'Coastal Environments of the Southeastern U.S. Laboratory',N'UG',N'Exercises examining coastal ecology, geomorphology, hydrogeology, shoreline processes, environmental issues and human impact. Two laboratory hours per week. Scheduled field trips required. Not available for marine science major credit.',1),
    (806,N'MSCI',N'B311',N'Biology of Marine Organisms',N'UG',N'(Prereq: BBIO 112) Biological concepts emphasizing adaptation to marine environments. Laboratory experiments emphasize principles and techniques of marine biological study. Three lecture and three laboratory hours per week. Scheduled field trips are required.',3),
    (807,N'MSCI',N'B398',N'Advanced Topics in Marine Science',N'UG',N'Study of a topic not otherwise available to student.  May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor.  Repeatable to a maximum of 8 credit hours.',3),
    (808,N'MUSC',N'B110',N'Introduction to Music',N'UG',N'Perceptive listening and appreciation of musical elements, forms and style periods, including composers? lives, individual styles and representative works. Emphasis on classical music; jazz and American popular music included.',3),
    (809,N'MUSC',N'B124',N'Symphonic Band',N'UG',N'Musical organizations are open to all university students by audition.',3),
    (810,N'MUSC',N'B129',N'University Chorus',N'UG',N'Musical organizations are open to all university students by audition. May be repeated for up to 8 credits. Course may not be used to fulfill GE requirement.',1),
    (811,N'MUSC',N'B130',N'Sound Design',N'UG',N'Theory, Harmony, Form and Analysis, Writing, Choral, (SATB), Piano/vocal, Ensemble scores. Acoustics, Sound Reproduction (Attack, Sustain Decay, Amplitude, Frequency, Compression, Reverb). Engage students with basic concepts of music using current software applications.',3),
    (812,N'MUSC',N'B140',N'Jazz and American Popular Music',N'UG',N'Development of jazz and American popular music through the study of important soloists, ensembles, arrangers and composers.',3),
    (813,N'NURS',N'B100',N'Nursing Honors Seminar',N'UG',N'This honors course is designed to provide students the opportunity to explore the changing role of nursing in the American healthcare system. Seminar meetings and planned excursions will facilitate scholarly exploration of the practice of nursing, with an emphasis on the factors influencing current and future nursing practice. May be repeated for up to 4 credits.',1),
    (814,N'NURS',N'B101',N'Nursing Honors Seminar II',N'UG',N'This honors course is designed to provide students with the opportunity to explore the changing role of nursing in the American healthcare system. Seminar meeting and planned excursions will facilitate scholarly exploration of the scope of practice including direct care roles and indirect care roles of the nurse and their influence on health policy and the health of populations across the nation.',1),
    (815,N'NURS',N'B105',N'Concepts, Communications, and Calculations',N'UG',N'This course introduces concepts essential to basic nursing practice. Nursing''s historical evolution as a profession through theory, concept and role development will be presented. An overview of medical terminology and medication calculations is provided as rudimentary skills that promote effective interpretation and communication within the health disciplines, and the mathematical calculations required to adminster pharmaceutical agents.',3),
    (816,N'NURS',N'B200',N'Nursing Honors Seminar III',N'UG',N'This honors course is designed to provide students the opportunity to explore the changing role of nursing across the globe. Seminar meetings and planned excursions will facilitate scholarly exploration of nursing practice, comparing and contrasting nursing practice in developed and developing countries with the United States. Emphasis is placed on the the social determinants of health that influence disease prevention and health.',1),
    (817,N'NURS',N'B201',N'Nursing Honors Seminar IV',N'UG',N'This honors course is designed to provide students the opportunity to explore the changing role of nursing to improve the health of others. Through seminar meetings and experiential learning, students will pursue a scholarly exploration of the healthcare system and health needs of populations at the regional, state, national or international level, culminating in a service-learning project focused on the leading health indicators of the Centers for Disease Control and Prevention (CDC) Healthy People 2020',1),
    (818,N'NURS',N'B202',N'Decision-Making in Concept Based Care',N'UG',N'(For the pre-licensure track: Prerequisite: Acceptance as a pre-licensure BSN student; Co-requisite: NURS B310 and NURS B312) The nursing process as a problem-solving framework is introduced to identify, treat, evaluate and document clinical problems in health records. Emphasis is placed on patient- and family-centered therapeutic communication as an adjunct to assessment and evaluation. Selected universal concepts reflecting the holistic nature of caregiving across settings are presented to advance critical thinking.',3),
    (819,N'NURS',N'B202C',N'Clinical Care & Introduction to Nursing Techniques',N'UG',N'This course emphasizes how to perform common nursing procedures. Techniques and skill development are practiced ensuring patient confidentiality, comfort measures and pain management, dietary restrictions/ intake and output measurement, infection control, vital signs, body mechanics/safety, concepts of self-care/hygiene, mobility and transfer, basic lab collection and interpretation of lab values commonly used in practice settings.',3),
    (820,N'NURS',N'B300',N'Sex, Sexuality, Gender and Healthcare',N'UG',N'This course presents issues of sex, sexuality, and gender (SSG) that health care professionals will encounter.  Students will learn the impact of sex, sexuality and gender in the context of healthcare.  Disparities of health issues will be discussed from the continuum of health care practice, from education, through diagnosis, to treatment and response.',3),
    (821,N'NURS',N'B301',N'Role Development in Nursing',N'UG',N'(Prerequisite: Acceptance into the RN to BSN Program and current RN licensure or consent of the instructor) Overview of the historical aspects of professional nursing and the impact this history has on current day nursing practice. Emphasizes the development of nursing as a profession including scholarship, theories, advanced practice and leadership. Presents emotional intelligence as a construct linked to effective leadership and interdisciplinary team relationships.',3),
    (822,N'NURS',N'B303',N'Health & Wellness Innovation: Creative Inquiry',N'UG',N'{?PUBH B303} (Prerequisite: NURS B350) The purpose of this course is to introduce and encourage health professional-driven innovation. This course equips students with an empathetic mindset to see healthcare and public health issues from the perspective of the person who is experiencing the challenge. Students will develop new and creative ways to improve health and well-being. ',3),
    (823,N'NURS',N'B305',N'Spirituality, Health, and Health Professions',N'UG',N'Exploration of spirituality, its effect on health, and health professionals roles in the spiritual care of clients.',3),
    (824,N'NURS',N'B310',N'Pathophysiology',N'UG',N'(Prerequisite: Acceptance to the Pre-licensure or RN to BSN Program or consent of Instructor) Building on prior science courses, this course advances knowledge of pathophysiology by analyzing the molecular, cellular and organ system changes that occur with common diseases, noting their impact on total body function and homeostasis. Focus is on the mechanisms of underlying diseases needed to deliver preventive and therapeutic health care interventions. ',3),
    (825,N'NURS',N'B312',N'Assessment and Physical Examination of Individuals',N'UG',N'(Prerequisite: Acceptance to the Pre-licensure program, RN licensure or consent of instructor).  Students will conduct a systematic patient examination to determine the health, health risk, and health alterations from the disease conditions. The focus is on adults with normal physiologic variation and extends to include age, gender, and socio-cultural variants. Using assessment findings students will derive clinical problem statements, determine risk reduction strategies, and align assessment findings with laboratory and other diagnostic results to create a comprehensive health profile.',3),
    (826,N'NURS',N'B320',N'Clinical Pharmacology',N'UG',N'(Prerequisite: NURS B310 or consent of instructor) This course provides an overview of the chemical therapeutic measures which assist patients in reducing the physical and emotional effects of illness and in improving or promoting health. Focus is on the mechanism of action of these interventions as they affect underlying physiological and pathophysiological processes (Lecture 3 hours).',3),
    (827,N'NURS',N'B325',N'Nursing Informatics and Technology in Healthcare',N'UG',N'(Prerequisite: NURS B202 or B301) This course introduces nursing informatics and patient care technologies utilized in healthcare settings. Students explore informatics and technology from identification, retrieval, processing, evaluation, and management of healthcare technology and information systems intended to improve patient outcomes and reduce risk of harm. Legal and ethical considerations related to these technologies are examined. Emphasis is placed on selected technologies and evaluating how they impact nursing practice and influence quality and safety across the continuum of care. Basic computer literacy is a pre-requisite to support success.',3),
    (828,N'NURS',N'B326',N'Adult Health Nursing I',N'UG',N'(Prerequisite: NURS B202, B310 and B312; Co-req. NURS B320). This course includes information on common chronic and acute illnesses including pre- and post-operative preparation. A nursing process approach outlines nursing actions for major common illnesses in the hospital setting.  Intermediate nursing skills are taught in the laboratory and applied in the clinical area. Students learn how to provide appropriate nursing care to patients with common health problems and patients requiring surgery (Lecture 3 hours, Laboratory 3 hours, Clinical Experience 6 hours).',6),
    (829,N'NURS',N'B326C',N'Clinical Care of Adults with Acute and Chronic Conditions',N'UG',N'(Prerequisite: NURS B202, B202C, B312; Corequisite: NURS B320 & B326) Students will be exposed to adults and older adults with acute and chronic conditions. Clinical experiences will focus on the application of knowledge and skills related to the care of an adult patient. Emphasis will be placed on applying the nursing process to manage care, setting clinical priorities and using technology to anticipate patient needs as a member of interprofessional teams.',3),
    (830,N'NURS',N'B330',N'Transcultural Health',N'UG',N'(Prerequisite: PSYC B101 or SOCY B101 or consent of Instructor) This course surveys the cultural and social dimensions of health and illness with emphasis on the development of cultural competence.  Different populations are examined for the development of a personal understanding of the traditions and customs of their societies, providing a unique perspective on the implications for patient care. (Lecture 3 hours) (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3),
    (831,N'NURS',N'B341',N'Performance of Caring',N'UG',N'{?THEA B341} (Prerequisite: SOCY B101 or PSYC B101) The class aims to train students to act as Simulated Participants (SP) in the Nursing Simulation lab as patients and supporting roles (such as patient family members) in dynamic, realistic simulated healthcare experiences. These experiences help train future nurses in a lifelike way.  ',3),
    (832,N'NURS',N'B350',N'Nursing Research',N'UG',N'(Prerequisite: STAT B201 and NURS B202 or RN Licensure or consent of Instructor).  Nursing research introduces the basic research process, including methods commonly used in nursing. Content includes ethical issues, evaluation of research for evidenced based practice and the nurse researcher role (Lecture 3 hours).',3),
    (833,N'NURS',N'B356',N'Women''s Health Nursing',N'UG',N'(Prerequisite: NURS B320 and NURS B326; Co-requisite: NURS B358).  Content includes nursing care of women related to all aspects of reproductive health. Cultural differences are discussed. Coaching strategies and research outcomes for this population are described.  Students will develop safe practice of basic obstetrical and gynecological nursing skills first in a laboratory setting and then apply these skills in a clinical setting (Lecture 3 hours, Laboratory 1 hour, Clinical Experience 5 hours).',5),
    (834,N'NURS',N'B357',N'Nursing Concepts in Adult Health',N'UG',N'(Prerequisite: Junior Standing) This class will help bridge an identified learning gap between NURS B326 and NURS B425.  The class will reinforce knowledge and application in Adult Health Nursing using a concept-based approach. The content will focus on critical thinking and clinical judgement utilizing the nursing process.  ',3),
    (835,N'NURS',N'B358',N'Children''s Health Nursing',N'UG',N'(Prerequisite: NURS B320 and NURS B326; Co-requisite: NURS B356). Focus is on the nursing care of children and their families. Normal growth and development, pediatric assessment and common health issues including childhood communicable diseases and genetic abnormalities are presented. Students will develop safe practice of applying basic nursing skills first in a laboratory setting and then in pediatric inpatient and outpatient settings (Lecture 3 hours, Laboratory 1 hour, Clinical Experience 5 hours).',3),
    (836,N'NURS',N'B360',N'Gerontological and Rehabilitation Nursing',N'UG',N'(Prerequisite: RN licensure, or NURS B312 and NURS B326, or permission of the instructor)  Care and special needs of the older adult in various care settings. Gerontological nursing, presentation of disease, rehabilitation, health promotion, reimbursement and a comprehensive nursing gerontological assessment are covered. (Lecture 3 hours).',3),
    (837,N'NURS',N'B360C',N'Clinical Care of Childbearing Families',N'UG',N'(Prerequisite: NURS B320 & B326. Corequisite: NURS B356 & B358) In conjunction with NURS B358, this course blends practice/simulation laboratory experiences with clinical experiences in care settings where mothers, infants, children and family units receive care.',3),
    (838,N'NURS',N'B395',N'Global Healthcare Study Abroad',N'UG',N'Provides students the opportunity to engage in global health fieldwork in an international service learning setting. Faculty collaborate with international partners to develop customized global healthcare immersion experiences.',3),
    (839,N'NURS',N'B399',N'Independent Study in Nursing',N'UG',N'This course is an advanced study of a particular theme or topic in the nursing through readings, research, and analysis. It is designed for students who have completed basic courses and who want to study specific topics that are not offered in the curriculum or extend learning of a topic from a course already completed (i.e., develop a poster or manuscript based on a scholarly paper).  A contract of study is developed through readings, projects, papers, and/or seminars approved by instructor.  Up to 3 credits may be contracted and repeated for a total of 6 credits.',1),
    (840,N'NURS',N'B401',N'Health Care Delivery Systems',N'UG',N'Systems theory; health care delivery systems conceptualizes transitions from one level of care to another with emphasis on ethical and legal issues; technology; historical, political and economic aspects to meet the health care needs of the population. (Lecture 3 hours)',3),
    (841,N'NURS',N'B410',N'Professional Nursing Leadership and Management',N'UG',N'(Pre-requisites: Acceptance to RN-to-BSN program or NURS B326 and NURS B401 or permission of the instructor)   This course provides an introduction to evidence-based nursing leadership and management practice. The course includes theoretical underpinnings of nursing leadership and management, to prepare the student for the organizational and managerial skills needed for day to day management of staff nurses delivering health care to multiple patients as well as future positions of leadership.   ',4),
    (842,N'NURS',N'B412',N'Mental Health Nursing',N'UG',N'(Prerequisite: NURS B326, NURS B320, NURS B350, and NURS B401). Nursing care of individuals with mental health issues ranging from major psychiatric disorders to short situational stressors is taught with an emphasis on positive mental health. Students will develop safe practice of basic nursing skills first in a laboratory setting and then in community-based and in-patient mental health settings. (Lecture 2 hours, Laboratory 1 hour, Clinical Experience 5 hours).',4),
    (843,N'NURS',N'B415',N'Gerontological and Rehabilitation Nursing',N'UG',N'(Prerequisite: NURS B301 or NURS B326 and NURSB 312; Pre or Co-requisite: NURS B350)  Care and special needs of the older adult in various care settings. Gerontological nursing, presentation of disease, rehabilitation, health promotion, reimbursement and a comprehensive nursing gerontological assessment are covered. (Lecture 3 hours).',3),
    (844,N'NURS',N'B416',N'Inactive Fall 2015 - Community Health Nursing',N'UG',N'(Prerequisite: NURS B356 and NURS B358 for pre-licensure students and NURS B350 for all nursing students; Co-requisite or Prerequisite: NURS B401 for all nursing students). Evidence-based nursing with individuals across the lifespan, families and other diverse population groups. Levels of prevention are explored in relationship with epidemiological effects of environment and lifestyle on client health. Laboratory and clinical experience includes identification and application of community resources using a case management approach to provide care in community health centers, acute care centers, shelters, home health and hospice agencies (Lecture 3 hours, Laboratory 1 hour, Clinical Experience 8 hours).',6),
    (845,N'NURS',N'B418',N'Community Health Nursing',N'UG',N'(Prerequisites:  NURS B356, NURS B358, and NURS 360 for pre-licensure students; NURS B350 for all nursing students; Co-requisite or Prerequisite:  NURS B401 for all nursing students) Evidence-based nursing with individuals across the lifespan, families, and across population groups.  Levels of prevention are explored in relationship with epidemiological effects of environment and lifestyle on client health. Laboratory and clinical experience include identification and application of community resources using a case management approach to provide care in community health centers, acute care centers, shelters, home health,  hospice agencies, and other community organizations. (Lecture 3 hours, Laboratory 1 hour, Clinical experience 5 hours per week.)',5),
    (846,N'NURS',N'B420',N'Trends and Issues in Nursing',N'UG',N'(Prerequisite: NURS B356 and NURS B358 for pre-licensure students) Historical and present trends in nursing practice are taught in this course with a perspective on nursing education, genetic research, evidenced-based practice and complementary therapies (Lecture 3 hours).',3),
    (847,N'NURS',N'B422C',N'Clinical Care in Public and Community Health Settings',N'UG',N'(Prerequisite: NURS B320, B326, B350 and B401. Corequisite: NURS B412 and B418) In conjunction with NURS B412 and NURS B418, this clinical course focuses on experiential learning in community-based or public health settings. These settings serve primary and prevention care needs of school age, mental health, addictions, or other populations. A change management project that involves priority setting, delegation, policy making, budgeting, and/or measurement of community impact is introduced. Clinical experience may also include providing community-based education, care coordination, and managing resource capacity.  ',3),
    (848,N'NURS',N'B424',N'Professional Nursing Leadership and Management',N'UG',N'(Pre-requisites: NURS B416 and NURS B412 or acceptance into RN-to-BSN program; Co-requisites: NURS B426 and NURS B435 and NURS B424P or acceptance into RN-to-BSN program) This course provides an introduction to evidence-based nursing leadership and management practice.  The course includes theoretical underpinnings of nursing leadership and management followed by pragmatic, "real life" application of theory to practice.',3),
    (849,N'NURS',N'B424P',N'Professional Nursing Leadership and Management Practicum',N'UG',N'(Prerequisite: Pre-licensure Program, NURS B416 and NURS B420; Co-requisite: NURS B424 and NURS B435 for pre-licensure students) Principles of management and theories of leadership are implemented in an inpatient facility and/or community setting. Student projects will involve the application of a leadership or management strategy for problem identification and resolution in the clinical area (Laboratory 1 hour,Clinical Experience 8 hours).',3),
    (850,N'NURS',N'B425',N'Adult Health Nursing II',N'UG',N'Through implementation of the nursing process, students focus on nursing interventions,  as well as applying leadership and management principles, to coordinate the complex care needs of the adult medical/surgical patient at the bedside and during transitions of care.  Students build on clinical practice from previous courses and apply safe practice of advanced nursing skills in preparation for professional practice.  (Class 3 hours, Laboratory 3 hours, Clinical practice 15 hours) (For the Pre-licensure Program: Prerequisite Courses NURS B410,  NURS B412, NURS B418;  Co-requisite: NURS B435)',9),
    (851,N'NURS',N'B425C',N'Clinical Care of High Acuity Adults & Elders',N'UG',N'(Prerequisite: NURS B326, B326C, B412, B418 & B422C. Corequisite: NURS B425) Students will have exposure to adults and elders with high acuity needs. Clinical experiences will focus on the application of knowledge and skills related to the care of a high acuity adult or elder. Emphasis will be placed on application of the nursing process to manage care and reduce risks in this population, utilization of technology to monitor rapidly changing patient needs, plan and prioritize care, anticipate patient needs and contribute to interprofessional teams collaborating care for the high acuity adult or elder.',3),
    (852,N'NURS',N'B426',N'Adult Health Nursing II',N'UG',N'(For the Pre-licensure Program: Prerequisite Courses NURS B412, NURS B415 and NURS B416; Co-requisite: NURS B424 and NURS B435).  Through implementation of the nursing process, students focus on nursing interventions for the care of adult clients experiencing critical, multi-system alterations in function.  Students will build on clinical practice from previous courses and apply safe practice of advanced nursing skills in an intensive clinical setting (Lecture 3 hours, Clinical experience 9 hours).',6),
    (853,N'NURS',N'B430C',N'Clinical Synthesis and Seminar',N'UG',N'(Prerequisite: NURS B412, B418 and B422C) In this clinical course, students will have an opportunity to model program outcomes and strengthen their abilities to manage a client population throughout a shift, focusing on organizational, delegation, and time management skills. Priority setting and the ability to develop focus in delivering care to more than one client are emphasized. In the seminar setting, synthesis of clinical information linked to individuals, families, and communities will be reviewed. Role understanding and clinical functioning will be evaluated to meet entry-level practice expectations. Knowledge of patient education, discharge planning, team functions, and nursing skills will be demonstrated. ',3),
    (854,N'NURS',N'B435',N'Professional Nursing Seminar',N'UG',N'(Prerequisite: NURS B415 and NURS B416; Co-requisite: NURS B424 and NURS B426 for pre-licensure students). This course prepares the pre-licensure student for transition to the role of professional nurse. An overview of career choices, readiness for NCLEX exam and continuing education and career advancement in the workplace is presented (Lecture 1 hour).',2),
    (855,N'NURS',N'B441',N'Capstone: Professional Nursing Project',N'UG',N'(Prerequisite: All other RN-BSN nursing courses). The student will identify a project that synthesizes professional nursing curriculum theory and principal threads of Assessment, Critical thinking, Emotional Intelligence, Care Coordination and Cultural competence. The student will investigate a professional nursing issue, plan a project individualized to the student?s interests and develop a learning contract for a project is identified, planned and implemented that focuses on a professional nursing issue. The student will use curriculum threads of Assessment, Critical thinking, Emotional Intelligence, Care Coordination and Cultural competence to complete this clinical experience. (Seminar 2 hours, Clinical Experience 9 hours).',5),
    (856,N'NURS',N'B450',N'Ethical Decision-Making, Legal Issues and Health Policy in Professional Nursing',N'UG',N'(Prerequisite: NURS B202 or B301) This course examines legal and ethical issues in healthcare and how they influence health policy. Students study legal principles governing profesional nursing practice and explore frameworks to support ethical decision-making across the continuum of care. The nurse''s role in healthcare policy  development, implementation and analysis are explored, particularly as it relates to legal and ethical issues affecting practice. Students explore current legal/ethical issues and existing health policies, with an emphasis on how these issues impact access to, and delivery of healthcare services to vulnerable populations.  ',3),
    (857,N'NURS',N'B499',N'Special Topics in Professional Nursing Practice',N'UG',N'(Prerequisite: NURS B326 or B301 or consent of instructor) This course examines advanced concepts, emerging trends and issues, and evidenced-based practice changes in professional nursing practice. Variable hours between 1-3 credits, depending upon special topic. Topics may include complementary and alternative health practices, end-of-life and palliative care, working with special populations, and nursing theories.  ',3),
    (858,N'PEDU',N'B101',N'RAD Self-Defense for Women',N'UG',N'An introduction to the principles, techniques, and active practice of self-defense for women.',1),
    (859,N'PEDU',N'B104',N'Personal Fitness and Weight Control',N'UG',N'Assessment of major fitness components and development of a personalized exercise program based on fundamental principles of exercise prescription.  Weight management and dietary guidelines will be addressed.',1),
    (860,N'PEDU',N'B105',N'Weight Training',N'UG',N'An introduction to progressive resistance training and participation in a personalized strength training program with emphasis on proper technique and safety principles.',1),
    (861,N'PEDU',N'B106',N'Weight Training II',N'UG',N'This course expands on skills learned in PEDU B105 (Weight Training I) and is designed to further students? knowledge of weight training principles and techniques. Students create a personalized weight-training program designed to build muscular strength, endurance and power. Instruction includes musculoskeletal anatomy and weight training strategies.',1),
    (862,N'PEDU',N'B107',N'Aerobic Fitness',N'UG',N'Participate in aerobic fitness activities designed to improve cardiovascular endurance.  Includes aerobic fitness assessment along with individualized and group aerobic fitness training.',1),
    (863,N'PEDU',N'B112',N'Basketball',N'UG',N'Fundamental skills of game performance. Strategy, rules, and basic offenses and defenses.',1),
    (864,N'PEDU',N'B113',N'Bowling',N'UG',N'An Introduction to the fundamentals of bowling, with an emphasis on basic techniques in all facets of the game, as well as an understanding of terminology.',1),
    (865,N'PEDU',N'B114',N'Golf',N'UG',N'Basic strokes, rules and strategy of golf.',1),
    (866,N'PEDU',N'B117',N'Karate',N'UG',N'Karate',1),
    (867,N'PEDU',N'B119',N'Soccer',N'UG',N'Fundamental skills for game performance; history, rules, and game strategy.',1),
    (868,N'PEDU',N'B121',N'NULL',N'UG',N'Introduction to the game of tennis.  All aspects of the game for new players including technical, tactical, physical and mental skills will be developed.  The emphasis will be on helping students serve, rally and score and to build their knowledge and skill base.',1),
    (869,N'PEDU',N'B130',N'Intermediate Golf',N'UG',N'(Prereq: PEDU 114 or consent of instructor) Intermediate strokes and strategies; heavier emphasis on the total golf swing.',3),
    (870,N'PEDU',N'B136',N'Yoga I',N'UG',N'Explore the mind-body connection through participation in yoga poses, transitional movements, and progressive relaxation techniques. Build strength, flexibility, muscle tone, and mindfulness while improving one''s sense of well-being.',1),
    (871,N'PEDU',N'B137',N'Yoga II',N'UG',N'This course is a continuation of the Yoga I, focusing on the understanding and practice of intermediate to advanced yoga asanas (postures), pranayama (breathing) and meditation technique, including an introduction to the chakras.',1),
    (872,N'PEDU',N'B142',N'Lifeguard Training',N'UG',N'Students will develop proficiency in water safety skills. Successful completion of all course requirement leads to certification in American Red Cross Lifeguard Training, CPR, First Aid, and AED.',3),
    (873,N'PEDU',N'B147',N'Kayaking',N'UG',N'(Prerequisite: successful completion of deep water swim exam) Supervised calm water single kayak paddling.  Emphasis on safety, equipment selection, basic paddle and kayak-handling techniques, fitness considerations, travel safety, rescue and survival techniques.',1),
    (874,N'PEDU',N'B148',N'Stand Up Paddle Boarding',N'UG',N'A supervised calm water stand up paddling experience.  Emphasis on safety, equipment selection, paddle and board-handling techniques, fitness, travel safety, rescue and survival techniques.   ',1),
    (875,N'PEDU',N'B153',N'Heartsaver CPR/First Aid/AED',N'UG',N'The study and practice of early emergency care procedures, including first aid; choking relief in adults, children, and infants; and what to do for sudden cardiac arrest in adults, children, and infants.',1),
    (876,N'PEDU',N'B171',N'Line Dancing',N'UG',N'An enjoyable non-partner dance activity that exposes students to a variety of popular line dances, musical genres, line dance etiquette, and developmental history. Dance experience not necessary.',3),
    (877,N'PEDU',N'B181',N'Equestrian',N'UG',N'English hunter-style riding for intermediate students.',3),
    (878,N'PEDU',N'B189',N'Indoor Cycling',N'UG',N'An introduction to the basic findamentals of indoor cycling.',1),
    (879,N'PEDU',N'B202',N'Foundations of Coaching',N'UG',N'Explore coaching philosophies, coaching techniques, training fundamentals, risk management and group management strategies.  Emphasis placed on coaching skills necessary for working with children.  Includes practical experience and evaluation of coaching situations.',2),
    (880,N'PHIL',N'B102',N'Introduction to Philosophy',N'UG',N'PHIL B102 - INTRODUCTION TO PHILOSOPHY (3). An introduction to the main problems of philosophy and its methods of inquiry, analysis and criticism. Works of important philosophers will be read.',3),
    (881,N'PHIL',N'B110',N'Introduction to Formal Logic: Deduction & Inference',N'UG',N'This course is an introduction to deductive reasoning. The focus will be on the use of formal methods to construct and criticize actual arguments. Particular emphasis will be placed upon Aristotelian logic, sentential logic, and predicate logic. Student will develop skills in the development and analysis of syllogisms, Venn Diagrams, truth tables, and formal proofs.',3),
    (882,N'PHIL',N'B111',N'Introduction to Informal Logic: Reasoning & Analysis',N'UG',N'This course is an introduction to inductive reasoning. The focus will be on argumentation and argument analysis. Students will develop skills for: identifying argumentative language; determining the type of argument present; constructing argument maps; evaluating arguments in term of inductive standards; and identifying various informal fallacies.',3),
    (883,N'PHIL',N'B201',N'History of Ancient Philosophy',N'UG',N'An introduction to the development of philosophy in the ancient world through study of the works of representative philosophers. BPHI 202 may be taken prior to this course.',3),
    (884,N'PHIL',N'B202',N'NULL',N'UG',N'An introduction to the development of philosophic thought since the Renaissance through the study of the works of important philosophers. The chief emphasis is on the 17th and 18th centuries.',3),
    (885,N'PHIL',N'B211',N'Contemporary Moral Issues',N'UG',N'Moral issues confronting men and women in contemporary society. Topics will vary but may include discussion of problems related to abortion, drugs, euthanasia, war, social engineering and punishment of criminals.',3),
    (886,N'PHIL',N'B212',N'Conflicting Images of Man',N'UG',N'Conflicting images of man in contemporary philosophy, literature, psychology and religion and an evaluation of these images as norms for human conduct and social policy. Particular attention will be given to existentialist, Marxist, behaviorist and mystical images of man.',3),
    (887,N'PHIL',N'B301',N'Nineteenth and 20th Century Philosophy',N'UG',N'An introduction to Continental and British philosophy since Kant through study of the works of representative philosophers. Particular emphasis is placed on the development of Idealism, Marxism, Existentialism and Phenomenology and analytic philosophy.',3),
    (888,N'PHIL',N'B302',N'American Philosophy',N'UG',N'The principal movements of philosophical thought from Colonial times to the present, with special emphasis on the 19th and 20th centuries.',3),
    (889,N'PHIL',N'B303',N'Critical Social Theories',N'UG',N'This course is an introduction to the critical social theories that have developed since the late 19th century. Critical social thought in philosophy focuses on various socio-historical conditions in contemporary society, as well as on the sociocultural methods that are used to study them. Possible frameworks may include Marxism, Neo-Marxism, feminist philosophies, queer theory, critical race theory, and post-analytic philosophy. Social and cultural topics may include race, gender, global economic dynamics, Internet culture, and social media. ',3),
    (890,N'PHIL',N'B304',N'History of Analytic Philosophy',N'UG',N'This course is an introduction to analytic philosophy in the British and American philosophical traditions, emphasizing epistemology and the philosophy of language. Particular attention will be given to developments arising out of logical positivism and ordinary language philosophy.  ',3),
    (891,N'PHIL',N'B311',N'Ethics',N'UG',N'A study of the moral principles of conduct and the basic concepts underlying these principles, such as good, evil, right, wrong, justice, value, duty and obligation. The ethical works of influential philosophers are analyzed in terms of these concepts.',3),
    (892,N'PHIL',N'B312',N'Bioethics',N'UG',N'The concepts of Person and Justice as they relate to biomedical sciences and technologies.',3),
    (893,N'PHIL',N'B313',N'Philosophy of Art',N'UG',N'Philosophical problems relating to the arts, with emphasis on questions pertaining to aesthetic experience.',3),
    (894,N'PHIL',N'B315',N'Philosophy of Technology',N'UG',N'This course will focus on the various philosophical questions and issues that arise from the technological opportunities and challenges of the 21st century. Philosophical topics surrounding technology will include those related to ethics, the philosophy of language, feminism, critical theory, and pragmatism. Possible topics regarding technology may include information technologies, robotics, AI, genetic engineering, cyborgs, climate change/geoengineering/the Anthropocene, and social media technologies. Finally, we investigate how technological developments stimulate philosophical thinking. ',3),
    (895,N'PHIL',N'B320',N'Existentialism',N'UG',N'An introduction to existentialist themes in contemporary philosophy, literature, psychology and religion. The writings of existentialists such as Kierkegaard, Nietzsche, Camus, Sartre, Buber, May and Binswanger will be read and discussed.',3),
    (896,N'PHIL',N'B341',N'Environmental Ethics',N'UG',N'Examination of principles and arguments surrounding moral issues involving the environment.',3),
    (897,N'PHIL',N'B363',N'Philosophy of Film',N'UG',N'{?LBST B363}  (Prerequisite: ENGL B101/B105 and ENGL B102/B106)  Interdisciplinary course with emphasis on topical study of film theory, the aesthetics of film as an art form, the social impact and relevance of film.  ',3),
    (898,N'PHIL',N'B397',N'Readings in Philosophy',N'UG',N'A systematic study of a primary source in philosophy having relevance to other disciplines.  Can be conducted as a small course or as a tutorial.  May be taken twice for credit.  (Prereq: junior standing and completion of General Education English and Humanities requirements.)',3),
    (899,N'PHIL',N'B398',N'Topics in Philosophy',N'UG',N'(Prerequisite:  Specific prerequisites may vary; consult the instructor.) Intensive study of selected themes, topics, currents of thoughts or interdisciplinary concerns. May be repeated for credit under a different topic.',3),
    (900,N'PHIL',N'B399',N'Independent Study in Philosophy',N'UG',N'Contract approval by instructor, advisor, Department Chair and Vice Chancellor for Academic Affairs is required.',3),
    (901,N'PHYS',N'B101',N'The Physics of How Things Work I',N'UG',N'A practical introduction to physics and science in everyday life? from concrete examples to basic physical principles.',3),
    (902,N'PHYS',N'B101L',N'The Physics of How Things Work I Laboratory',N'UG',N'(Prereq or Coreq: PHYS B101) Experiments, exercises and demonstrations to accompany PHYS B101.',1),
    (903,N'PHYS',N'B102',N'The Physics of How Things Work',N'UG',N'(Prereq: PHYS B101) A continuation of PHYS B101 with emphasis on electricity, magnetism, optics and atomic physics.',3),
    (904,N'PHYS',N'B102L',N'The Physics of How Things Work II Laboratory',N'UG',N'(Prereq or Coreq: PHYS B102) Experiments, exercises and demonstrations to accompany PHYS B102.',3),
    (905,N'PHYS',N'B201',N'General Physics I',N'UG',N'(Prereq: MATH B115, or MATH B122, or equivalent) First part of an introductory course sequence. Topics include mechanics, wave motion, sound and heat. No previous background in physics is assumed.',3),
    (906,N'PHYS',N'B201L',N'General Physics I Laboratory',N'UG',N'(Prereq or Coreq: PHYS B201 or B211)',1),
    (907,N'PHYS',N'B202',N'General Physics II',N'UG',N'(Prereq: a grade of C or better in BPHY 201) Continuation of BPHY 201; includes electromagnetism, relativity, quantum physics, atomic and nuclear physics.',3),
    (908,N'PHYS',N'B202L',N'General Physics II Laboratory',N'UG',N'(Prereq or Coreq: PHYS B202).',1),
    (909,N'PHYS',N'B211',N'Essentials of Physics',N'UG',N'(Prerequisite: a grade of C or better in MATH B141; Co-requisite: PHYS B211L) Classical mechanics and wave motion. Calculus-level course for students of science and engineering.',3),
    (910,N'PHYS',N'B211L',N'Essentials of Physics I Laboratory',N'UG',N'(Prereq or Coreq: PHYS B211)',1),
    (911,N'PHYS',N'B212',N'Essentials of Physics II',N'UG',N'(Prereq: a grade of C or better in PHYS B211 and MATH B142; Coreq: PHYS B212L) Classical electromagnetism and optics.',3),
    (912,N'PHYS',N'B212L',N'Essentials of Physics II Laboratory',N'UG',N'(Prereq or Coreq: PHYS B212)',1),
    (913,N'PHYS',N'B398',N'Advanced Topics and Physics',N'UG',N'Study of a topic not otherwise available to student.  May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor.  Repeatable to a maximum of 8 credit hours.',3),
    (914,N'POLI',N'B105',N'Introduction to Politics',N'UG',N'Concepts and problems involved in human relationship with governments, the nation-state and political change.',3),
    (915,N'POLI',N'B111',N'Contoversies in American Politics',N'UG',N'An introduction to the analysis of key issues in contemporary American politics focusing on the arguments, the groups involved and the political factors that influence the outcome of the debate.',3),
    (916,N'POLI',N'B201',N'American National Government',N'UG',N'The formation and development of the national government, its organization and powers.',3),
    (917,N'POLI',N'B315',N'Internatioanl Relations',N'UG',N'International political behavior and institutions.',3),
    (918,N'POLI',N'B370',N'Introduction to Public Administration',N'UG',N'A study of the basic principles and theory of administrative structure, responsibility and control in relation to policy making in the modern state.',3),
    (919,N'POLI',N'B399A',N'Independent Study in Political Science',N'UG',N'Contract approval by instructor, advisor, Department Chair and Executive Vice Chancellor for Academic Affairs is required.',3),
    (920,N'POLI',N'B399B',N'Independent Study in International Studies',N'UG',N'Contract approval by instructor, advisor, Department Chair and Executive Vice Chancellor for Academic Affairs is required.',3),
    (921,N'POLI',N'B400',N'Selected Topics in Political Theory',N'UG',N'Intensive analysis of a particular topic or topics. To be identified by suffix and title each semester.',3),
    (922,N'PSYC',N'B101',N'Introduction to Psychology',N'UG',N'An introduction to and survey of the basic concepts and findings within the field of psychology.',3),
    (923,N'PSYC',N'B200',N'Research Methods in Psychology',N'UG',N'Basic principles and methodology.',3),
    (924,N'PSYC',N'B201',N'Statistics Laboratory in Psychology',N'UG',N'Psychological experiments which illustrate important concepts of elementary statistics. Two laboratory hours per week.',1),
    (925,N'PSYC',N'B202',N'Psychological Statistics',N'UG',N'Introduction to statistical methods essential for psychological research.',3),
    (926,N'PSYC',N'B203',N'Laboratory in Psychology',N'UG',N'(Prereq: PSYC B200 and STAT B201 and PSYC B201 or PSYC B200 and PSYC B227) Laboratory in psychology in which research methods and statistical methods are integrated. One lecture and one laboratory session per week.',3),
    (927,N'PSYC',N'B209',N'Human Growth and Development',N'UG',N'An introduction to and survey of physical, mental, social, and emotional developmental patterns evidenced from the prenatal period through senescence and death.',3),
    (928,N'PSYC',N'B210',N'Psychology of Adjustment',N'UG',N'Introduction to theories and processes underlying and facilitating human adjustment in the community, family and workplace.',3),
    (929,N'PSYC',N'B212',N'Applied Psychology',N'UG',N'Uses of psychological knowledge and techniques in practical contexts; clinical, school, industrial, consumer and environmental psychology.',3),
    (930,N'PSYC',N'B214',N'Human Sexual Behavior',N'UG',N'Psychological, physiological and sociological factors of human sexual behavior and attitudes.',3),
    (931,N'PSYC',N'B216',N'Psychology of Marriage',N'UG',N'The psychological, physiological and social characteristics of marriage.',3),
    (932,N'PSYC',N'B218',N'Psychology of Women',N'UG',N'Women''s experiences: childhood and adolescence, work, family, cultural images, adjustment and social change.',3),
    (933,N'PSYC',N'B220',N'Psychology of Religion',N'UG',N'The development of the religious consciousness and its various expressions, the psychological dynamics of growth and conversion, response to crisis and the relation of spiritual practice to health and wholeness.',3),
    (934,N'PSYC',N'B224',N'Industrial/Organizational Psychology',N'UG',N'Psychological techniques applied to various industrial and organizational problem areas, such as management and supervision, morale, efficiency, training, personnel selection and placement and relations among personnel.',3),
    (935,N'PSYC',N'B229',N'Sport Psychology',N'UG',N'The role of sports in socialization, personality development and competence, including: spectator-performer interactions, motivation, competition effects; and the application of psychological techniques to performance enhancement.',3),
    (936,N'PSYC',N'B302',N'Learning and Memory',N'UG',N'(Prereq: PSYC B101) Research and applications concerning the acquisition of new behavior and knowledge, including accounts based on classical and instrumental conditioning and on information-processing models.',3),
    (937,N'PSYC',N'B303',N'Principles of Gerontology',N'UG',N'(?HMSV B303 & SOCY B303) An exploration of the interdisciplinary field of gerontology, including the fundamental concepts, theories, and issues involved in the study of aging from diverse perspectives.',3),
    (938,N'PSYC',N'B311',N'Abnormal Psychology',N'UG',N'(Prereq: PSYC B101) Covers the classification, diagnosis, etiological theories and treatments of the major mental and emotional disorders.',3),
    (939,N'PSYC',N'B312',N'Abnormal Behavior in Children',N'UG',N'(Prereq: PSYC B311 or consent of nstructor) Theories, description and assessment of child behavior problems and disorders; methods of intervention.',3),
    (940,N'PSYC',N'B321',N'Life Span Developmental Psychology',N'UG',N'(Prereq: PSYC B101) Psychological development from conception to late adulthood. Topics include physical, cognitive and social processes associated with development at each stage of the life cycle.',3),
    (941,N'PSYC',N'B322',N'Psychology of Child Development',N'UG',N'(Prereq: PSYC B101) Examination of development from conception through older childhood. Specific cognitive and social processes will be given in-depth study.',3),
    (942,N'PSYC',N'B324',N'Psycholgoy of Adolescence',N'UG',N'(Prereq: PSYC B101) Theories and research examining social, emotional and intellectual development in adolescence. Explores influence of family, peer, school and cultural contexts.',3),
    (943,N'PSYC',N'B326',N'Psychology of Early and Middle Adulthood',N'UG',N'(Prereq: PSYC B101) Developmental changes in abilities, personality and behavior which occur between adolescence and old age.',3),
    (944,N'PSYC',N'B328',N'Psychology of Aging',N'UG',N'(Prereq: PSYC B101) Psychological, social and biological phenomena associated with maturity and aging.',3),
    (945,N'PSYC',N'B331',N'Social Psychology',N'UG',N'(Prereq: PSYC B101) Introduction to theory and research in social psychology from a psychological viewpoint. Topics include social perception, social cognition, attitudes, interpersonal relationships, aggression, prosocial behavior and group processes.',3),
    (946,N'PSYC',N'B341',N'Personality Theory',N'UG',N'(Prereq: PSYC B101) Covers the major theories and research on personality and the dynamics of human motivation.',3),
    (947,N'PSYC',N'B361',N'Biological Psychology',N'UG',N'(Prereq: PSYC B101) The neurochemical and neuroanatomical bases of behavior ranging from the reflex to schizophrenia.',3),
    (948,N'PSYC',N'B380',N'Cultural Psychology',N'UG',N'(Prerequisite: PSYC B101) A global cultural perspective on human behavior exploring how culture influences our lives and the lives of others across the world. Topics may include cultural influences on development, mental health, cognition, personality and social behavior.  ',3),
    (949,N'PSYC',N'B399',N'Independent Study in Psychology',N'UG',N'(Prereq: PSYC B101 and consent of instructor) Closely supervised project or research experience in psychology. Contract approval by instructor, advisor, Department Chair and Vice Chancellor for Academic Affairs is required. May be repeated for up to six credit hours. Not for psychology major credit.',1),
    (950,N'PSYC',N'B401',N'Cognitive Psychology',N'UG',N'(Prereq: PSYC B302) Research and theories on sensory memory, attention, short-term and working memory, human learning and forgetting, imagery, long-term memory, speech perception, reading, language, thinking and problem solving and decision making.',3),
    (951,N'PSYC',N'B404',N'Psychology Consumer Behavior',N'UG',N'(Prerequisite: PSYC B101) Psychological Principles and concepts applied to advertising and selling, promotion, consumer attitudes, psychological measurement and prediction, and influence in consumer behavior.  ',3),
    (952,N'PSYC',N'B406',N'History and Systems of Psychology',N'UG',N'(Prereq: 9 hours in psychology at 300 level or above) Systematic approaches to psychology and the history of psychology',3),
    (953,N'PSYC',N'B409',N'Positive Psychology',N'UG',N'Research and theories on psychological well-being and happiness.  Topics include subjective well-being, positive affect and emotions, flow, resilience, correlates of happiness, self-regulation, virtues and character, interpersonal relationships, and mindfulness.',3),
    (954,N'PSYC',N'B411',N'Introduction to Clinical Psychology',N'UG',N'(Prereq: PSYC B311 and B341 or consent of instructor) An introduction to the science and practice of clinical psychology. Application of psychological principles to the assessment and treatment of mental disorders and behavioral problems in human beings.',3),
    (955,N'PSYC',N'B415',N'Community Psychology',N'UG',N'Application of knowledge from other areas of psychology to the study of the role of the individual in the community.',3),
    (956,N'PSYC',N'B418',N'Psychology of Drug Use and Effects',N'UG',N'(Prereq: consent of instructor) Research and theoretical considerations of substance abuse. Pharmacological, sociological, psychological, medical, economic, forensic and other relevant research and treatment disciplines.',3),
    (957,N'PSYC',N'B425',N'Psychology and the Legal System',N'UG',N'The role of psychologists in the legal system, psychological issues within the legal system, interpretations of victims and criminality, and treatment of offenders.',3),
    (958,N'PSYC',N'B441',N'Psychological Tests and Measurement',N'UG',N'(Prereq: STAT B201 and PSYC B201 or consent of instructor) Overview of the nature, design and application of psychological tests. Emphasis on test construction, the psychometric properties of psychological tests, intelligence and aptitude testing, objective and projective tests of personality and general issues in the application of tests.',3),
    (959,N'PSYC',N'B451',N'Sensation and Perception',N'UG',N'(Prereq: PSYC B101) Processing of information from the environment. Physiological, physical, psychological and contextual determinants of perception.',3),
    (960,N'PSYC',N'B465',N'Health Psychology',N'UG',N'An introduction to the interdisciplinary subfield of psychology dedicated to promoting and maintaining health and preventing and treating illness.',3),
    (961,N'PSYC',N'B490',N'Selected Topics in Psychology',N'UG',N'Course content varies and will be announced in the schedule of classes by suffix and title.',3),
    (962,N'PSYC',N'B494',N'Advanced Research Methods in Psychology',N'UG',N'(Prerequisite: PSYC B200 and [PSYC B202 or STAT B201]) This course provides an integration of research methods and statistical methods. Students will design and complete a psychology research project.  ',3),
    (963,N'PSYC',N'B495',N'Internship in Psychology',N'UG',N'(Prereq: Psychology Majors only, 15 hours of psychology, consent of instructor) Provides experience in a professional setting to facilitate integration of academic knowledge with real world.  Minimum requirement of 150 service hours.',3),
    (964,N'PSYC',N'B496',N'Internship in Psychology II',N'UG',N'(Prereq: Psychology Majors only, BPSY 495, and consent of instructor) Provides experience in a professional setting to facilitate integration of academic knowledge with real world.  Required service hours: 150 - 300 (depending on credit hours).',3),
    (965,N'PSYC',N'B498',N'Advanced Independent Study',N'UG',N'(Prereq: 9 hours of psychology and consent of instructor) Closely supervised project or research experience in psychology. Approved contract required. May be repeated for up to six credits.',3),
    (966,N'PSYC',N'B499',N'Individual Research',N'UG',N'(Prereq: 15 hours of psychology and consent of instructor) Planning and execution of supervised research in psychology. Approved contract required.',3),
    (967,N'PUBH',N'B101',N'Basic Health',N'UG',N'This course is a basic health course in which students will learn about strategies to improve health. Nutrition, fitness, drugs, and sexuality are some of the topics discussed. Career opportunities within the heath field will be explored.',3),
    (968,N'PUBH',N'B242',N'Nutrition',N'UG',N'{?HRTM B242} Introductory course on human nutrition. Includes principles of normal nutrition, basics of life cycle nutrition, relationship of nutrients to health and disease, and discussion of current issues.  ',3),
    (969,N'PUBH',N'B300',N'Transcultural Health',N'UG',N'(Prerequisite: PSYC B101 or SOCY B101 or consent of instructor) This course surveys the cultural and social dimensions of health and illness with emphasis on the development of cultural competence. Different populations are examined for the development of a personal understanding of the traditions and customs of their societies, providing a uniquie perspective on the implications for patiend care. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding requirement)',3),
    (970,N'PUBH',N'B303',N'Health & Wellness Innovation: Creative Inquiry',N'UG',N'{?NURS B303} (Prerequisite: PUBH B310) The purpose of this course is to introduce and encourage health professional-driven innovation. This course equips students with an empathetic mindset to see healthcare and public health issues from the perspective of the person who is experiencing the challenge. Students will develop new and creative ways to improve health and well-being. ',3),
    (971,N'PUBH',N'B305',N'Spirituality, Health, and Health Professions',N'UG',N'Exploration of spirituality, its effect on health, and health professionals roles in the spritual care of clients.',3),
    (972,N'PUBH',N'B310',N'Introduction to Public Health',N'UG',N'A broad-based overview of those processes that enable people to assume responsibility for health and wellness and the role of the health promotion professional.',3),
    (973,N'PUBH',N'B315',N'Health Promotion Across the Lifespan',N'UG',N'(Prerequisite: PSYC B209 or PSYC B321) The study of age as a determinant of health and disease outcomes across the lifespan with strategies to promote wellness.',3),
    (974,N'PUBH',N'B320',N'Chronic Disease and Risk Reduction',N'UG',N'(Prerequisite: BIOL B243 and BIOL B244, or equivalent coursework) The study of those diseases of long duration and slow progression and the means by which their societal burden can be reduced.',3),
    (975,N'PUBH',N'B321',N'Fundamentals of Occupational Health & Safety',N'UG',N'(Prerequisite:PUBH B310)An?introductory?course?covering?major?issues?in?occupational?health?and?safety,?with?an?emphasis?on?the?identification,?evaluation?and?control?of?physical,?chemical,?biological?and?behavioral?factors?often?present?in?the?workplace?and?pose?a?risk?for?illness,?injury?and?death.??As?people?typically?work?at?least?40?hours?per?week?for?most?of?their?adult?lives,?the?workplace?has?the???potential?to?significantly?impact?human?health?and?wellbeing. ',3),
    (976,N'PUBH',N'B322',N'Life-Cycle Nutrition',N'UG',N'(Prerequisite: HRTM/PUBH B242) This course examines the essentials of human nutrition and the modification of nutritional needs at different life stages, including pregnancy, lactation, infancy, childhood, adolescence, adulthood, and older adulthood. ',3),
    (977,N'PUBH',N'B323',N'Introduction to Exercise and Sports Science',N'UG',N'(Prerequisite: BIOL B243 and BIOL B244) This course is designed to examine the disciplines in the broad field of exercise science. An overview of the knowledge and skills needed to become a certified personal trainer (CPT) will be provided.',3),
    (978,N'PUBH',N'B325',N'Sports Nutrition',N'UG',N'{?HRTM B320} (Prerequisite: PUBH/HRTM B242) The study of the association between nutrition and exercise performance. Metabolism of carbohydrates, fats, proteins, vitamins, minerals and water and its effect on athletic training is emphasized. Nutrition assessment of athletes, how to measure body composition, and the use of and controversy over ergogenic aids are explored.  ',3),
    (979,N'PUBH',N'B328',N'Nutrition and Chronic Disease',N'UG',N'(Prerequisite: HRTM/PUBH B242) Explore the relationship of food, diet and lifestyle choices to the prevention and management of various chronic diseases. Main topic areas include type 2 diabetes, cardiovascular disease, digestive health, obesity and cancer.  ',3),
    (980,N'PUBH',N'B330',N'Principles of Epidemiology',N'UG',N'Prerequisite: PUBH B310) The study of the patterns, causes, and effects of health and disease.',3),
    (981,N'PUBH',N'B340',N'Introduction to Environmental Health',N'UG',N'(Prerequisite: PUBH B310) The study of environmental factors, be they physical, chemical, biological or behavioral, that have the potential to adversely impact human and/or ecological health.',3),
    (982,N'PUBH',N'B350',N'Health Communication',N'UG',N'Examines the strategies of health communication in interpersonal, group, organizational, societal-cultural, political-economic, and historical contexts. (Cross-List with COMM B350) ',3),
    (983,N'PUBH',N'B360',N'Health Behavior and Education',N'UG',N'Prerequisite: PUBH B310) The study of behavioral and social factors that influence health and disease. Models of health behavior theory will be presented. Methods for preparation of health education curricula will be discussed.',3),
    (984,N'PUBH',N'B370',N'Wellness in Health Promotion',N'UG',N'(Prerequisite: BIOL B243 and BIOL B244, or equivalent coursework; and HRTM B242) The study of the roles of nutrition, exercise, hygiene and rest in the preventaion of disease and the achievement of optimal health.',3),
    (985,N'PUBH',N'B380',N'Research Methods in Public Health',N'UG',N'(Prerequisite: STAT B201 and PUBH B310) A course designed to impart knowledge and skills regarding the design, implementation, analysis and interpretation of research in the field of health promotion.',3),
    (986,N'PUBH',N'B390',N'Field Experience in Public Health',N'UG',N'(Prerequisite: {UBH B310 and Junior Status) A period of introductory work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where health promotion principles are applied.',3),
    (987,N'PUBH',N'B395',N'Global Healthcare Study Abroad',N'UG',N'(Prerequisite: Permission of the instructor) Provides students with the opportunity to engage in global healthcare fieldwork in an international service learning setting. Faculty collaborate with international partners to develop customized global healthcare immersion experiences.',3),
    (988,N'PUBH',N'B399',N'Independent Study in Public Health',N'UG',N'(Prerequisite: PUBH B310 or consent of instructor) This course examines concepts, emerging trends, issues, and evidence-based practice changes in public health practice. Variable hours between 1 to 4 credits, depending on topic which may include complementary and alternative health practices, working with special populations, emerging public health needs, etc. Students may re-take one additional time for a maximum of 8 credits.  ',1),
    (989,N'PUBH',N'B401',N'Health Care Delivery Systems',N'UG',N'(Prerequisite: PUBH B310 or NURS B326 or RN Licensure or ceonsent of instructor) Systems theory, health care delivery systems conceptualize transitions from one level of care to another, with emphasis on ethical and legal issues; technology, historical, political, economic aspects to meet the health care needs of the population.',3),
    (990,N'PUBH',N'B410',N'Examining Health Inequalities',N'UG',N'(Prerequisite: PUBH B310) This course is designed to examine health disparities and associated social determinants of health in the U.S. Also included is an exploration of multi-level intervention strategies for reducing health disparities.',3),
    (991,N'PUBH',N'B420',N'Leadership and Management in Public Health',N'UG',N'(Prerequisite: PUBH B310) This course is designated to enhance leadership and management skills needed to design, implement and evaluate health promotion programs.',3),
    (992,N'PUBH',N'B423',N'Business & Practice of Personal Training',N'UG',N'(Prerequisite: Grade of B or better in PUBH B323) The continuation of PUBH B323, this practical course surveys the skills and knowledge required for success in the field of personal training. Following National Academy of Sports Medicine guidelines, the kinesiology and physiology of human performance and the effective development of a personal training enterprise are investigated. ',3),
    (993,N'PUBH',N'B431',N'Nutrition and Metabolism',N'UG',N'(Prerequisite: PUBH/HRTM B242, BIOL B110, and a 3-4 credit hour CHEM course) Examines the physiology and metabolism of micro and macro nutrients, and how principles of nutrition impact metabolic regulation. ',3),
    (994,N'PUBH',N'B432',N'Public Health Nutrition',N'UG',N'(Prerequisite: PUBH/HRTM B242) Impact of nutrition policy on the public?s health is reviewed.  This course examines the complex, multifaceted range of programs and services dedicated to bettering the population?s health through nutrition. Considers policymaking, assessment and intervention methods, special populations and food security. ',3),
    (995,N'PUBH',N'B450',N'Public Health Program Development',N'UG',N'(Prerequisite: PUBH B310) A study of methods used to develop effective health promotion and education programs which help enable individuals prevent, delay and treat disease.',3),
    (996,N'PUBH',N'B460',N'Public Health Program Evaluation',N'UG',N'(Prerequisite: PUBH B450) A study of evaluation methods used to assess the potential impacts of health promotion programs.',3),
    (997,N'PUBH',N'B461',N'Writing in the Health Professions',N'UG',N'(Prerequisite: PUBH B310) Preparation for and practice in types of writing important to those working within the health care and health promotion industry, from brief letters to formal articles and reports.',3),
    (998,N'PUBH',N'B480',N'Internship in Public Health',N'UG',N'(Prerequisite: PUBH B450; Corequisite: PUBH B460) A period of work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where health promotion principles are applied.',4),
    (999,N'PUBH',N'B490',N'Senior Seminar in Public Health',N'UG',N'(Prerequisite: PUBH B310) A capstone course that summarizes the experiences of the health promotion major and prepares students for employment and/or graduate study.',2),
    (1000,N'PUBH',N'B499',N'Special Topics in Public Health',N'UG',N'(Prerequisite: PUBH B310 or consent of instructor) This course examines advanced concepts, emerging trends and issues, and evidence-based practice changes in public health practice. Variable hours between 1 to 4credits, depending on special topic. Topics may include complementary and alternative health practices, working with special populations, emerging public health needs, etc. Students may re-take one additional time for a maximum of 8 credits. ',3);
INSERT [dbo].[Course] ([CourseID],[CourseSubject],[CourseNumber],[CourseName],[Level],[Description],[CreditHours])
VALUES 
    (1001,N'RELG',N'B110',N'Introduction to Religious Studies',N'UG',N'An introduction to the methods of religious inquiry and to the beliefs and practices of major religious traditions.',3),
    (1002,N'RELG',N'B111',N'Biblical History and Literature',N'UG',N'A brief introduction to contemporary study of the Bible, its historical background, writing and transmission, its principal persons, events and ideas and their significance for the present time.',3),
    (1003,N'RELG',N'B114',N'Religion and Culture',N'UG',N'The impact of religion on modern Western culture and of culture on religion. Selected topics: Holocaust, Freud, love, evil, puritanism, fundamentalism.',3),
    (1004,N'RELG',N'B203',N'Comparative Religion',N'UG',N'The religious experience of varied persons and groups, East and West, in traditional and contemporary settings.  ',3),
    (1005,N'RELG',N'B360',N'Anthropology of Magic and Religion',N'UG',N'{=BANT 352}  A comparative examination of such topics as ritual, cosmology, revitalization movements, magic, witchcraft, myth and possession.',3),
    (1006,N'RELG',N'B499',N'Special Topics in Religious Studies',N'UG',N'Reading and research on selected topics in Religious Studies. ',3),
    (1007,N'SOCY',N'B101',N'Introductory Sociology',N'UG',N'An introduction to sociological facts and principles: an analysis of group-making processes and products.',3),
    (1008,N'SOCY',N'B220',N'Elementary Statistics for Sociologist',N'UG',N'An introduction to concepts and application of quantitative methods, including descriptive and inferential statistics. Emphasis on analysis of empirical sociological data.',3),
    (1009,N'SOCY',N'B300',N'Social Structures',N'UG',N'(Prereq: STAT B201) Selected theoretical orientations, methodological procedures and illustrative substantive data pertaining to social structures.',3),
    (1010,N'SOCY',N'B301',N'Introduction to Gender Studies',N'UG',N'Theories, methods and substantive issues in the study of gender and sexuality, grounded in the social sciences and humanities, using an interdisciplinary approach.  Prerequisite: Introduction to Sociology or Psychology or permission of instructor.',3),
    (1011,N'SOCY',N'B303',N'Principles of Gerontology',N'UG',N'(?HMSV B303 & PSYC B303) An exploration of the interdisciplinary field of gerontology, including the fundamental concepts, theories, and issues involved in the study of aging from diverse perspectives.',3),
    (1012,N'SOCY',N'B305',N'Sociology of Family',N'UG',N'Sociological perspectives related to various aspects of family behaviors, roles and values.',3),
    (1013,N'SOCY',N'B307',N'Sociology of Religion',N'UG',N'Sociological perspectives related to selected aspects of religious behavior. Includes references to non-Western religions.',3),
    (1014,N'SOCY',N'B308',N'Community Organization',N'UG',N'An analysis of formal and informal organization, the interrelationships among public and private agencies and means through which community action programs are initiated, coordinated and maintained.',3),
    (1015,N'SOCY',N'B309',N'Introduction to Social Inequality',N'UG',N'This course applies a sociological framework to understand social stratification and inequality. Students will learn major sociology paradigms or meta-theories of the relationship of society to the individual and will apply them in the empirical analysis of social inequality.',3),
    (1016,N'SOCY',N'B310',N'Social Demography',N'UG',N'(Prereq: SOCY B220 or equivalent course in quantitative methods) Selected theoretical orientations, methodological procedures and illustrative substantive data pertaining to population.',3),
    (1017,N'SOCY',N'B311',N'Ecology of Human Social Systems',N'UG',N'Relationships among and changes in populations, social organization, technology and the environment.',3),
    (1018,N'SOCY',N'B313',N'Sociology of Aging',N'UG',N'Analysis of aging as a process of socialization and the status of older people in society, their roles in the community, demographic aspects of aging and the impact of aging upon social institutions.',3),
    (1019,N'SOCY',N'B314',N'Applied Sociology',N'UG',N'(Prerequisite: SOCY B101 or consent of instructor) Introduces students to the uses of sociological concepts, skills and tools to actively analyze and engage problems facing a variety of clients and organizations including business, government, religion and other community agencies and groups. Emphasizes case studies and hands-on experience to identify, investigate and actively seek solutions to issues of structure, process and social change.',3),
    (1020,N'SOCY',N'B315',N'World Population: Problems and Policies',N'UG',N'World population growth and concomitant socioeconomic problems. Effectiveness of governmental policies concerned with population growth. Topics include over-population.',3),
    (1021,N'SOCY',N'B320',N'Individual and Society',N'UG',N'(Prereq: SOCY B220 or equivalent course in quantitative methods) Selected theoretical orientations, methodological procedures and illustrative substantive data pertaining to the relations between the individual and society.',3),
    (1022,N'SOCY',N'B323',N'Sociology of Deviant Behavior',N'UG',N'Theories, methodology and substantive issues in the study of social deviance.',3),
    (1023,N'SOCY',N'B325',N'Sociology of Childhood',N'UG',N'A consideration of the child in the family group, play group, school group and community.',3),
    (1024,N'SOCY',N'B326',N'Sociology of Adolescence',N'UG',N'Sociological perspectives and research findings related to adolescence.',3),
    (1025,N'SOCY',N'B340',N'Introduction to Social Problems',N'UG',N'Normative dissensus and behavioral deviance in society and their consequences for social change and social order. Problems may include: mental disorders, juvenile delinquency, crime, drug abuse, alcoholism, suicide, sexual pathology, race and ethnic relations, world population crises and work problems.',3),
    (1026,N'SOCY',N'B341',N'Sociology of Death and Dying',N'UG',N'The social and psychological processes of dying; community reactions to death; social institutions for resolving death problems.',3),
    (1027,N'SOCY',N'B349',N'Sociology of Food',N'UG',N'Exploration of the sociological issues surrounding food and the impact food makes on our personal and public lives. ',3),
    (1028,N'SOCY',N'B350',N'Sociology of Delinquent Youth Behavior',N'UG',N'Social factors in the development, identification and treatment of delinquents.',3),
    (1029,N'SOCY',N'B351',N'Urban Sociology',N'UG',N'Analysis of urban trends, characteristics and functions of cities with reference to the social psychological factors in urban living. Attention is directed to the emergence of urbanism in the United States, with particular reference to the Southern region and to institutions, problems and city planning.',3),
    (1030,N'SOCY',N'B352',N'Sociology of Literature',N'UG',N'(Prereq: SOCY B101) Social factors in the production and reception of literature. Theories, methods and substantive issues in a sociological approach to literature.',3),
    (1031,N'SOCY',N'B353',N'Sociology of Crime',N'UG',N'Social factors in the development, identification and treatment of criminals.',3),
    (1032,N'SOCY',N'B354',N'Collective Behavior',N'UG',N'An analysis of crowds, publics, social movements and the mass society in terms of their institutional and social psychological consequences.',3),
    (1033,N'SOCY',N'B355',N'Minority Group Relations',N'UG',N'Theories, methods and substantive issues in the study of majority-minority group relations and social processes and cultural orientations associated with racial and ethnic differentiation.',3),
    (1034,N'SOCY',N'B356',N'Sociology of the Body',N'UG',N'Interdisciplinary exploration of the body as a social construction, a site of contested terrain acted on by others and by the self, and a location of struggle, pleasure, loss, politics.',3),
    (1035,N'SOCY',N'B357',N'Sociology of Education',N'UG',N'{=BEFN 357}  Analysis of educational institutions, organizations, processes and their effects in contemporary society.',3),
    (1036,N'SOCY',N'B360',N'Sociology of Medicine and Health',N'UG',N'Social factors in health, illness and medicine in contemporary society.',3),
    (1037,N'SOCY',N'B362',N'Sociology of Disability',N'UG',N'A social perspective is employed to analyze social disability. Several theoretical concepts provide students with the ability to understand social disability from a unique angle.',3),
    (1038,N'SOCY',N'B370',N'Sociology of Sport',N'UG',N'Theories, methods and substantive issues in the study of sport in contemporary societies.',3),
    (1039,N'SOCY',N'B398',N'Topics in Sociology',N'UG',N'Reading and research on selected sociological topics. Course content varies and will be announced in the schedule of classes by suffix and title.   ',3),
    (1040,N'SOCY',N'B399',N'Independent Study in Sociology',N'UG',N'Contract approval by instructor, advisor, Department Chair and Executive Vice Chancellor for Academic Affairs is required.',3),
    (1041,N'SOCY',N'B460',N'Sociology of Mental Health',N'UG',N'Social factors in the development, identification and treatment of mental illness.',3),
    (1042,N'SOCY',N'B495',N'Internship in Sociology',N'UG',N'Provides experience in a professional setting to facilitate integration of academic knowledge with real world experience. Requires at least 150 hours of service, online reflections and a final paper that demonstrates the ability to apply theories, concepts and principles of practice.  Prerequisite: Sociology Majors only, 15 hours of sociology, consent of instructor',3),
    (1043,N'SOCY',N'B496',N'Sociological Theory',N'UG',N'Theoretical perspectives on society and social behavior.',3),
    (1044,N'SOCY',N'B497',N'Sociological Research Methods',N'UG',N'(Prereq: SOCY B220 and consent of instructor) Critical analysis of major methods used in the conduct of social science general problems of research design. Two lecture hours and two laboratory hours per week.',4),
    (1045,N'SOCY',N'B498',N'Research Seminar',N'UG',N'(Prereq: SOCY B496 and B497; Senior standing and consent of instructor) Utilization of theoretical, methodological and substantive knowledge in design and execution of a sociological study.',3),
    (1046,N'SPAN',N'B101',N'Beginning Spanish I',N'UG',N'(Admission restricted to those who have never studied Spanish previously or who have placed by examination). Introduction to grammar and practical vocabulary necessary for fundamental communication skills.',3),
    (1047,N'SPAN',N'B102',N'Beginning Spanish II',N'UG',N'Introduction to grammar and practical vocabulary necessary for fundamental communication skills.',3),
    (1048,N'SPAN',N'B109',N'Beginning Spanish I',N'UG',N'Introduction to grammar and practical vocabulary necessary for fundamental communication skills. Admission to 109 restricted to those who have never studied Spanish previously or who have placed by examination into 109.',3),
    (1049,N'SPAN',N'B110',N'Beginning Spanish II',N'UG',N'(Prereq: BSPA 109 or by placement) Introduction to grammar and practical vocabulary necessary for fundamental communication skills.',3),
    (1050,N'SPAN',N'B122',N'Basic Proficiency in Spanish',N'UG',N'(Prereq: BSPA 110 or by placement)  Practice and further development of essential listening, reading, speaking and writing skills. Admission either by placement examination or successful completion of BSPA 110.',3),
    (1051,N'SPAN',N'B201',N'Reading and Written Expression',N'UG',N'Readings in Spanish; grammar, writing, speaking, listening, and composition at the intermediate level.',3),
    (1052,N'SPAN',N'B202',N'Oral Communication',N'UG',N'Practice in conversation involving authentic materials; vocabulary building at the intermediate level.',3),
    (1053,N'SPAN',N'B209',N'Reading and Written Expression',N'UG',N'(Prereq: SPAN B110 or score on placement exam) Further development of listening, speaking, reading and writing skills. Use of authentic cultural materials.',3),
    (1054,N'SPAN',N'B210',N'Oral Communication',N'UG',N'(Prereq: BSPA 209 or permission of instructor) Continued development of the four skills practiced in BSPA 209.',3),
    (1055,N'SPAN',N'B301',N'Advanced Conversation and Grammar',N'UG',N'(Prerequisite: Grade of ?B? or better in SPAN B202 by Phase II placement exam, or consent of instructor. Department permission required for transfer students.) Advanced practice of speaking and listening in Spanish with an intensive review of Spanish grammar.',3),
    (1056,N'SPAN',N'B302',N'Advanced Composition and Grammar',N'UG',N'(Prerequisite: Grade of ?B? or better in SPAN B202 by Phase II placement exam, or consent of instructor. Department permission required for transfer students.) Advanced practice of reading and writing in Spanish with an intensive review of Spanish grammar.',3),
    (1057,N'SPAN',N'B309',N'Advanced Conversation and Grammar',N'UG',N'(Prerequisite: Grade of ?C? or better in BSPA 210, by Phase II placement exam, or consent of instructor. Department permission required for transfer students.) Advanced practice of speaking and listening in Spanish with an intensive review of Spanish grammar.',3),
    (1058,N'SPAN',N'B310',N'Advanced Composition and Grammar',N'UG',N'(Prereq: Grade of B or better in BSPA 210 by Phase II placement exam, or consent of instructor. Department permission required for transfer students.) Advanced practice of reading and writing in Spanish with an intensive review of Spanish grammar.',3),
    (1059,N'SPAN',N'B312',N'Introduction to Reading Hispanic Literary Text',N'UG',N'(Prerequisite: Placement at 300 level on Phase II placement exam, grade of ?C? or better in BSPA 309, or consent of instructor. Department permission required for transfer students.) Approaches to reading literary texts through carefully selected readings from different genres. Taught in Spanish.  ',3),
    (1060,N'SPAN',N'B316',N'Business Spanish',N'UG',N'(Prerequisite: Placement at 300 level on Phase II placement exam, grade of ?C? or better in BSPA 309, or consent of instructor. Department permission required for transfer students.) Commercial organizations and business in Spanish-speaking countries, business correspondence, terminology and techniques in commercial transactions. Taught in Spanish.',3),
    (1061,N'SPAN',N'B350',N'Spanish Language Study Abroad',N'UG',N'(Prerequisite: Placement at 300 level on Phase II placement exam, grade of ?C? or better in BSPA 210, or consent of instructor. Department permission required for transfer students.) Intensive language practice in native environment with emphasis on oral skills. Instruction by native speakers; community contact and home stay. Prior placement test required.',3),
    (1062,N'SPAN',N'B375',N'Topics in Hispanic Cultures and Literatures',N'UG',N'(Prerequisite: Placement at 300 level on Phase II placement exam, grade of ?C? or better in BSPA 210 or consent of instructor. Department permission required for transfer students.) Course content varies and will be announced in the schedule of classes by suffix and title. May be repeated once for credit. Taught in Spanish.',3),
    (1063,N'SPAN',N'B380',N'Hispanic Film and Culture',N'UG',N'(Prerequisite: Placement at 300 level on Phase II placement exam, grade of ?C? or better in BSPA 309, or consent of instructor. Department permission required for transfer students.) Interpretation of contemporary Hispanic culture through selected Spanish or Spanish-American films. A: Spanish film; B: Spanish-American film. Taught in Spanish. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3),
    (1064,N'SPAN',N'B398',N'Selected Topics in Spanish',N'UG',N'(Prerequisite: Placement at 300 level on Phase II placement exam, grade of ?C? or better in BSPA 210, or consent of instructor. Department permission required for transfer students.) Intensive study of selected topics of the Hispanic world. May be repeated for credit under different suffix. Taught in English.',3),
    (1065,N'SPAN',N'B399',N'Independent Study in Spanish',N'UG',N'SPAN B399 - INDEPENDENT STUDY (3-6). (Prereq: Placement at 300 level on Phase II placement exam, grade of B or better in BSPA 210, or consent of instructor. Department permission required for transfer students.) Contract approval by instructor, advisor, Department Chair and Vice Chancellor for academic affairs is required.',3),
    (1066,N'SPAN',N'B400',N'Spanish Civilization',N'UG',N'(Prerequisite: Placement at 300 level on Phase II placement exam, grade of ?C? or better in BSPA 210, or consent of instructor.) Lectures, readings and visuals on Spanish civilization and its cultural heritage from the Middle Ages to 1700. Taught in Spanish.',3),
    (1067,N'SPAN',N'B401',N'Spanish American Civilization I',N'UG',N'(Prerequisite: Placement at 300 level on Phase II placement exam, grade of ?C? or better in BSPA 210, or consent of instructor.) Lectures, readings and visuals on Spanish American civilization and its cultural heritage from the Pre-Columbian Era to Independence. Taught in Spanish.  ',3),
    (1068,N'SPAN',N'B402',N'Spanish Civilization II',N'UG',N'(Prerequisite: Placement at 300 level on Phase II placement exam, grade of ?C? or better in BSPA 210, or consent of instructor.) Lectures, readings and visuals on Spanish civilization and its cultural heritage from the 18th century to the present day. Taught in Spanish.',3),
    (1069,N'SPAN',N'B403',N'Spanish American Civilization II',N'UG',N'BSPA 403 - SPANISH AMERICAN CIVILIZATION II (3). (Prerequisite: Placement at 300 level on Phase II placement exam, grade of ?C? or better in BSPA 210, or consent of instructor.) Lectures, readings and visuals on Spanish American civilization and its cultural heritage from Independence to the present day. Taught in Spanish.',3),
    (1070,N'SPAN',N'B404',N'Literary Tendencies and Masterpieces of Spain I',N'UG',N'(Prereq: BSPA 312 or consent of instructor) A survey of the masterworks and literary tendencies of Spain from the Middle Ages to the 17th century. Taught in Spanish.',3),
    (1071,N'SPAN',N'B405',N'Literary Tendencies and Masterpieces of Spanish America I',N'UG',N'(Prereq: BSPA 312 or consent of instructor) A survey of the masterworks and literary tendencies of Spanish America from the Pre-Columbian Era to Independence. Taught in Spanish.',3),
    (1072,N'SPAN',N'B406',N'Literary Tendencies and Masterpieces of Spain II',N'UG',N'(Prereq: BSPA 312 or consent of instructor) A survey of the masterworks and literary tendencies of Spain from the 18th century to present day. Taught in Spanish.',3),
    (1073,N'SPAN',N'B407',N'Literary Tendencies and Masterpieces of Spanish America II',N'UG',N'(Prereq: BSPA 312 or consent of instructor) A survey of the masterworks and literary tendencies of Spanish America from Independence to present day. Taught in Spanish.',3),
    (1074,N'SPAN',N'B417',N'Advanced Spanish for Business and The Professions',N'UG',N'(Prereq: BSPA 316 or consent of instructor) Vocabulary, concepts and oral/written skills necessary to communicate effectively in the social, cultural, or economic infrastructure of Hispanic countries. Introduction to the use of technology for the acquisition and processing of materials relevant to students? professional goals. Taught in Spanish.',3),
    (1075,N'SPAN',N'B499',N'Senior Seminar in Spanish',N'UG',N'(Prerequisite: Placement at 300 level on Phase II placement exam, grade of ?C? or better in at least one cultural history course (BSPA 400, 401, 402 or 403) and in at least one literature course (BSPA 404, 405, 406, or 407), or consent of instructor) A special seminar devoted to the in-depth study of selected subjects in Hispanic literature, culture, or language. Required for the intensive major in Spanish. Taught in Spanish.',3),
    (1076,N'STAT',N'B110',N'Introduction to Descriptive Statistics',N'UG',N'Computational and graphical techniques for organizing and presenting statistical data. Sample mean and sample variance, cross tabulation of categorical data, correlation and simple linear regression, quality control charts, statistical software.',3),
    (1077,N'STAT',N'B201',N'Elementary Statistics',N'UG',N'(Prereq: MATH B101 or higher or consent of instructor) An introductory course in the fundamentals of modern statistical methods. Topics include descriptive statistics, normal distributions, random sampling, statistical studies and ethics, probability, confidence intervals, tests of hypothesis, simple linear regression and correlation.',3),
    (1078,N'STAT',N'B202',N'Elementary Statistics Laboratory',N'UG',N'(Prereq: or Coreq: STAT B201) Experiments which illustrate important concepts of elementary statistics. Two laboratory hours per week.',3),
    (1079,N'STAT',N'B210',N'Elementary Statistics II',N'UG',N'A second course in statistics for students requiring knowledge of advanced procedures for descriptive and inferential statistics.  Topics include assessing normality, modeling nonlinear data, conditions and assumptions for inference, and application of multiple inference techniques.  Other topics chosen from: statistical quality control, random variables, binomial and geometric distributions, sampling and simulation, and non-parametric tests.  Prerequisite: STAT B201 or consent',3),
    (1080,N'STAT',N'B240',N'Fundamentals of Probability & Statistics',N'UG',N'(Prerequisite: MATH B141) Categorical and quantitative data; marginal and conditional distributions; normal model; association and correlation; linear regression; randomness and probability; sampling distribution models; confidence intervals and hypothesis tests; two-sample z-Test; two=sample t-Test; the paired t-Test. ',3),
    (1081,N'STAT',N'B340',N'Introduction to Probabilty and Statistics',N'UG',N'(Prereq: MATH B240 or consent.) Set theory; distributions of both discrete and continuous random variables; moments (including moment generating and characteristic functions); limit theorems; multivariate distributions including marginal and conditional distributions; confidence intervals and hypothesis tests.',3),
    (1082,N'THEA',N'B170',N'Fundamentals of Acting',N'UG',N'The techniques of body and voice control; improvisations; interpretation of characters: characterization applied in scenes.',3),
    (1083,N'THEA',N'B200',N'Understanding and Appreciation of Theatre',N'UG',N'An introduction to the understanding and appreciation of theatrical experience. Attendance at theatrical performances required.',3),
    (1084,N'THEA',N'B201',N'Introduction to Script Analysis',N'UG',N'In this course, students will apply research and analysis skills to dramatic texts with an eye toward serving theatrical productions.',3),
    (1085,N'THEA',N'B220',N'Theatre Laboratory',N'UG',N'Prerequisite: Instructor Consent) Supervised participation in theatre production. No formal class meetings. May be repeated for up to 8 credits. Course may not be used to fulfill GE requirement.',1),
    (1086,N'THEA',N'B301',N'Theater History I',N'UG',N'A study of the development of Western theatrical pratices including playwriting, acting, and design from ancient Greece to 1800.',3),
    (1087,N'THEA',N'B302',N'Theatre History II',N'UG',N'A study of the development of Western theatrical texts and practices including playwriting, acting, directing, and design from 1800 to the present',3),
    (1088,N'THEA',N'B303',N'Asian Theaters',N'UG',N'A survey of the theatrical genres and practices of Japan, China, Indonesia, and India.',3),
    (1089,N'THEA',N'B310',N'Reading and Performing Shakespeare',N'UG',N'(Prereq: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher) A course about how people read and perform Shakespeare in which students read and perform Shakespeare.',3),
    (1090,N'THEA',N'B322',N'Playwriting',N'UG',N'A workshop approach to playwriting that culminates in each student creating a production-ready one-act play.',3),
    (1091,N'THEA',N'B333',N'Directing',N'UG',N'(Prerequisite: THEA B170) An introduction to the history, principles, and practices of the art of stage direction including the selection, casting, and rehearsing of scenes to be presented in class.',3),
    (1092,N'THEA',N'B340',N'Oral Interpretation of Literature',N'UG',N'{=SPCH B340}  A course designed to give an understanding of the principles involved in extracting meaning from the printed page and the oral presentation of that meaning in a lucid and stimulating manner.',3),
    (1093,N'THEA',N'B341',N'Performance of Caring',N'UG',N'{?NURS B341} (Prerequisite: SOCY B101 or PSYC B101) The class aims to train students to act as Simulated Participants (SP) in the Nursing Simulation lab as patients and supporting roles (such as patient family members) in dynamic, realistic simulated healthcare experiences. These experiences help train future nurses in a lifelike way.  ',3),
    (1094,N'THEA',N'B370',N'Intermediate Acting',N'UG',N'A continuation of THEA B170.',3),
    (1095,N'THEA',N'B382',N'Theater for Young Audiences',N'UG',N'(Prerequisite: THEA B170 or instructor permission) Methods for creating theater for youth. A children''s play will be produced and performed. ',3),
    (1096,N'THEA',N'B399',N'Independent Study in Theatre',N'UG',N'Contract approval by instructor, advisor, Department Chair and Vice Chancellor for Academic Affairs is required.',3),
    (1097,N'THEA',N'B410',N'Introduction to Performance Studies',N'UG',N'An introduction to the field of performance studies including a history of the field, theories of performance, and a broad look at the different behaviors and cultural artifacts performance studies scholars examine.',3),
    (1098,N'THEA',N'B430',N'Performing Shakespeare',N'UG',N'This class helps students develop a mastery of methods that enable one to perform the works of Shakespeare with confidence and competence.',3),
    (1099,N'THEA',N'B439',N'Topics in Theater & Performance',N'UG',N'(Prerequisite: Sophomore Standing) Intensive study of selected practices, topics, currents of thought or interdisciplinary concerns. May be repeated for credit under a different topic. ',3),
    (1100,N'THEA',N'B466',N'Theater Internship',N'UG',N'This course provides a structured but flexible opportunity for students to earn course credit for an internship with a professional, community, or educational theater organization outside the university.',3),
    (1101,N'THEA',N'B472',N'Cinema',N'UG',N'{=ENGL B472}  (Prereq: ENGL B101 and ENGL B102) An investigation into the aesthetics of cinema. This course will also focus on the major genres.',3),
    (1102,N'THEA',N'B472L',N'Cinema Laboratory',N'UG',N'{=ENGL B472L}  Required viewing for THEA B472.',3),
    (1103,N'THEA',N'B481',N'History of Cinema',N'UG',N'Survey of the international cinema from 1945 to the present.',3),
    (1104,N'UNIV',N'B101',N'Student in the University',N'UG',N'The purposes of higher education and potential roles of the student within the university. Open to freshmen. Also open to other undergraduate students in their first semester of enrollment.',3),
    (1105,N'UNIV',N'B102',N'Well-Being in the University',N'UG',N'Well-Being in the University is designed to help first-year students who had experienced academic difficulties in their first semester better understand how their overall well-being impacts their success in college. Using a strengths-based approach, this course provides a general overview of the dimensions of wellness, helps students explore how their overall well-being effects their college success, and how they can use their strengths to overcome barriers to success in college.',1),
    (1106,N'UNIV',N'B150',N'Exploration of Nursing and Health Professions',N'UG',N'An exploration of health professions as a major and career, including the academic and vocational requirements as well as alternative majors in the health professions and other fields. This course will include exploration of majors, self-assessment, occupational information, and values clarification.  Prerequisite: Placement into MATH B111E and ENGL B101L',1),
    (1107,N'UNIV',N'B200',N'Lowcountry Studies Honors Seminar',N'UG',N'This seminar will an introduction to topics, information, reading, and class field trips to reflect the Lowcountry Studies honor''s experience in the first year of the program.  Topics covered will include common readings, discussion of current topics or current events, and professional development of the student.  Course can be taken for credit up to two semesters.',1),
    (1108,N'UNIV',N'B250',N'Career and Life Planning',N'UG',N'This course will aid in development of career and life-planning skills through exposure to self-assessment, occupational information, job search techniques, professional literature, experiential education, values clarification, and career ladder strategies.',1),
    (1109,N'UNIV',N'B401',N'Graduation with Leadership Distinction Captstone',N'UG',N'(Prerequisite: Junior or Senior Standing) Integration of a student''s program of study and "Students Connected" coursework. Course includes portfolio development, professional presentation, and transition into graduate school and/or employment.  ',1),
    (1110,N'UNIV',N'B491',N'Leadership in Practice',N'UG',N'This course explores the practice of leadership and engages outstanding students in an active dialogue about the challenges of being a leader within the university context and beyond.',1),
    (1111,N'USCB',N'999',N'NULL',N'UG',N'NULL',3);

